(3, 'teacher1361', '136', 'MARIKINA SCIENCE HIGH SCHOOL', 'JAN MARI    . BUENAFLOR', 'WELCOME TO BIOTECHNOLOGY CLASS!', '', '<p><span style=\"color:#8e44ad\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Welcome students! Please make sure to check your e-learning platform every day for our subject&#39;s announcements, instructions, and assessments!&nbsp;<img alt=\"smiley\" src=\"https://www.elearningmarikina.ph/ckeditor/plugins/smiley/images/regular_smile.png\" style=\"height:23px; width:23px\" title=\"smiley\" /></span></span></span></p>\r\n', '08', '2022', '24'),
(4, 'teacher1362', '136', 'MARIKINA SCIENCE HIGH SCHOOL', 'JAN MARI    . BUENAFLOR', 'WELCOME TO ENVIRONMENTAL SCIENCE CLASS! ', '', '<p><strong><span style=\"color:#27ae60\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Welcome students!&nbsp;</span></span></span></strong></p>\r\n\r\n<p><strong><span style=\"color:#27ae60\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Please make sure to check your e-learning platform every day for subject&#39;s announcements, instructions, and assessments!</span></span></span></strong>&nbsp;<img alt=\"smiley\" src=\"https://www.elearningmarikina.ph/ckeditor/plugins/smiley/images/regular_smile.png\" style=\"height:23px; width:23px\" title=\"smiley\" /></p>\r\n', '08', '2022', '24'),
(5, 'teacher11', '1', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARCO FRANKLIN  C. . LEYCO', 'sample', '', '<p><img alt=\"Beautiful View Wallpapers - Top Free Beautiful View Backgrounds -  WallpaperAccess\" src=\"https://wallpaperaccess.com/full/1217962.jpg\" /><img alt=\"Beautiful View Wallpapers - Top Free Beautiful View Backgrounds -  WallpaperAccess\" src=\"https://wallpaperaccess.com/full/1217962.jpg\" /></p>\r\n', '08', '2022', '25'),
(6, 'teacher10471', '1047', 'SSS NATIONAL HIGH SCHOOL', 'MARIA CRISTINA  N . CORTADO', 'English- First Quarter Module 1 Noting Context Clues', '', '<p>Good day Grade 8-Artful/Careful Set A and Set B Learners!</p>\r\n\r\n<p>Kindly see the link of Module # 1 for English wit the title NOTING CONTEXT CLUES in the DLM -Standard Area.&nbsp;</p>\r\n\r\n<p>Read and answer the following:&nbsp;</p>\r\n\r\n<p>Objectives of the lesson -WHAT I NEED TO KNOW-p. 1 of Module 1</p>\r\n\r\n<p>Answer -WHAT I KNOW -PP.1,2 of Module 1</p>\r\n\r\n<p>Read and study its examoples on -WHAT IS IT pp. 5,6 of Module 1</p>\r\n\r\n<p>Answer -WHAT&#39; S MORE&nbsp; Activities&nbsp; 1-3&nbsp; &nbsp;pp. 6-9 of Module 1</p>\r\n\r\n<p>Submit your answers in the Enote. As much as possible do it in a word file .Do not take pictures of your answers because there will be&nbsp; some difficulty in uploading it.&nbsp;</p>\r\n\r\n<p>Thank you.</p>\r\n', '08', '2022', '28'),
(7, 'teacher10472', '1047', 'SSS NATIONAL HIGH SCHOOL', 'MARIA CRISTINA  N . CORTADO', 'Power Point Presentation for Module 1 ', '', '<p>Kindly see the PPTs in the DLM Supplementary Area of Elearning.</p>\r\n\r\n<p>Thank you.</p>\r\n', '08', '2022', '28'),
(8, 'teacher13591', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'WELCOME', '', '<p>Good Day Tech. Draf Learners!</p>\r\n\r\n<p>Welcome to Technical Drafting Class.&nbsp;</p>\r\n\r\n<p>Let&#39;s start this new school year with another learnings and develop more are skills.&nbsp;</p>\r\n\r\n<p>Have Fun and Enjoy!&nbsp;<img alt=\"laugh\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/teeth_smile.png\" style=\"height:23px; width:23px\" title=\"laugh\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-Ma&#39;am Salamat</p>\r\n\r\n<p>Don&#39;t forget to follow the Square M Tutorial in FB also in Youtube for the tutorials and demonstration about our lesson.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '08', '2022', '28'),
(9, 'teacher741', '74', 'MARIKINA SCIENCE HIGH SCHOOL', 'DAISY  B. . REVILLA', 'Module 1_Plate Tectonics and Geologic Activities', '', '<p>Good day and Mabuhay learners,</p>\r\n\r\n<p>Welcome to <strong>Q1M1</strong> week 2: <strong>Plate Tectonics and Geologic Activities.</strong></p>\r\n\r\n<p>This module aims to help you understand the relationship between the locations of volcanoes, earthquake epicenters, and mountain ranges.<br />\r\nThe module is divided into four lessons, namely:<br />\r\n? Lesson 1 &ndash; The Tectonic Plates<br />\r\n? Lesson 2 &ndash; Evidence Supporting Lithosphere Division<br />\r\n? Lesson 3 &ndash; Locating the Earthquake Epicenters<br />\r\n? Lesson 4 &ndash; Distribution of active volcanoes, earthquake epicenters, and major mountain belts</p>\r\n\r\n<p>After going through this module, you are expected to <strong>describe and relate&nbsp;the distribution of active volcanoes, earthquake epicenters, and major mountain belts to Plate Tectonic Theory. S10ES &ndash;Ia-j-36.1.</strong> Specifically, you are expected to:<br />\r\n1. describe earth&#39;s lithosphere;<br />\r\n2. differentiate oceanic and continental crust;<br />\r\n3. identify the major and minor tectonic plates;<br />\r\n4. determine the scientific basis for dividing the tectonic plates;<br />\r\n5. locate the earthquake epicenter using the triangulation method;<br />\r\n6. describe the distribution of active volcanoes, earthquake epicenters, and<br />\r\nmajor mountain belts, and<br />\r\n7. relate the distribution of active volcanoes, earthquake epicenters, and major<br />\r\nmountain belts to Plate Tectonics Theory.</p>\r\n\r\n<p><strong>For your activities on August 29, 2022 (Monday):&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </strong><strong>NOTE:</strong>&nbsp; The performance of the activities below is optional because August 29, 2022, is a holiday.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.&nbsp; Access the digital copy of Quarter 1&nbsp;Module 1: Plate Tectonics and Geologic Activities&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2.&nbsp; Before going through the lessons, answer the pre-test, &ldquo;What I know&rdquo; on pages 2-3 of module 1.&nbsp; 3.&nbsp;&nbsp;Read and understand lessons 1, 2, &amp; 4&nbsp;of Module 1.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4. For the additional learning material, view the PowerPoint presentation in the supplementary DLM.<br />\r\n5. Do the following tasks:&nbsp;<br />\r\n&nbsp; &nbsp; Lesson 1 &ndash; The Tectonic Plates<br />\r\n&nbsp; &nbsp;? What I Have Learned 6, questions 1-3<br />\r\n&nbsp; &nbsp; Lesson 2 - Evidence Supporting Lithosphere Division<br />\r\n&nbsp; &nbsp;? What&rsquo;s I Have Learned p.14, questions 1-3<br />\r\n6. Compare your answers to the answer key given at the end of the module.&nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '08', '2022', '28'),
(10, 'teacher742', '74', 'MARIKINA SCIENCE HIGH SCHOOL', 'DAISY  B. . REVILLA', 'Module 1_Plate Tectonics and Geologic Activities', '', '<p>Good day and Mabuhay learners,</p>\r\n\r\n<p>Welcome to <strong>Q1M1</strong> week 2: <strong>Plate Tectonics and Geologic Activities.</strong></p>\r\n\r\n<p>This module aims to help you understand the relationship between the locations of volcanoes, earthquake epicenters, and mountain ranges.<br />\r\nThe module is divided into four lessons, namely:<br />\r\n? Lesson 1 &ndash; The Tectonic Plates<br />\r\n? Lesson 2 &ndash; Evidence Supporting Lithosphere Division<br />\r\n? Lesson 3 &ndash; Locating the Earthquake Epicenters<br />\r\n? Lesson 4 &ndash; Distribution of active volcanoes, earthquake epicenters, and major mountain belts</p>\r\n\r\n<p>After going through this module, you are expected to <strong>describe and relate&nbsp;the distribution of active volcanoes, earthquake epicenters, and major mountain belts to Plate Tectonic Theory. S10ES &ndash;Ia-j-36.1.</strong> Specifically, you are expected to:<br />\r\n1. describe earth&#39;s lithosphere;<br />\r\n2. differentiate oceanic and continental crust;<br />\r\n3. identify the major and minor tectonic plates;<br />\r\n4. determine the scientific basis for dividing the tectonic plates;<br />\r\n5. locate the earthquake epicenter using the triangulation method;<br />\r\n6. describe the distribution of active volcanoes, earthquake epicenters, and<br />\r\nmajor mountain belts, and<br />\r\n7. relate the distribution of active volcanoes, earthquake epicenters, and major<br />\r\nmountain belts to Plate Tectonics Theory.</p>\r\n\r\n<p><strong>For your activities on August 29, 2022 (Monday):&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </strong><strong>NOTE:</strong>&nbsp; The performance of the activities below is optional because August 29, 2022, is a holiday.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.&nbsp; Access the digital copy of Quarter 1&nbsp;Module 1: Plate Tectonics and Geologic Activities&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2.&nbsp; Before going through the lessons, answer the pre-test, &ldquo;What I know&rdquo; on pages 2-3 of module 1.&nbsp; 3.&nbsp;&nbsp;Read and understand lessons 1, 2, &amp; 4&nbsp;of Module 1.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4. For the additional learning material, view the PowerPoint presentation in the supplementary DLM.<br />\r\n5. Do the following tasks:&nbsp;<br />\r\n&nbsp; &nbsp; Lesson 1 &ndash; The Tectonic Plates<br />\r\n&nbsp; &nbsp;? What I Have Learned 6, questions 1-3<br />\r\n&nbsp; &nbsp; Lesson 2 - Evidence Supporting Lithosphere Division<br />\r\n&nbsp; &nbsp;? What&rsquo;s I Have Learned p.14, questions 1-3<br />\r\n6. Compare your answers to the answer key given at the end of the module.&nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '08', '2022', '28'),
(13, 'teacher1363', '136', 'MARIKINA SCIENCE HIGH SCHOOL', 'JAN MARI    . BUENAFLOR', 'BIOTECHNOLOGY QUARTER 1 MODULE 1', '', '<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\"><strong>Good Morning Grade 8! Kindly access the link and download our First Quarter Module for Biotechnology. (<span style=\"color:#2980b9\">https://drive.google.com/drive/folders/1aRNMUoSjYSRNP_TdAy2tipMN03_zIyOv?fbclid=IwAR0si2-61NJXnhq_cauZjonKvap7szHeWs48TyKwsyDv2BMdDM9q7xVZj6E</span>)</strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '08', '2022', '28'),
(14, 'teacher1364', '136', 'MARIKINA SCIENCE HIGH SCHOOL', 'JAN MARI    . BUENAFLOR', 'ENVISCI Q1 MODULE 1', '', '<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\"><strong>Good Morning Grade 7! Kindly access the link and download our First Quarter Module 1 for Envisci!</strong> (<span style=\"color:#2980b9\">https://drive.google.com/drive/folders/1UC6ro1RXRmg0FrQjO9bJU4cJs6EINUl_?fbclid=IwAR0si2-61NJXnhq_cauZjonKvap7szHeWs48TyKwsyDv2BMdDM9q7xVZj6E</span>)</span></span></p>\r\n', '08', '2022', '28'),
