(16, 'teacher201', '20', 'MARIKINA SCIENCE HIGH SCHOOL', 'EFREN  R. . MANZANO', 'Introduction to Robotics', '', '<p>Good Morning and Mabuhay!</p>\r\n\r\n<p>Welcome to Robotics Intelligent Machine Class!</p>\r\n\r\n<p>I hope that Everything is Fine and Let&#39;s us Enjoy Learning and have Fun...</p>\r\n\r\n<p>Module 1 I(ntroduction to Rbotics) is to help you develop knowledge, skills, and attitudes in the performance of Robotics. The module is composed of one lesson which is all about Introduction and Choosing a Robotics Platform.</p>\r\n\r\n<p>For your Activity:</p>\r\n\r\n<p>Activity 1<br />\r\nWhat I Know - Read andunderstand the questions that will check prior knowledge, understanding, and skills in this module&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Activity 2<br />\r\nIdentifying Robotics Platform Read and understand the questions that will check prior knowledge, understanding, and skills in this module</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Goodluck and See you!</p>\r\n', '08', '2022', '29'),
(17, 'teacher1463', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Q1 Week 2 Module 1 Rectangular Coordinate System', '', '<p><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\"><span style=\"color:#27ae60\"><em><strong>Good day Grade 10 Learners!</strong></em></span> </span></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">I hope everything is doing well.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-family:Georgia, serif\"><span style=\"font-size:12px\">You can access the Analytic Geometry Modules for the 1st Quarter in the DLM - Supplementary tab. In case you want to download it and view it offline, you can also access it here:&nbsp;</span></span><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\"><em><strong><a href=\"https://bit.ly/Q1AnGeomModules\">https://bit.ly/Q1AnGeomModules</a>.</strong></em></span></span></p>\r\n\r\n<p style=\"list-style-type:decimal\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">Also, in the </span><em><span style=\"color:#c0392b\"><strong>Discussion board</strong></span></em><span style=\"color:#000000\"><strong> </strong>of the eLearning Platform, jot down 3 important key takeaways from the watched video:&nbsp;<em><strong><a href=\"https://www.youtube.com/watch?v=uxvs0yhOts0\">https://www.youtube.com/watch?v=uxvs0yhOts0</a></strong></em></span></span></span></p>\r\n\r\n<p style=\"list-style-type:decimal\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">Lastly, kindly prepare the following materials for the face-to-face session:</span></span></span></p>\r\n\r\n<ol>\r\n	<li style=\"list-style-type: lower-alpha;\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">Printed Marikina Map in a short bond paper <em>(Kindly make sure that the trademarks/places are readable enough)</em></span></span></span></li>\r\n	<li style=\"list-style-type: lower-alpha;\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">pencil and/or coloring pens</span></span></span></li>\r\n	<li style=\"list-style-type: lower-alpha;\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">eraser</span></span></span></li>\r\n	<li style=\"list-style-type: lower-alpha;\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12px\"><span style=\"color:#000000\">ruler</span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">See you in our face-to-face class!</span></span></p>\r\n\r\n<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">~&nbsp;<span style=\"color:#f1c40f\"><em><strong>Ms. Rina</strong></em></span>&nbsp; (?&#39;?&#39;?)</span></span></p>\r\n', '08', '2022', '29'),
(18, 'teacher4291', '429', 'SSS NATIONAL HIGH SCHOOL', 'SHIELA  B. . CAINDOY', 'KAHULUGAN NG EKONOMIKS', '', '<p>Magandang Araw! Para sa Asignaturang Araling Panlipunan. Pagsagot ng SLMs mula Subukin hanggang Paglalahat/ Isaisip Sagutan ang <strong><span style=\"color:#3498db\">Subukin sa pahina 2 ng Modyul 1</span></strong> Basahin at unawin ang <strong><span style=\"color:#e74c3c\">Tuklasin at Suriin sa pahina 3-5 ng Modyul 1</span></strong>. <em>Sagutan ang Paglalahat/Isaisip (Isulat ang sagot sa papel. Ipapasa dito sa E-learning)</em></p>\r\n', '08', '2022', '29'),
