(25, 'teacher18201', '1820', 'SSS NATIONAL HIGH SCHOOL', 'ANA ROSE  P. . DELIMA', 'Science - Q1_Module 1 Newtons Law of Motion', '', '<h1><span style=\"color:#2c3e50\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">GOOD DAY!</span></span></span></h1>\r\n\r\n<p><span style=\"color:#c0392b\"><span style=\"font-size:16px\">-For our Asynchronous in Science, Please READ and ANSWER the following tasks:</span></span></p>\r\n\r\n<p>Lesson 1: Newton&#39;s First Law of Motion- Law of Inertia</p>\r\n\r\n<p><img alt=\"??\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8d/1/16/2611.png\" style=\"height:16px; width:16px\" />What&#39;s New pp. 5-6</p>\r\n\r\n<p><img alt=\"??\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8d/1/16/2611.png\" style=\"height:16px; width:16px\" />What&#39;s More pp. 8-9</p>\r\n\r\n<p><img alt=\"??\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8d/1/16/2611.png\" style=\"height:16px; width:16px\" />What I Have Learned pp. 9-10</p>\r\n\r\n<p>Lesson 2: Newton&#39;s 2nd Law of Motion- Law of Acceleration</p>\r\n\r\n<p><img alt=\"??\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8d/1/16/2611.png\" style=\"height:16px; width:16px\" />What&#39;s New pp. 11-12</p>\r\n\r\n<p><img alt=\"??\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8d/1/16/2611.png\" style=\"height:16px; width:16px\" />What&#39;s More pp. 14-15</p>\r\n\r\n<p><img alt=\"??\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t8d/1/16/2611.png\" style=\"height:16px; width:16px\" />What I Have Learned p. 15</p>\r\n\r\n<p>to be submitted on your face to face class (Synchrnous class).&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you and Keep Safe.</p>\r\n\r\n<p>Ms. Delima</p>\r\n', '08', '2022', '29'),
(26, 'teacher771', '77', 'MARIKINA SCIENCE HIGH SCHOOL', 'MYRTLE GWEN   D. . DELA CRUZ', 'Introduction to China ', '', '<p><span style=\"color:#c0392b\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">D&agrave; ji? h?o t&oacute;ngxu&eacute;men!</span></span></span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\">To prepare you for our first Mandarin class, please do the following:</span></span></p>\r\n\r\n<p><span style=\"color:#2c3e50\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\">1. Access the Week 2 WLP and the uploaded Canva Presentation. </span></span></span></p>\r\n\r\n<p><span style=\"color:#27ae60\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\">https://www.canva.com/design/DAFJLLOfU94/kXN4ey5QWBLZxsL-at5_IA/view?utm_content=DAFJLLOfU94&amp;utm_campaign=designshare&amp;utm_medium=link&amp;utm_source=publishpresent</span></span></span></p>\r\n\r\n<p><span style=\"color:#2c3e50\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\">2.&nbsp;The learners shall answer Activity 1 in the Formative Assessment tab of the e-Learning platform.</span></span></span></p>\r\n\r\n<p><span style=\"color:#2c3e50\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\">3. The learners need to prepare pictures of Chinese historical places and outstanding contributions to society to bring on the next synchronous class for your Collage Making Activity.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"color:#c0392b\"><span style=\"font-family:Comic Sans MS,cursive\">Xi&egrave; xi&egrave; n?men.</span></span></span></p>\r\n', '08', '2022', '29'),
