pan></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;Also, please&nbsp; research and read about &quot;LANDSCAPE PAINTING&quot; it will be your synchronous activity in MAPEH that you&#39;re going to accomplish in school. Please bring the following:</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><img alt=\"enlightened\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/lightbulb.png\" style=\"border:0px; box-sizing:border-box; height:23px; max-height:25%; max-width:25%; vertical-align:middle; width:23px\" title=\"enlightened\" />OSLO paper or water color paper, Painting materials or any coloring materials and Pencil.&nbsp;</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><img alt=\"enlightened\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/lightbulb.png\" style=\"border:0px; box-sizing:border-box; height:23px; max-height:25%; max-width:25%; vertical-align:middle; width:23px\" title=\"enlightened\" />1/4 Index Card (orange)</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '08', '2022', '29'),
(33, 'teacher14211', '1421', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROXANNE  R . TAMAYO', 'TLE - ENTREPRENEURSHIP - MODULE 1 - LESSON 1', '', '<p><strong>Good day eLearners! Welcome back to school!</strong></p>\r\n\r\n<p><strong>I hope you&#39;re always safe and doing great.&nbsp;For our first lesson this quarter, kindly do the following tasks:</strong></p>\r\n\r\n<p style=\"margin-left:40px\">1. Watch my video discussion about <strong>&quot;Entrepreneurship: Understanding its Concept&quot;.&nbsp;</strong>Take note of some important details.</p>\r\n\r\n<p style=\"margin-left:80px\"><em><strong>video link:</strong></em>&nbsp;<a href=\"https://youtu.be/2xsoxjERbV8\">https://youtu.be/2xsoxjERbV8</a></p>\r\n\r\n<p style=\"margin-left:40px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:40px\">2. Read <span style=\"color:#c0392b\"><strong><em>Module 1: Lesson 1: The concept of Entrepreneurship</em>.</strong></span> It is already uploaded in our Supplementary Materials Tab.&nbsp;</p>\r\n\r\n<p style=\"margin-left:40px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:40px\">3. Answer <strong>&quot;What&#39;s More&quot; </strong>and <strong>&quot;What I have Learned&quot;&nbsp;</strong>on page 5. Do it in your notebook.</p>\r\n\r\n<p style=\"margin-left:40px\">&nbsp;</p>\r\n', '08', '2022', '29'),
(34, 'teacher4263', '426', 'SSS NATIONAL HIGH SCHOOL', 'GRACE  G. . SANTOS', 'AKO AY AKO DAHIL SA AKING PAMILYA', '', '<p style=\"text-align:left\"><span style=\"color:#000000; font-family:arial\"><span style=\"font-size:14px\"><strong>Magandang Buhay, Mabuting Tao!</strong></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000; font-family:arial\"><span style=\"font-size:14px\"><strong>Narito ang inyong gawain para sa araw na ito:&nbsp;</strong></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000; font-family:arial\"><span style=\"font-size:14px\"><strong>Paalala: Isulat ang inyong sagot sa isang buong papel.</strong></span></span></p>\r\n\r\n<p style=\"text-align:left\">I-click ang DLM upang makita ang Module 1.</p>\r\n\r\n<p style=\"margin-left:48px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive\"><strong>Basahin ang ALAMIN pahina 1.</strong></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:48px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive\"><strong><span style=\"color:black\">Sagutin/Gawin ang mga sumusunod:</span></strong></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:25px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive\"><strong><span style=\"color:black\">a.&nbsp;&nbsp; Subukin &ndash; p. 1-2</span></strong></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:25px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive\"><strong><span style=\"color:black\">b.&nbsp;&nbsp; Tuklasin &ndash; p. 4-5</span></strong></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:25px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive\"><strong><span style=\"color:black\">c.&nbsp;&nbsp; Suriin &ndash; pp. 5 at pp 12-7 at pp 14-15</span></strong></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:25px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive\"><strong><span style=\"color:black\">d.&nbsp;&nbsp; Pagyamanin &ndash; p. 6-7 at pp. 14-15</span></strong></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:28px; text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive\"><strong><span style=\"color:black\">e.&nbsp;&nbsp; Isaisip &ndash; pp. 16-18</span></strong></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '08', '2022', '29'),
(35, 'teacher761', '76', 'MARIKINA SCIENCE HIGH SCHOOL', 'BELENETTE  T. . HOMAN', 'English8', '', '<p>Good morning Grade 8 Learners!</p>\r\n\r\n<p>Reminder on the activities that you have to work on</p>\r\n\r\n<p>1. Home-Based Activities (Concept Exploration)&nbsp;</p>\r\n\r\n<p>What&#39;s In, What&#39;s New and What&#39;s More Activity 1 and 2</p>\r\n\r\n<p>Write your answers in your notebook.</p>\r\n\r\n<p>2. Home-Based Activities (Learner-Generated Output)</p>\r\n\r\n<p>Write your answers on a 1/2 crosswise and bring it during face to face classes&nbsp;</p>\r\n\r\n<p>When you write your answers it should be with the letters and words</p>\r\n\r\n<p>Thank you!</p>\r\n', '08', '2022', '30'),
(36, 'teacher4131', '413', 'SSS NATIONAL HIGH SCHOOL', 'ALMIRA  V. . ESCORPISO', 'Homework for Module 1 ESP', '', '<p>Sagutan sa notebook ang tayahin at karagdagang gawain.</p>\r\n', '08', '2022', '30'),
(37, 'teacher13592', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Welcome Coachable', '', '<p>Good Day Tech. Draf Learners!</p>\r\n\r\n<p>Welcome to Technical Drafting Class.&nbsp;</p>\r\n\r\n<p>Let&#39;s start this new school year with another learnings and develop more are skills.&nbsp;</p>\r\n\r\n<p>Have Fun and Enjoy!&nbsp;<img alt=\"laugh\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/teeth_smile.png\" title=\"laugh\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Don&#39;t forget to follow the Square M Tutorial in FB also in Youtube for the tutorials and demonstration about our lesson.</p>\r\n\r\n<p>-Ma&#39;am Salamat</p>\r\n', '08', '2022', '30'),
(38, 'teacher961', '96', 'MARIKINA SCIENCE HIGH SCHOOL', 'GEMMELYN  P. . RODRIGUEZ', 'Learner Generated Output Task', '', '<h1>Goodmorning, Grade 8 students!&nbsp;<img alt=\"heart\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/heart.png\" style=\"height:23px; width:23px\" title=\"heart\" /></h1>\r\n\r\n<h3>I have attached the Learner Generated Output activity already (Complete the table). Kindly accomplish until September 5, 2022.&nbsp;</h3>\r\n\r\n<h3>Should you have any concerns, don&#39;t hesitate to PM me.</h3>\r\n\r\n<h3>//Ms. Gem</h3>\r\n', '08', '2022', '30'),
(39, 'teacher13593', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Welcome Comprehendable', '', '<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Good Day Tech. Draf Learners!</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Welcome to Technical Drafting Class.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Let&#39;s start this new school year with another learnings and develop more are skills.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Have Fun and Enjoy!&nbsp;<img alt=\"laugh\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/teeth_smile.png\" style=\"border:0px; box-sizing:border-box; max-height:25%; max-width:25%; vertical-align:middle\" title=\"laugh\" /></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Don&#39;t forget to follow the Square M Tutorial in FB also in Youtube for the tutorials and demonstration about our lesson.</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">-Ma&#39;am Salamat</span></span></span></p>\r\n', '08', '2022', '30'),
(40, 'teacher13594', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Q1_Module 1_Foundation Planning', '', '<p>Good day Tech. Draft Learners!</p>\r\n\r\n<p>Don&#39;t forget to READ and STUDY our first lesson in TD entitled FOUNDATION PLANNING.</p>\r\n\r\n<p>All activities during synchronous class (at school) will be base on that module.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you and have a great day!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-Ma&#39;am Salamat</p>\r\n', '08', '2022', '30'),
(44, 'teacher152', '15', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROBIN  R. . LEYCO', 'second try ', '', '<p><img alt=\"Back To School | Educator Placement Agency\" src=\"http://educatorsally.usmblogs.com/files/2015/09/backtoschool.jpg\" /></p>\r\n', '08', '2022', '31'),
(45, 'teacher153', '15', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROBIN  R. . LEYCO', 'try ulit', '', '<p><img alt=\"Back to school tips for kids with IEPs - Arnold Advocacy – Special  Education Solutions\" src=\"https://www.arnoldadvocacy.com/wp-content/uploads/2016/08/Back-to-School-Tips-for-our-kids-with-IEPs.jpg\" /></p>\r\n', '08', '2022', '31'),
(47, 'teacher7071', '707', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'BERNADETTE  E . SENADO', '', '', '<p style=\"text-align:center\"><span style=\"color:#9b59b6\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\"><strong>WELCOME BACK TO SCHOOL ELEARNERS!</strong></span></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-family:Comic Sans MS,cursive\">We&#39;re glad you can now enjoy and maximize both Face to Face and Online Classes! Also, congratulations because you continue to thrive despite the pandemic. Hope you all have a meaningful and fruitful school year! :)</span></p>\r\n', '08', '2022', '31'),
(48, 'teacher10371', '1037', 'SSS NATIONAL HIGH SCHOOL', 'ANALENE  N . FULLIDO', 'WELCOME TO MATHEMATICS 10!', 'image/20220831_102015.jpg', '<p><strong>Hi, 10-Credible!</strong></p>\r\n\r\n<p>I am very happy to welcome you all in our Math 10 class for School Year 2022-2023.&nbsp;</p>\r\n\r\n<p>Here are some reminders for our Mathematics class:&nbsp;<br />\r\n<br />\r\n<strong>A. MATH REQUIREMENTS:&nbsp;</strong></p>\r\n\r\n<p>1. Blue Notebook<br />\r\n2. 1/2 Index card (WHITE) with 1x1 ID Picture located at the top right. This will be your SCORE CARD for the entire school year.&nbsp;<br />\r\n3. Pad Paper&nbsp;<br />\r\n<br />\r\n<strong>B. For your first Performance Task, CREATE YOUR LIFE ROAD.</strong> Choose 7 most important/memorable events in your life and make a creative life road.&nbsp;<br />\r\n<u><strong>This will be 30 points.</strong></u>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>10 points - complete events with dates</li>\r\n	<li>10 points - chronological arrangement of the events</li>\r\n	<li>10 points - creativity</li>\r\n</ul>\r\n\r\n<p>You will submit your work next week during our Math Class. <em>(Please see example below)</em><br />\r\n<br />\r\n<u><strong>HERE ARE THE THINGS I WILL CHECK NEXT WEEK:&nbsp;</strong></u><br />\r\n1. Blue notebook with NOTES from Module 1.&nbsp;<br />\r\n2. index card</p>\r\n\r\n<p>3. LIFE ROAD - Performance Task</p>\r\n', '08', '2022', '31'),
(51, 'teacher4381', '438', 'SSS NATIONAL HIGH SCHOOL', 'CARLO   . DELA CRUZ', '', 'image/Green Minimalist Welcome to Our Science Class YouTube Intro Video.png', '<p>Welcome to our Science Class!&nbsp;</p>\r\n', '08', '2022', '31'),
(54, 'teacher10608311', '106', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'BRYAN  D . AURELIO', 'WEEK 1-FILIPINO 7', 'image/FILIPINO 7 Orientation at W1-Gawaing Asycnhronous.png', '<p><span style=\"font-size:18px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\"><strong>Maligayang Pagbabalik sa ating eLearning Platform!&nbsp;</strong></span></span></p>\r\n', '08', '2022', '31'),
(56, 'teacher104709012', '1047', 'SSS NATIONAL HIGH SCHOOL', 'MARIA CRISTINA  N . CORTADO', 'Reminders for SET A Learners ', 'image/Post.PNG', '<p>Good morning Set A Learners!</p>\r\n\r\n<p>Read module 1 of English and do the ff:&nbsp;</p>\r\n\r\n<p>Read What I Need To Know and What Is It&nbsp;</p>\r\n\r\n<p>Answer the foolowing:</p>\r\n\r\n<p>What I Know pp.1-2</p>\r\n\r\n<p>What&#39;s More pp.6-7</p>\r\n\r\n<p>What I Can Do pp.10,11</p>\r\n\r\n<p>All papers should be submitted next week.(Monday)</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '01'),
(57, 'teacher104709013', '1047', 'SSS NATIONAL HIGH SCHOOL', 'MARIA CRISTINA  N . CORTADO', 'Reminders for Set B Learners', '', '<p>Good morning Set B Learners!</p>\r\n\r\n<p>Please do the following :</p>\r\n\r\n<p>For those who did the 2nd activity with 8 items -Answer pp.8,9 of What&#39;s More Activity 3 only of Module 1</p>\r\n\r\n<p>For those who di the 2nd activity with 10 items -Answer pp.11,12 of Assessment of Module 1</p>\r\n\r\n<p>For those who did the 2nd activity with 11 items -Answer pp.12,13 of Additional activity of Module 1.&nbsp;</p>\r\n\r\n<p>Submit all of the outputs on Tuesday if you can&#39;t access Elearning&#39;s Enote just submit your paper on Tuesday.</p>\r\n', '09', '2022', '01');
INSERT INTO `announcement` (`id`, `anounceid`, `user_id`, `school`, `usernam`, `title`, `larawan`, `message`, `buwan`, `taon`, `araw`) VALUES
(58, 'teacher70709011', '707', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'BERNADETTE  E . SENADO', '', '', '<p>Blessed day Grade 12,&nbsp;</p>\r\n\r\n<p>Hope all is well with you!&nbsp;</p>\r\n\r\n<p>Brace yourself because next week, we will officially start our lesson in UCSP.&nbsp;</p>\r\n\r\n<p>In order to be prepared for the discussion and other activities in our F2F class next week, please diligently and excellently do the following:&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Read Chapter 1 of the UCSP book by Atienza et al, 2018 uploaded in the supplementary materials section or gdrive. </span></span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Check your knowledge. Answer the activities below either on their notebook or Microsoft Word.</span></span></span></span></span></li>\r\n</ol>\r\n\r\n<ol>\r\n	<li style=\"list-style-type:none\">1.<span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><strong><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Exercise 1: Answer the following</span></span></span></strong><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">:&nbsp; </span></span></span></span></span>\r\n\r\n	<ol style=\"list-style-type:lower-alpha\">\r\n		<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Define the following:</span></span></span></span></span></li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - identity&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - culture&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - society&nbsp;</p>\r\n\r\n<ol>\r\n	<li style=\"list-style-type:none\">&nbsp; &nbsp; &nbsp; &nbsp;b.&nbsp;<span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">What are the two main characteristics of identity? </span></span></span></span></span></li>\r\n	<li style=\"list-style-type:none\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; &nbsp; &nbsp; &nbsp;c. Why is important to know and understand your&nbsp; &nbsp; &nbsp; &nbsp; </span></span></span></span></li>\r\n	<li style=\"list-style-type:none\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;personal identity and the identity of other people?</span></span></span></span></li>\r\n	<li style=\"list-style-type:none\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span></span></span>d.&nbsp;<span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">How does social, political and cultural change shape&nbsp; </span></span></span></span></li>\r\n	<li style=\"list-style-type:none\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;an individual or group identity? Give a concrete </span></span></span></span></li>\r\n	<li style=\"list-style-type:none\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; example. </span></span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:50px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Upload this on the enote or gdrive (provided by your teacher) with the file name: <strong>Q1_W3_E1. </strong></span></span></span></span></p>\r\n\r\n<ol>\r\n	<li style=\"list-style-type:none\">\r\n	<ol start=\"2\">\r\n		<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><strong><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Exercise 2: Answer Assessment B on p. 12 of the book. </span></span></span></strong>&nbsp;<span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Upload your output on the enote or gdrive (provided by your teacher) with the file name: <strong>Q1_W3_E2. </strong></span></span></span></span></li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">C. Watch the following youtube videos to expand your knowledge on the nature and goals of anthropology, sociology and political science.</span></span></span></span></p>\r\n\r\n<ol>\r\n	<li><span sty