(75, 'teacher300009023', '3000', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'JENNIFER  A . DELA ROSA', '', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Hello eLearners!</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Here&#39;s&nbsp; your guide for our Week 2:</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a.Watch the video discussion on &ldquo;Entrepreneurship: Understanding its Concept&rdquo; video link:https://youtu.be/2xsoxjERbV8</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">b.Read &ldquo;Module 1 Lesson 1: Understanding the Concept of Entrepreneurship&rdquo;</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">c. For practice exercises, answer &quot;What&#39;s More&quot;and &quot;What I have Learned&quot; on page 5. Do it in your notebook.</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">d. Dont hesistate to ask question you can message me through messenger:)</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Happy Learning:)</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ma&#39;am Jhen</span></span></p>\r\n', '09', '2022', '02'),
