(83, 'teacher12009051', '120', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'LESLIE MICHELLE  M . SALCEDA', '', '', '<p>Good day!</p>\r\n\r\n<p>For this week&#39;s tasks kindly accomplish the following in&nbsp;<strong>Module 1-Use of Information from Texts Read/Listened to </strong>and write your answers in your English Notebook:</p>\r\n\r\n<p>a. What I Need to Know</p>\r\n\r\n<p>b. What I Know &ndash; p. 1</p>\r\n\r\n<p>c. What&rsquo;s New &ndash; pp. 2-3</p>\r\n\r\n<p>d. What Is It &ndash; pp. 3-4</p>\r\n\r\n<p>e. What&rsquo;s More (Activity 1) &ndash; p. 5</p>\r\n\r\n<p>f. What I have Learned &ndash; p. 9</p>\r\n\r\n<p>Afterwards, compare your answer to the answer key given in the module.</p>\r\n\r\n<p>For the&nbsp;<em>Performance Task,&nbsp;</em>do the activity in&nbsp;<strong>What Can I Do</strong>&nbsp;(pp. 9-10) and submit it in the eNOTE on the eLearning platform. Please be reminded that you will present your work during face-to-face class.&nbsp;</p>\r\n\r\n<p>You may access the module in eLibRO or from this link:<br />\r\n<a href=\"https://tinyurl.com/4bz88dzr\">https://tinyurl.com/4bz88dzr</a><br />\r\n<br />\r\nThanks and God bless!&nbsp;<br />\r\n<br />\r\n<strong><u>Online Class Schedule</u><br />\r\nAffable</strong>-Mon- 7:00-8:00 AM (AS) &amp; 8:00-9:00 AM (S)<br />\r\n<strong>Charitable</strong>-Mon- 10-15-11:15 AM (AS) &amp;&nbsp;11:15-12:15 PM (S)<br />\r\n<strong>Accountable</strong>-Wed- 9:00-10:00 AM (AS) &amp;&nbsp;10-15-11:15 AM (S)<br />\r\n<strong>Admirable</strong>-Wed- 10-15-11:15 AM (AS) &amp;&nbsp;11:15-12:15 PM (S)<br />\r\n<strong>Amiable</strong>-Fri-&nbsp;7:00-8:00 AM (AS) &amp; 8:00-9:00 AM (S)<br />\r\nGoogle Meet Link:&nbsp;<br />\r\n<a href=\"http://meet.google.com/xqh-gutj-hbi\">http://meet.google.com/xqh-gutj-hbi</a></p>\r\n', '09', '2022', '05'),
(84, 'teacher70409051', '704', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARIAM  R . MABITUIN', 'AP 10 MODYUL 1 QUARTER 1:  KAHALAGAHAN NG PAG-AARL NG KONTEMPORARYUNG ISYU', '', '<p>Magandang araw, Grade 10 Admirable!</p>\r\n\r\n<p>Sa pagsisimula ng ating aralin, nais kong inyong basahin at unawain ang Subukin sa pahina 2 at Tuklasin sa pahina 4-5 at&nbsp; sagutan ang mga sumusunod gamit ang ating Modyul 1 sa Araling Panlipunan 10.</p>\r\n\r\n<p>Pagyamanin at Isagawa sa pahina 8.</p>\r\n\r\n<p>Ipapasa sa guro ang Isagawa na ilalagay sa intermediate pad.</p>\r\n\r\n<p>Maraming Salamat po.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '05'),
