(93, 'teacher10309071', '103', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'JOE MAR  O . PANGUE', 'Mathematics 9', '', '<p><span style=\"font-family:Comic Sans MS,cursive\">HeLLo 9th Graders!</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">Welcome to the e-learning and Welcome Back to SchooL:)</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">As your teacher, I welcome all of you to the Mathematics Class . I&rsquo;m looking forward to engaging in this topic with you over the coming weeks.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">How are you? I hope you are good and healthy:)</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">Now, please do the following task:</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">1. Answer the Module 2 - &quot;Solving Quadratic Equation&quot;</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">Write your answer in your Mathamatics notebook.</span></p>\r\n\r\n<ol>\r\n	<li style=\"list-style-type:lower-alpha\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:11pt\"><span style=\"color:#000000\">WHAT I NEED TO KNOW -Study</span></span></span></li>\r\n	<li style=\"list-style-type:lower-alpha\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:11pt\"><span style=\"color:#000000\">What Is It &ndash; p. 3, 8, 15 &amp; 22 - Study</span></span></span></li>\r\n	<li style=\"list-style-type:lower-alpha\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:11pt\"><span style=\"color:#000000\">What&rsquo;s More &ndash; p. 4, 10, 17 &amp; 24 - Answer</span></span></span></li>\r\n	<li style=\"list-style-type:lower-alpha\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:11pt\"><span style=\"color:#000000\">&nbsp;Assessment -&nbsp;p. 6, 12, 19 &amp; 26 - Answer</span></span></span></li>\r\n</ol>\r\n', '09', '2022', '07'),
(97, 'teacher11009081', '110', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARVIN  L . MAGLALANG', 'CSS 10 Task / Activities to do', '', '<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Good day Grade 10!&nbsp;</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Here&#39;s our Module 1 and 2, click the LINK:</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\"><a href=\"https://drive.google.com/file/d/1Y20xSPEIRgI2kT6tsPDD9CL6J45E45kZ/view?usp=sharing\" style=\"box-sizing:border-box; color:#337ab7; text-decoration:none\">Module 1: Computer Hardware Assembly</a><br />\r\n<a href=\"https://drive.google.com/file/d/18PRxpZWNDx0Bx87XJw7-uuft4-eg7u5_/view?usp=sharing\" style=\"box-sizing:border-box; color:#337ab7; text-decoration:none\">Module 2: Prepare Installer</a></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><br />\r\n<span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">For Online Asynchronous / Homebased Activities and Tasks for JHS G10 CSS Specialization Class</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Do the Following&quot;</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">1. Download and open the given Modules&nbsp;<br />\r\n(We are done answering the SKills test on &quot;What I &nbsp;Know&quot; on page 2)&nbsp;</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">2. Read and study Lesson 1: Computer Hardware Assembly (what&#39;s In, What&#39;s New, What is it on Page 2-13)</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">3. Answer the following:&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;a. What I have lerarned<br />\r\n&nbsp;&nbsp; &nbsp;b. Assessment Self-Check 1.1</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">4. Submit your answers by encoding them in any document application software sych as google docs, pdf, notepad or msword or any equivalent software or Mobile apps.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Submit them &nbsp;in &nbsp;JDPNHS G10 - CSS Learner&#39;s Outputs Hub Form<br />\r\n<a href=\"https://forms.gle/QAhbacgfcmXEShFs5\" style=\"box-sizing:border-box; color:#337ab7; text-decoration:none\">SUBMISSION LINK: https://forms.gle/QAhbacgfcmXEShFs5</a></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">4. After submitting , communicate with your Grouprmates /Team to start working with your Performance Task. Leaders may initialize the meeting of your Team. Don&#39;t forget to document</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Possible Tasks to accomplished with Groupmates during Online/Async with regards to Performance Task:<br />\r\na. Planning and Brainstorming<br />\r\nb. Script writing / Encodng<br />\r\nc. Watching of Computer System Servicing Videos/Vlogs, training<br />\r\nd. Research of &nbsp;Online websites resources related to TOPIC given.&nbsp;<br />\r\nc. Editing and Other Tasks assigned by your Group.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Possible Tasks to accomplished with Groupmates during F2F &nbsp;with regards to Performance Task:<br />\r\nA. Photoshoot, video capture of Computer parts /&nbsp;<br />\r\nB. Voice recording, shooting or Video productions. &nbsp;<br />\r\nc. Editing and Other Tasks assigned by Teachers.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Resources / References:<br />\r\n&nbsp;<br />\r\nComputer System Servicing 10<br />\r\nFirst Quarter-Module 1 &amp; 2</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Watch&nbsp; the additional Video Resources:</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">CSS NCII | Computer System Unit Parts and Function PPT<br />\r\nhttps://www.youtube.com/watch?v=mBSAs3zgIDU&amp;t=65s</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Occupational Health and Safety (OHS) Standards in CSS | Computer Systems Servicing Guide<br />\r\nhttps://www.youtube.com/watch?v=m5gxAICpKps</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">https://www.youtube.com/watch?v=WVg0srQ1B7o</span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"background-color:#ebf4fa\">Get ready for application and practical test in our F2F CLass.<br />\r\nHappy learning, keep safe everyone!<br />\r\n&nbsp;</span></span></span></span></p>\r\n', '09', '2022', '08'),
(99, 'teacher11809082', '118', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'SHIELA  B . MORENO', 'MODULE NO. 2 ARGUMENTATIVE TEXT', '', '<p>Good day, Awesomeness!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lets us begin this week with love in our hearts! Today, we shall start working with our MODULE NO. 2.</p>\r\n\r\n<p>Module 2 has two lessons, starting with ARGUMENTATIVE TEXT, followed by CONDITIONALS. For this week, we shall begin with Argumentative text.&nbsp;</p>\r\n\r\n<p>For today, kindly do the following tasks:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Watch the following videos:</li>\r\n</ul>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=wB6QAfoyCS0\"><u>https://www.youtube.com/watch?v=wB6QAfoyCS0</u></a></p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=cQkVOu99tac\"><u>https://www.youtube.com/watch?v=cQkVOu99tac</u></a>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Read and Study Module No. 2 Lesson 1 Argumentative Text</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Answer&nbsp; the following in your notebook only (to be checked during the synchronous session)\r\n	<ul>\r\n		<li>What I know&nbsp; pages 1-3 (Activity A Argumentative Texts Only)</li>\r\n		<li>What&rsquo;s In page 4</li>\r\n		<li>What&rsquo;s New Page 5 (just write your chosen words on your notebook)</li>\r\n		<li>What&rsquo;s More Activity 1 only</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '09', '2022', '08'),
(102, 'teacher11009083', '110', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARVIN  L . MAGLALANG', 'G11 ComProg Homebased  / Asynchronous Task /Activities', '', '<p>TASK FOR TODAY SHS G11 TVL ComProg<br />\r\nAsynchronous - Homebased Activties / Tasks<br />\r\nSept. 8-9, 2022 | 3:45 PM</p>\r\n\r\n<p>First Quarter-Module 1<br />\r\nLead Workplace Communication<br />\r\n<a href=\"https://drive.google.com/file/d/1snDILP47kTSGCYw1MNxbjU0iGt3q6R90/view?usp=sharing\">Module Download:: CLICK Here!</a></p>\r\n\r\n<p><br />\r\nThings to do:</p>\r\n\r\n<p>1. Answer the Pretest on &quot;What I &nbsp;Know&quot; on page 1-2.<br />\r\n2. Read and study What&#39;s New and What is it on &nbsp;page 3 - 7.</p>\r\n\r\n<p>Answer the following Guide Question:</p>\r\n\r\n<p>a. How does ISSUES greatly affects our work or day to day activities?<br />\r\nb. What solutions you can develop if a Team dynamics issue such as unresolvable disagreement, blaming, lack of teamwork, or personal issues happen in your Workplace?<br />\r\nc. Instead of providing negative feedback, how will you employ or give constructive feedback to another?<br />\r\nd. How does Effective proper forms communication can help you as member of your Team?</p>\r\n\r\n<p>3. Submit your answer by encoding them in any document application software like google docs, pdf or msword or mobile apps.<br />\r\n&nbsp; &nbsp;<br />\r\nSUBMISSION LINK:<br />\r\nDIPLOMACY: &nbsp;<a href=\"https://forms.gle/NPhDMu1v4E8QbEpaA\">https://forms.gle/NPhDMu1v4E8QbEpaA</a><br />\r\nCOMPETENCY: <a href=\"https://forms.gle/MYevi4snaHGsk8CNA\">https://forms.gle/MYevi4snaHGsk8CNA</a><br />\r\nCONSISTENCY: <a href=\"https://forms.gle/SmReSdjm1X6GGoGb7\">https://forms.gle/SmReSdjm1X6GGoGb7</a></p>\r\n\r\n<p>4. After submitting , communicate with your Grouprmates /Team to start working with your Performance Task. Leaders may initialize the meeting of your Team. Don&#39;t forget to document</p>\r\n\r\n<p>Possible Tasks to accomplished with Groupmates during Online/Async with regards to Performance Task:<br />\r\na. Planning and Brainstorming<br />\r\nb. Script writing / Encodng<br />\r\nc. Watching of topic-related Videos/Vlogs, training<br />\r\nd. Research of &nbsp;Online websites resources related to TOPIC given.&nbsp;<br />\r\nc. Editing and Other Tasks assigned by your Group.</p>\r\n\r\n<p>Possible Tasks to accomplished with Groupmates during F2F &nbsp;with regards to Performance Task:<br />\r\nA. Photoshoot, video capture of Topics given.<br />\r\nB. Voice recording, shooting or Video productions. &nbsp;<br />\r\nc. Editing and Other Tasks assigned by Teachers.</p>\r\n\r\n<p>PM me if you have queries or questions.<br />\r\n&nbsp;</p>\r\n', '09', '2022', '08'),
(103, 'teacher11009083', '110', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARVIN  L . MAGLALANG', 'TASK FOR JHS G9 Computer System Servicing', '', '<p>TASK FOR JHS G9 Computer System Servicing<br />\r\nOnline Asynchronous - Homebased Activties / Tasks</p>\r\n\r\n<p>TLE-Information and Communication Technology</p>\r\n\r\n<p>Computer System Servicing Grade 9</p>\r\n\r\n<p>First Quarter-Module 1</p>\r\n\r\n<p>Module 1 Computer and its Peripherals<br />\r\n<a href=\"https://drive.google.com/file/d/1LSER6XLcvNaL1w_92OZCmQVFrYHsiPPv/view?usp=sharing\">https://drive.google.com/file/d/1LSER6XLcvNaL1w_92OZCmQVFrYHsiPPv/view?usp=sharing</a></p>\r\n\r\n<p>Module 2 Assemble Computer Hardware<br />\r\n<a href=\"https://drive.google.com/file/d/1fmo7YZfJFBOGTuNm4w7KXJgr_rYkks0-/view?usp=sharing\">https://drive.google.com/file/d/1fmo7YZfJFBOGTuNm4w7KXJgr_rYkks0-/view?usp=sharing</a></p>\r\n\r\n<p><br />\r\nTask/Activities to do:</p>\r\n\r\n<p>1. Answer the Pretest on &quot;What I &nbsp;Know&quot; on page 2<br />\r\n2. Read and study Lesson 1: Types and parts of the Computer(what&#39;s In, What&#39;s New, What is it on Page 3-5</p>\r\n\r\n<p>3. Answer the following:&nbsp;<br />\r\nA. What&#39;s More in MS Word or in Notepad(Type your name and section)<br />\r\nB. Complete the sentence:</p>\r\n\r\n<p>At the end of the lesson I learned that ______________(30 Words max only) and &nbsp;I realized that _________________________(30 Words max only).</p>\r\n\r\n<p>4. Submit your answers by encoding them in any document application software sych as google docs, pdf, notepad or msword or any equivalent software or Mobile apps.</p>\r\n\r\n<p>Submit them &nbsp;in &nbsp;G9 - CSS Activity -Task Outputs Hub<br />\r\nSUBMISSION LINK:<a href=\"http://https://forms.gle/mFbst6WNJcv8YmNt7\"> https://forms.gle/mFbst6WNJcv8YmNt7</a></p>\r\n\r\n<p>5. After submitting, communicate with your Grouprmates /Team to start working with your Performance Task. Leaders may initialize the meeting of your Team. Don&#39;t forget to document</p>\r\n\r\n<p>Possible Tasks to accomplished with Groupmates during Online/Async with regards to Performance Task:<br />\r\na. Planning and Brainstorming<br />\r\nb. Script writing / Encodng<br />\r\nc. Watching of Computer System Servicing Videos/Vlogs, training<br />\r\nd. Research of &nbsp;Online websites resources related to TOPIC given.&nbsp;<br />\r\nc. Editing and Other Tasks assigned by your Group.</p>\r\n\r\n<p>Possible Tasks to accomplished with Groupmates during F2F &nbsp;with regards to Performance Task:<br />\r\nA. Photoshoot, video capture of Computer parts /&nbsp;<br />\r\nB. Voice recording, shooting or Video productions. &nbsp;<br />\r\nc. Editing and Other Tasks assigned by Teachers.</p>\r\n\r\n<p><br />\r\nResources / References:<br />\r\n&nbsp;<br />\r\nComputer System Servicing 9<br />\r\nFirst Quarter-Module 1 &amp; 2</p>\r\n\r\n<p><br />\r\nWatch other helpful Video Resources:</p>\r\n\r\n<p>Grade 9 TLE Q1 Ep2: Understanding Computers<br />\r\n<a href=\"https://www.youtube.com/watch?v=86_c0jE5l3w&amp;t=146s\">https://www.youtube.com/watch?v=86_c0jE5l3w&amp;t=146s</a></p>\r\n\r\n<p>Grade 9 TLE Ep3: Basic Parts of a Computer System<br />\r\n<a href=\"https://www.youtube.com/watch?v=StGAT64h0m8&amp;t=12s\">https://www.youtube.com/watch?v=StGAT64h0m8&amp;t=12s</a></p>\r\n\r\n<p>Occupational Health and Safety (OHS) Standards in CSS | Computer Systems Servicing Guide<br />\r\n<a href=\"https://www.youtube.com/watch?v=m5gxAICpKps\">https://www.youtube.com/watch?v=m5gxAICpKps</a></p>\r\n\r\n<p>Get ready for graded recitation, application and practical test in our F2F CLass.<br />\r\nHappy learning, keep safe everyone!</p>\r\n', '09', '2022', '08'),
(105, 'teacher11809082', '118', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'SHIELA  B . MORENO', 'MODULE  NO. 1 FOR SUBMISSION', '', '<p>Good day, e-learners!</p>\r\n\r\n<p>Please be informed that you may now submit your PT1 (Module no. 1What I Can Do) and PT2 Comic Strips in the e-note here in the platform.&nbsp;</p>\r\n', '09', '2022', '08'),
(106, 'teacher11809083', '118', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'SHIELA  B . MORENO', 'MODULE NO 1: ITEMS FOR SUBMISSION', '', '<p>Good day, e-learners!</p>\r\n\r\n<p>please be informed that you may now submit your performance tasks in the e-note.</p>\r\n\r\n<p>the following are for submission:</p>\r\n\r\n<p>1. PT1 Module no. 1 (What I Can Do)</p>\r\n\r\n<p>2. PT2 Comic Strips</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please see the e-note 1st quarter for the instructions.&nbsp;</p>\r\n', '09', '2022', '08'),
(108, 'teacher135909082', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Q1_Module 1 - Foundation Planning (Task)', '', '<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Good Day Tech. Drafting Learners!</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Reminders for you task!</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><strong><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">SET A</span></span></span></strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>Answer ASSESSMENT (formative) on Sept. 9, 2022 @ 8:00am-9:30am ONLY and DISCUSSION on the same date and time.</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">SET B</span></span></span></strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>Answer ASSESSMENT (formative) on Sept. 9, 2022 @ 1:30pm-3:00pm ONLY and DISCUSSION on the same date and time.</strong></p>\r\n\r\n<p style=\"text-align:left\"><strong>WHAT I CAN DO page 9 (fig. 1.2) on your notebook ONLY.</strong></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#000000\"><strong><span style=\"background-color:#f1c40f\">Do have advance reading for the next lesson, Module 2 - KINDS OF FOUNDATION AND DETAILS.</span></strong></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">Thank you&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">-Ma&#39;am Salamat</span></span></span></p>\r\n', '09', '2022', '08'),
(110, 'teacher135909083', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'RHGP_Q1 – M1: Decoding the Secrets of Better Study Habits', '', '<p>Good Day Creadible!</p>\r\n\r\n<p>Read and Understand&nbsp; this module 1 for RHGP entitled&nbsp;<strong>Decoding the Secrets of Better Study Habits&nbsp;</strong>then do the following tasks:</p>\r\n\r\n<p>a.&nbsp;You can do it <strong>(notebook)</strong></p>\r\n\r\n<p>b.&nbsp;What I have Learned&nbsp;<strong>(notebook)</strong></p>\r\n\r\n<p>c.&nbsp;Share your Thoughts &amp; Feelings&nbsp;<strong>(short bondpaper)<br />\r\n<br />\r\nThank you. :)</strong></p>\r\n', '09', '2022', '08'),
