(124, 'teacher70409092', '704', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARIAM  R . MABITUIN', 'TAKDANG ARALIN: KAHALAGAHAN NG PAG-AARAL NG KONTEMPORARYUNG ISYU', '', '<p><strong>Takdang Aralin:&nbsp;</strong>(Ipapasa sa nakaiskedyul na face to face class ng inyong section) at (ilalagay sa intermediate pad)</p>\r\n\r\n<p><img alt=\"?\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" style=\"height:16px; width:16px\" />Para sa mga nakakuha ng pito pataas (7-10) ang score:</p>\r\n\r\n<p><strong>Gumawa ng Journal ukol sa usapin ng COVID 19.</strong></p>\r\n\r\n<p>1. Usaping pinansyal kung nawalan ng hanapbuhay ang pangunahing kasapi na sumusuporta sa pangangailangan (kung mayroon) kung wala bigyang pansin ang kasunod.</p>\r\n\r\n<p>2. Kung hindi nawalan ng hanapbuhay ang pangunahing kasapi na sumusuporta sa pangangailangan ng pamilya, paano ninyo pinaghandaan ang usaping pinansyal at pangangailangan.</p>\r\n\r\n<p>3. Paano ka makatutulong sa pamahalaan upang maging bahagi sa paglutas ng suliranin sa Covid-19.</p>\r\n\r\n<p><img alt=\"?\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" style=\"height:16px; width:16px\" />Para naman sa nakakuha ng anim pababa (6-0)</p>\r\n\r\n<p>Panoorin ang video at sagutin ang mga pamprosesong tanong:</p>\r\n\r\n<p><strong>1. Ano ang Kontemporaryung Isyu?</strong></p>\r\n\r\n<p><strong>2. Ano ang Kahalagahan ng pag-aaral ng Kontemporaryung Isyu?</strong></p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=HmCwNOKYt38&amp;fbclid=IwAR0JcUI2iCmwLa_ORQ7OSvkYTk8K0ow-E67ozw2NMW5Z2_K91AREbEJIyTo\" rel=\"nofollow noopener\" tabindex=\"0\" target=\"_blank\">https://www.youtube.com/watch?v=HmCwNOKYt38</a></p>\r\n\r\n<p>Kahalagahan ng Pag-aaral ng Kontemporaryong Isyu</p>\r\n', '09', '2022', '09'),
