(166, 'teacher592909091', '5929', 'STA. ELENA HIGH SCHOOL', 'MERVIN  C. . ENRIQUEZ', 'Welcome!', '', '<p>This is the&nbsp;<strong><u>GRADE 10 - MATHEMATICS,</u></strong>&nbsp; the official learning management system<strong>&nbsp;</strong>of the subject&nbsp;<strong>MATHEMATICS&nbsp;</strong>of the STA ELENA HIGH SCHOOL under the direction of MR MERVIN C. ENRIQUEZ, faculty of the MATHEMATICS DEPARTMENT.<br />\r\n<br />\r\nThe inclusion of the student into this platform is thru an&nbsp;<strong>INVITATION</strong>, which will be based on the email required by the teacher to bona fide students.<br />\r\n<br />\r\nAnnouncements, activities, outputs, reading materials, and other similar instructional materials on this platform are for your REFERENCE ONLY. Sharing the contents of this platform is hereby PROHIBITED.&nbsp;<br />\r\n<br />\r\nWhen submitting required outputs (such as MS Word, PowerPoint, images, etc.) as part of the course requirements, you are ALSO encouraged to submit the converted PDF file of the output.<br />\r\n<br />\r\n<br />\r\n<strong>MR. MERVIN C. ENRIQUEZ</strong></p>\r\n', '09', '2022', '09'),
(167, 'teacher563209091', '5632', 'STA. ELENA HIGH SCHOOL', 'MICHAEL ANJOE  V. . TANIEGRA', 'Greetings!', '', '<p>Good day, Grade 8 students! For this year, we will be using the e-learning platform in our class. Let us enjoy learning Mathematics together.<img alt=\"laugh\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/teeth_smile.png\" style=\"height:23px; width:23px\" title=\"laugh\" /></p>\r\n', '09', '2022', '09'),
