(210, 'teacher569309091', '5693', 'STA. ELENA HIGH SCHOOL', 'ROWENA  H. . GONZALES', 'WELCOME', '', '<p>Hi everyone!</p>\r\n\r\n<p>School year has started and I hope everyone is doing fine. Perhaps, some of you are still adjusting. If you are one of them, don&#39;t fret. I am here to help you.&nbsp;<img alt=\"\" src=\"https://www.istockphoto.com/vector/angry-fist-bump-of-two-competitors-banner-gm1181190137-331190633\" /><img alt=\"\" src=\"https://static01.nyt.com/images/2012/10/28/magazine/wmt_fistbump-slide-LHD4/wmt_fistbump-slide-LHD4-superJumbo.jpg\" style=\"height:677px; width:996px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '09'),
