(227, 'teacher589809091', '5898', 'STA. ELENA HIGH SCHOOL', 'HANNAH LEE  A. . MACABUDBUD', 'PE 9 CLASS: THINGS TO BRING', '', '<p>Good day! Nex week will be our schedule for our PE class. Kindly be on your PE uniform and bring the following:</p>\r\n\r\n<p>1. PE component notebook</p>\r\n\r\n<p>2. Ballpen</p>\r\n\r\n<p>3. Calculator</p>\r\n\r\n<p>4. Tape measure</p>\r\n\r\n<p>5. Extra tshirt</p>\r\n\r\n<p>6. Water</p>\r\n\r\n<p>7. Face towel</p>\r\n', '09', '2022', '09'),
