(230, 'teacher11809094', '118', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'SHIELA  B . MORENO', '', '', '<p>Good day, Grade 9 E-learners</p>\r\n\r\n<p>Lets us begin this week with love in our hearts! Today, we shall start working with our MODULE NO. 2.</p>\r\n\r\n<p>Module 2 has two lessons, starting with ARGUMENTATIVE TEXT, followed by CONDITIONALS. For this week, we shall begin with Argumentative text.&nbsp;</p>\r\n\r\n<p>For today, kindly do the following tasks:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Watch the following videos:</li>\r\n</ul>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=wB6QAfoyCS0\"><u>https://www.youtube.com/watch?v=wB6QAfoyCS0</u></a></p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=cQkVOu99tac\"><u>https://www.youtube.com/watch?v=cQkVOu99tac</u></a>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Read and Study Module No. 2 Lesson 1 Argumentative Text</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Answer&nbsp; the following in your notebook only (to be checked during the synchronous session)\r\n	<ul>\r\n		<li>What I know&nbsp; pages 1-3 (Activity A Argumentative Texts Only)</li>\r\n		<li>What&rsquo;s In page 4</li>\r\n		<li>What&rsquo;s New Page 5 (just write your chosen words on your notebook)</li>\r\n		<li>What&rsquo;s More Activity 1 only</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '09', '2022', '09'),
(231, 'teacher8709091', '87', 'MARIKINA SCIENCE HIGH SCHOOL', 'MARY CRIS  M. . MIRABEL', 'Filipino Grade 7', '', '<p>Magandang Araw Grade 7!&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>Basahin at unawain ang Module 3 at 4. Sagutan ang mga gawain na nasa WLP para sa asynchronous. Magdala ng isang manila paper at marker sa susunod na Linggo para sa pangkatang gawain.&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>Ma&#39;am Mirabel</p>\r\n', '09', '2022', '09'),
