(233, 'teacher565909092', '5659', 'STA. ELENA HIGH SCHOOL', 'MICHAEL  O. . ODONES', 'PERFORMANCE TASK ( ARITHMETIC SEQUENCE )', '', '<p>Choose one problem to be solved in front of the class.&nbsp; You may choose any problem with the arithmetic sequence. You may even present the problem that we already solved in class. Try to explain the problem in English. Don&#39;t worry about the mistakes, the more mistakes you make, the more you&#39;ll learn from them. Be guided with the rubrics.&nbsp; See you in class!</p>\r\n', '09', '2022', '09'),
