(237, 'teacher135909124', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Q1-Module 2 - Kinds of Foundation and Details', '', '<p><span style=\"font-family:arial,sans-serif; font-size:14px\">Good Day Tech. Drafting Learners!</span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Don&#39;t forget to read and study our first Lesson Module 2&nbsp; - Kinds of Foundation and Details. Check DLM tab S Supplementary for the Module.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Thank you&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">-Ma&#39;am Salamat</span></span></p>\r\n', '09', '2022', '12'),
(238, 'teacher633709121', '6337', 'STA. ELENA HIGH SCHOOL', 'MARK ARJAY  M. . RANGASAJO', 'P.E. 9 (MAPEH Class) ', '', '<p>Bring the Following: (September 14, 2022)</p>\r\n\r\n<p>1. Ruler / Meter Stick</p>\r\n\r\n<p>2. Index Card (1/4)</p>\r\n\r\n<p>3. Extra Shirt</p>\r\n\r\n<p>4. Timer</p>\r\n', '09', '2022', '12'),
(239, 'teacher288009121', '2880', 'PARANG HIGH SCHOOL', 'VANDON  T . BORELA', '', '', '<p>September 12, 2022, Monday</p>\r\n\r\n<p>Good morning Grade 10 students.</p>\r\n\r\n<p>Science 10 Quarter 1 Module 2</p>\r\n\r\n<p>Lesson 1</p>\r\n\r\n<p>Answer What&#39;s New p. 4</p>\r\n\r\n<p>Read What It Is p. 5</p>\r\n\r\n<p>Lesson 2</p>\r\n\r\n<p>Read What Is It p. 10</p>\r\n\r\n<p>Answer What&#39;s More p. 11</p>\r\n\r\n<p>Lesson 3</p>\r\n\r\n<p>Read What Is It p. 15</p>\r\n\r\n<p>Answer What&#39;s More p. 17</p>\r\n\r\n<p>Lesson 4</p>\r\n\r\n<p>Read What Is It p. 21</p>\r\n\r\n<p>Answer What I Can Do p. 22</p>\r\n\r\n<p>Write your answer in your Science 10 Notebook.</p>\r\n\r\n<p>Submit your Science Notebook on September 13, 2022, Tuesday</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '12'),
(240, 'teacher142109131', '1421', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROXANNE  R . TAMAYO', '', 'image/TLEEntrep_Grade_7_8_QTR1_Module1.pdf', '<p><span style=\"font-size:20px\"><span style=\"color:#f39c12\"><strong>Good day learners!</strong></span></span></p>\r\n\r\n<p><span style=\"color:#2980b9\"><span style=\"font-size:18px\"><strong>Kindly do the following tasks in TLE:</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\">a. Watch the video discussion on&nbsp;<br />\r\n&ldquo;Entrepreneurship Lesson 2: Its Role in Economic Growth&rdquo;&nbsp;<br />\r\n<strong>video link: <a href=\"https://youtu.be/vLf8aDztUIo\"><em>https://youtu.be/vLf8aDztUIo</em></a></strong><br />\r\nb.&nbsp;&nbsp; &nbsp;Read &ldquo;Module 1 Lesson 2:The Role of Entrepreneurship in Economic Growth&rdquo;, pages 7-9.<br />\r\nc.&nbsp;&nbsp; &nbsp;For practice exercises, answer &quot;What&#39;s More&quot; and &quot;What I have Learned&quot; on pages 9-10. Do it in your notebook.<br />\r\nd.&nbsp;&nbsp; &nbsp;Answer the Practice Quiz No.2 in the eLearning Platform.<br />\r\ne.&nbsp;&nbsp; &nbsp;Accomplish the &ldquo;What I can do Activity&rdquo;, page 10 and be ready to present your output next face-to-face meeting.</span><br />\r\n&nbsp;</p>\r\n', '09', '2022', '13'),
(241, 'teacher11809135', '118', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'SHIELA  B . MORENO', 'MODULE NO. 2 ARGUMENTATIVE TEXT PART 2', '', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Good day, E-LEARNERS!</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Let&rsquo;s start this week with love in our hearts! We are still going to work on Module no. 2 Lesson No. 1 (Argumentative Text). Before we meet later for our synchronous class, do the following activities on your English Notebook</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Answer the following on Module No.2 (Lesson1)</span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">What&rsquo;s More: Activity 2 page 9</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">What&rsquo;s More Activity 4 pages 11-12</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">What I have Learned page 12</span></span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">See you later for our synchronous class @1:30 pm.&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '13'),
(242, 'teacher100709131', '1007', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ANNALYN   . MAYNIGO', 'ARALING PANLIPUNAN 8- Natatanging Kultura ng mga Rehiyon, Bansa at Mamamayan sa Daigdig kabilang ang iba’t ibang Lahi, Pangkat-etnolinggwistiko at Relihiyon sa  Daigdig', '', '<p>Magandang araw! Sa lingong ito tayo ay darako sa Modyul 2</p>\r\n\r\n<p>Heograpiyang Pantao. Iyong matutuklasan ang saklaw ng</p>\r\n\r\n<p>heograpikal pantao nito gaya ng wika, relihiyon, lahi, at</p>\r\n\r\n<p>pangkat-etniko sa sa iba&rsquo;t ibang</p>\r\n\r\n<p>bahagi ng daigdig.</p>\r\n\r\n<p>AP8_Modyul 2_Q1</p>\r\n\r\n<p>1. Sagutan ang</p>\r\n\r\n<p>Subukin o Gawain 1, Gawain 2, Gawain 3, Gawain 4 at</p>\r\n\r\n<p>Gawain 5</p>\r\n\r\n<p>2. Basahin at unawain ang Tuklasin at Suriin sa pahina 3-9</p>\r\n\r\n<p>ng Modyul 2.</p>\r\n\r\n<p>Para sa Presentasyon sa klase</p>\r\n\r\n<p>Output: Kontinente Challenge</p>\r\n', '09', '2022', '13'),
(243, 'teacher100709132', '1007', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ANNALYN   . MAYNIGO', 'ARALING PANLIPUNAN 9- KAHALAGAHAN NG EKONOMIKS', '', '<p>Magandang araw! Sa lingong ito tayo ay magbubukas ng ating Modyul 2 sa Ekonomiks. Sa modyul 2 Kahalagahan ng Ekonomiks, Ito ay binuo upang matulungan kang malaman ang kahalagahan ng Ekonomiks sa pang-araw araw na pamumuhay. Ang saklaw ng modyul na ito ay nagpapahintulot na magamit ito sa iba&#39;t ibang sitwasyon sa pag-aaral. Gawin ang mga gawain AP 9_Modyul 2_Q1 1.</p>\r\n\r\n<p>Sagutan ang Subukin at Tuklasin sa pahina 2-4 at Pamprosesong Tanong ng Modyul 2 2.</p>\r\n\r\n<p>Basahin at unawain ang Suriin sa pahina 3-6 ng Modyul 4-8.</p>\r\n\r\n<p>At panoorin ang video lesson sa link na ito <a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3DMb3XKE7-eDM%26fbclid%3DIwAR3bTMm5ov_eD0sEvqYZZ4gpbgAIonoubcbOdYoWEu5RQDyoBZQFXT8cA5w&amp;h=AT0SNNGxwhhUAPw5HZDkG95SALM6X24oCX70hYOlENOgh6kYQtE5XQ9DzGFAdLHmXJILQhb_pP0iq-YJhB518_7eMAJu3qEcbc3pMOiawp_mrytphPCNnCrro5f-OYeljRpmKw\" rel=\"nofollow noopener\" tabindex=\"-1\" target=\"_blank\">https://www.youtube.com/watch?v=Mb3XKE7-eDM</a></p>\r\n\r\n<p>Mula sa pinanood Sagutin ang Pamprosesong Tanong sa bahaging Pagyamanin sa Notebook (Siguraduhing dala at mabubuksan o maaaccess para sa presentation).</p>\r\n\r\n<p>Pamprosesong Tanong: -Ang kahalagahan ng Ekonomiks sa pang-araw-araw na pamumuhay bilang mag-aaral ay&hellip;? -Bakit mahalaga ang ekonomiks sa pang-araw-araw na pamumuhay bilang kasapi ng pamilya&hellip;?</p>\r\n', '09', '2022', '13'),
(249, 'teacher335409131', '3354', 'TAÑONG HIGH SCHOOL', 'RUBY ROSE  E . RAMOS', 'Health Module 4: Development of Self-awareness and Coping Skills', 'image/Capture12.PNG', '<p><span style=\"font-size:16px\"><span style=\"font-family:Calibri\">Good day, 7-Appreciative!</span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\">&nbsp;</span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\">For your home-based activities in Health Module 4, kindly refer to the following:</span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\">1. Answer the activity on <strong><em>What&rsquo;s New p. 4.</em></strong></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\">2. Study and understand the lesson on <em><strong>What Is It pp. 5-9.</strong></em></span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\">3. Do <em><strong>Activity: Be Positive!</strong></em></span></span></span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><em><u><strong><span style=\"background-color:#2ecc71\">Reference:</span></strong></u> </em>Health Module 4: Development of Self-awareness and Coping Skills</span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><u><em><strong><span style=\"background-color:#e74c3c\">Link:</span></strong></em></u> <a href=\"https://drive.google.com/file/d/1AYjQl2YsnmK0mp_cPvds1F86qrRm2A_L/view\">https://drive.google.com/file/d/1AYjQl2YsnmK0mp_cPvds1F86qrRm2A_L/view</a></span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:Calibri\"><u><em><strong><span style=\"background-color:#3498db\">Submission:</span></strong></em></u> Monday (Set A) and Tuesday (Set B)</span></span></p>\r\n', '09', '2022', '13'),
(250, 'teacher8509141', '85', 'MARIKINA SCIENCE HIGH SCHOOL', 'ARVIN LARK   P. . SANTIAGO', 'WEEK 4 LGO', '', '<p><strong>Week 4</strong></p>\r\n\r\n<p><strong>LEARNER GENERATED OUTPUT: Fitness Test Score Card</strong></p>\r\n\r\n<p>Do not forget to finish the 2nd Part of the Fitness testing at home.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>90 Degrees Push-Up</p>\r\n	</li>\r\n	<li>\r\n	<p>Basic Plank</p>\r\n	</li>\r\n	<li>\r\n	<p>Sit and Reach</p>\r\n	</li>\r\n	<li>\r\n	<p>Standing Long Jump</p>\r\n	</li>\r\n	<li>\r\n	<p>Stork Balance Test</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Check all fitness protocols in PE Module 1. See complete Physical Fitness Test (PFT) videos in their shortened links below.</p>\r\n\r\n<p><strong>HEALTH RELATED FITNESS</strong></p>\r\n\r\n<ol>\r\n	<li>Body composition:&nbsp;<a href=\"https://bit.ly/3hK96wN?fbclid=IwAR3bObXsETT7hjHF1kLACKS8LLiLFwUZ3PSOr1wvmu0XldCm90VTvdUStRo\" rel=\"nofollow noopener\" tabindex=\"0\" target=\"_blank\">https://bit.ly/3hK96wN</a></li>\r\n	<li>Flexibility:&nbsp;<a href=\"https://bit.ly/2RvJA3C?fbclid=IwAR1hQZS39wObDHtPU8_bHp9PCUZ3b1sI0vmufvHOfQFuT-jUL4MusIxYGWw\" rel=\"nofollow noopener\" tabindex=\"0\" target=\"_blank\">https://bit.ly/2RvJA3C</a></li>\r\n	<li>Cardiovascular endurance:&nbsp;<a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F35FnS5z%3Ffbclid%3DIwAR1di8YiprA56V5OVLNXIXrma0uBtq3TPLclB0h-833S-KztUo7AY0Q3j_o&amp;h=AT37_Dy5czjQFS-xzXLsWHUqDbN8BlJZA5cqBw2A-pPAht42qwaE6Y2UNHctupbWSlDvTfH2HE3VTlB0bIR8hRROmsSmxIRqrtHYXiMqYUz5J1heew98NLwbuCrpu_5JBd0z&amp;__tn__=-UK-R&amp;c[0]=AT1klc-HNXgyuzHmG3gK9eWPHCnHTV_NvMmxU-mbuzkn4flqY6uo0k8bRxJx3Qx_458wYvlWzCpPzkQvvROcAfXNKr2kxkTDY4_9Pu0d6pG-UsG-N5OBVzzIDLakeqdgA000AizjQF4iWGYnAZmC7GVXOfSTwp1o3qWeWYDMyp14eH_lf0ROH5v7WAtr9MvvJeboxaYVieenFr1cMg\" rel=\"nofollow noopener\" tabindex=\"0\" target=\"_blank\">https://bit.ly/35FnS5z</a></li>\r\n	<li>Strength:&nbsp;<a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F2ZMwaVz%3Ffbclid%3DIwAR0NBPcat9FO7uxtAEC6h97YTgKp