(251, 'teacher12009142', '120', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'LESLIE MICHELLE  M . SALCEDA', 'Q1M2-Graphic Organizers as Textual Aids', '', '<p>Good day, eLearners!<br />\r\n<br />\r\nFor this week&#39;s task kindly work on the following activities in&nbsp;<strong>Module 2-Graphic Organizers as Textual Aids</strong>. Study the lesson and write your answers in your English Notebook.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>What&#39;s I Know (p. 1-2)</p>\r\n	</li>\r\n	<li>\r\n	<p>What&#39;s New (p. 3-5)</p>\r\n	</li>\r\n	<li>\r\n	<p>What Is It (p. 5-7)</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Moreover, work on&nbsp;<strong>What I Can Do&nbsp;</strong>(p. 10), please upload your answers on eNote.</p>\r\n\r\n<p>You may access the module in eLibRO or from this link:<br />\r\n<a href=\"https://tinyurl.com/4bz88dzr\">https://tinyurl.com/4bz88dzr</a><br />\r\n&nbsp;</p>\r\n\r\n<p>For the quiz, go to the Summative Assessment and answer <strong>Q1M2-Quiz 2-Graphic Organizers as Textual Aids</strong></p>\r\n\r\n<p><strong><u>Online Class Schedule</u><br />\r\nAffable</strong>-Mon- 7:00-8:00 AM (AS) &amp; 8:00-9:00 AM (S)<br />\r\n<strong>Charitable</strong>-Mon- 10-15-11:15 AM (AS) &amp;&nbsp;11:15-12:15 PM (S)<br />\r\n<strong>Accountable</strong>-Wed- 9:00-10:00 AM (AS) &amp;&nbsp;10-15-11:15 AM (S)<br />\r\n<strong>Admirable</strong>-Wed- 10-15-11:15 AM (AS) &amp;&nbsp;11:15-12:15 PM (S)<br />\r\n<strong>Amiable</strong>-Fri-&nbsp;7:00-8:00 AM (AS) &amp; 8:00-9:00 AM (S)<br />\r\nGoogle Meet Link:&nbsp;<br />\r\n<a href=\"http://meet.google.com/xqh-gutj-hbi\">http://meet.google.com/xqh-gutj-hbi</a></p>\r\n', '09', '2022', '14'),
(252, 'teacher135909145', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'RHGP_Q1 – M1: Decoding the Secrets of Better Study Habits', '', '<p><br />\r\n<span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-family:arial\"><span style=\"font-size:undefined\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Good Day Creadible!</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Read and Understand&nbsp; this module 1 for RHGP entitled&nbsp;<strong>Decoding the Secrets of Better Study Habits&nbsp;</strong>then do the following tasks:</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">a.&nbsp;You can do it&nbsp;<strong>(notebook)</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">b.&nbsp;What I have Learned&nbsp;<strong>(notebook)</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">c.&nbsp;Share your Thoughts &amp; Feelings&nbsp;<strong>(short bondpaper)<br />\r\n<br />\r\nSubmission: SET A - Monday (Sept. 19, 2022)</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SET B - Tuesday (Sept. 20, 2022)</strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\"><strong>Thank you. :)</strong></span></span></p>\r\n\r\n<div>&nbsp;</div>\r\n', '09', '2022', '14');
