(253, 'teacher70009151', '700', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'FREDERICK  O . DACUT', 'Arts - 9 Module 2', '', '<p>Good afternoon kiddos, kindly answer the following in our Arts module 2.<br />\r\n1. What I know (Test 1 &amp; 2)<br />\r\n2. What&#39;s In (Activity 1)<br />\r\n3. What&#39;s New (Activity 2)<br />\r\nPS: Please read the information in the &quot;What is it&quot; portion of the module.&nbsp;<br />\r\n<br />\r\nGood luck and God bless!</p>\r\n', '09', '2022', '15'),
