(255, 'teacher97609151', '976', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'GRAY-JAN   ALAMAG . TUPAS', 'Mathematics 9', '', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Good day Mathematecians!!!</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">How are you? I hope you are all&nbsp; good and healthy:)</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">I know you&#39;re ready to our subject tasks:)</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Now, please do the following tasks:</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">1. Answer the Module 3 - Lesson 1 - &quot;&quot;Characterize the roots of a quadratic equation using the discriminant&quot;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Write your answer in your Mathamatics notebook.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">WHAT I NEED TO KNOW -Study</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">What I Know - p. 2 - Answer</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">What&rsquo;s New - p. 3 - Answer</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">What Is It &ndash; p. 4- Study</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">What&rsquo;s More &ndash; p. 6- Answer</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">2. Answer your POST TEST NO. 1 &amp; 2 to your&nbsp; ASSESSMENT TAB.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">3. Watch the video tutorial about the topic, go to ELIBRO TAB then look educational video &quot;Deped TV&quot;.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">4. Always bring your illustration/white board in our face to face classes.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">If you have any questions or concerns about our subjects please don&#39;t hesitate to ask, just pm me or comment here:)</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Thank you and Have a nice day:)</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '15'),
(256, 'teacher7209181', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Q1_W5_Sanaysay mula sa Gresya at Pahayag sa Pagsusunod-sunod ng Pangyayari', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Magandang araw sa inyo Grade 10,</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Sa ikalimang linggo ng unang kapat nais kong ipaalala ang mga sumusunod:</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">I. BAGO ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</span></span></strong><br />\r\n<span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">A. Basahin at aralin ang mga sumusunod na gawain sa module (Self-learning):</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">MODYUL 5: Pagtukoy sa mga Bahaging Nagpapakita ng Ugnayan ng mga Tauhan sa Puwersa ng Kalikasan at Pagpapaliwanag sa mga Alegoryang Ginamit sa Binasang Akda</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Tuklasin pp. 17-20</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">&nbsp;B. Subukang sagutin ang mga gawain sa ibaba at ikumpara ang inyong kasagutan sa susing sagot. Sa mga nais ng paglilinaw mangyaring magpatulong sa guto. Isumite ang inyong alintana o katanungan sa<em> </em>DISCUSSION TAB. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Modyul 5:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Subukin p. 14</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Tayahin pp. 24-25</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">C. Panoorin ang video link sa ibaba para sa sariling pagkatuto.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://www.youtube.com/watch?v=GEFfhRMg2Ec\" style=\"color:blue; text-decoration:underline\">https://www.youtube.com/watch?v=GEFfhRMg2Ec</a> Sanaysay mula sa Gresya: Alegorya ng Yungib DepEd TV-Official Youtube Channel-timeframe na 3:10-23:00<br />\r\n<a href=\"https://drive.google.com/file/d/1rn_2YauHCOV15ZXT4faPntUzB9h3t4B2/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/1rn_2YauHCOV15ZXT4faPntUzB9h3t4B2/view?usp=sharing</a> Sanaysay mula sa Gresya at Pahayag sa Pagsusunod-sunod ng Pangyayari.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">D. Sagutin ang Paunang Pagsusulit#1.5 na nasa ASSESSMENT TAB.<br />\r\n<br />\r\nE. Paghandaan ang isasagawang gawain sa harapang pagkaklase.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">UNANG BAHAGI: Bigyang pansin gawain ng bawat pangkat, mangyaring pagbatayan ang gabay na gawain sa ibaba:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 2: Gamit ang limang (5) sekwensiyal na pang-ugnay, ilahad ang pagsusunod-sunod ng pangyayari sa akdang binasa. Gumamit ng sariling pananalita ang paglagom nito.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 1:&nbsp; Sa tulong ng limang (5) kronolohikal na pang-ugnay, magbigay ng katulad na sitwasyon na inilalarawan sa akda na nakikita pa ring ginagawa sa kasalukuyan.&nbsp; Maglahad ng partikula o tiyak na gawain.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 3: Bumuo ng proseso na tatalakay sa paraan ng tao kung paano siyang makaalis sa yungib na hindi niya natural na panirahan. Maglahad ng limang (5) pang-ugnay na prosidyural sa magbibigay ng kahulugan at kabuluhan sa linya ng akda.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">IKALAWANG BAHAGI: Gawain pa para sa lahat, bumuin ito bilang pangkatan. Gamit ang tiyak na linyang nakatalaga sa bawat pangkat, ipaliwanag ang kahulugan ng mga linya sa sariling pangungusap na maaaring halaw sa pangyayari sa akda na kaugnay ng ilang pangyayari sa daigdig. Gumamit ng limang (5) pang-ugnay.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 1-Ang pagkalito ng mga paningin ay dalawang uri o nanggagaling sa dalawang dahilan, maaring mula sa paglabas ng liwanag o patungo sa liwanag.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 2-Ang ideya ng kabutihan ay nananatili sa huli at matatagpuan lamang nang may pagpupunyagi.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 3-Ang katotohanan ay walang kahulugan kundi anino ng mga imahe.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><strong>II. MATAPOS ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</strong></span></span><br />\r\n<span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\">Basahin ang muli ang sanaysay na tinalakay o panoorin ang pagsasalaysay nito sa ibinigay na link. Bumuo ng 5 pahayag sa pagsusunod-sunod ng pangyayari na magpapakita ng tiyak na paraan o proseso kung paanong lalayo ang tao sa aninong tinutukoy sa akda.</span></span></span></p>\r\n', '09', '2022', '18'),
(257, 'teacher70409183', '704', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARIAM  R . MABITUIN', 'Mga Paghahandang Nararapat Gawin Sa Harap ng Panganib Dulot ng Suliraning Pangkapaligiran', '', '<p>Magandang umaga, G10-Elearners!</p>\r\n\r\n<p><img alt=\"?\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" style=\"height:16px; width:16px\" /> Gawin ang Isagawa sa Module 2 Quarter 1 sa pahina 13-14, ito ay ilalagay sa intermediate pad na ipapasa sa gdrive na nakatalaga sa inyong seksyon gamit ang inyong depedmarikina account. Ang gdrive ay isesend ko sa inyong Class President.</p>\r\n\r\n<p>Module 3 Q1: Mga Paghahandang Nararapat Gawin</p>\r\n\r\n<p>Sa Harap ng Panganib Dulot ng Suliraning Pangkapaligiran</p>\r\n\r\n<p><img alt=\"?\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" style=\"height:16px; width:16px\" />Gawin ang Subukin sa pahina 1</p>\r\n\r\n<p><img alt=\"?\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" style=\"height:16px; width:16px\" />Gawin ang Tuklasin sa pahina 3</p>\r\n\r\n<p><img alt=\"?\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" style=\"height:16px; width:16px\" />Basahin at unawain ang Suriin sa pahina 4-9</p>\r\n\r\n<p><img alt=\"?\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\" style=\"height:16px; width:16px\" />Ssgutan ang Isaisap sa pahina 10</p>\r\n\r\n<p>Ito ay ilalagay sa inyong kuwaderno. Salamat po.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '18'),
(258, 'teacher14109191', '141', 'MARIKINA SCIENCE HIGH SCHOOL', 'JOSSA MARGARET  A. . FRANCISCO', 'Intro to Philo Week 5 ', '', '<p><strong>Good day, Philosophers!</strong></p>\r\n\r\n<p>Here are your week 5 home-based activities&nbsp;</p>\r\n\r\n<p><strong>1. Accomplish the following forms:</strong></p>\r\n\r\n<ul>\r\n	<li>https://bit.ly/Profile_2022</li>\r\n	<li>groupings&nbsp;https://www.canva.com/design/DAFMP3v4taY/NMVrPsUHV2iksT5InmZQwg/edit?utm_content=DAFMP3v4taY&amp;utm_campaign=designshare&amp;utm_medium=link2&amp;utm_source=sharebutton</li>\r\n</ul>\r\n\r\n<p><strong>2. Access and read the learning guide for week 5&nbsp;</strong> https://bit.ly/Week5_LessonGuide</p>\r\n\r\n<p><strong>3. Print and accomplish the learning monitoring form</strong></p>\r\n\r\n<p>https://bit.ly/Philo_MonitoringSheet</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Comment &quot;Yehey!&quot; if you are done. Thank you!</p>\r\n', '09', '2022', '19'),
(259, 'teacher7409191', '74', 'MARIKINA SCIENCE HIGH SCHOOL', 'DAISY  B. . REVILLA', 'Q1M3: Processes and Landforms along Plate Boundaries', '', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"background-color:white\"><span style=\"font-family:Roboto\"><span style=\"color:#333333\">Good day and Mabuhay, learners!&nbsp;&nbsp;</span></span></span></span></span></span><span style=\"font-family:Roboto\"><span style=\"font-size:16px\">Welcome to quarter 1, week 5.</span></span></p>\r\n\r\n<p><strong><span style=\"font-family:Roboto\"><span style=\"font-size:16px\">Module 3: Processes and Landforms along Plate Boundaries&nbsp;</span></span></strong></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:Roboto\"><span style=\"color:#333333\">After going through this module, you are expected to&nbsp;</span></span></span><strong><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">explain the different processes along the plate boundaries. S10ES-Ia-j-36.3.&nbsp;</span></span></span></strong><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Specifically,</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">1.&nbsp; explain what happens when the oceanic plate and continental plate collide;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">2.&nbsp; identify the landforms associated with oceanic and continental plate convergence;&nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">3.&nbsp; explain what happens when two oceanic plates collide;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">4.&nbsp; identify the landforms associated with oceanic plate convergence;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; 5. explain what happens when two continental plate boundaries collide; and&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">6.&nbsp; identify the landforms associated with continental plate convergence.&nbsp;</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">For your tasks:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.&nbsp; &nbsp; Access the soft copy of the DLM in the eLearning Platform or using this link:&nbsp;</span><br />\r\n<span style=\"color:#3300ff\">https://drive.google.com/file/d/1sDn8tWvkc1YOdP0geNPVt_OslDVkv5OB/view?usp=sharing</span><br />\r\n<span style=\"color:black\">2. Read and study &ldquo;What Is It&rdquo; on pages 5-6, 9, and 13 for self-learning.<br />\r\n3. Try to answer the assessment on pages 7, 11, and 15. Compare your answers to the answer key at the end of the module.<br />\r\n4. Research any famous geologic landforms,&nbsp;geological activities, and processes that were created by the convergent plate boundaries. Draw or&nbsp;have them printed (1 geologic landform for each type of convergent boundary).<br />\r\n5. Download the chart&rsquo;s template in the supplementary DLM of the eLP and print/copy in either A4-sized bond/ Oslo paper. Use coloring materials or cut-out/printed pictures for the&nbsp;illustrations and geologic landforms.<br />\r\n6. See the rubric guide in the supplementary DLM of eLP for your performance task #1.<br />\r\n7. Bring #4 and #5 to your synchronous class.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span></span></span></span></span></p>\r\n', '09', '2022', '19'),
(260, 'teacher7409192', '74', 'MARIKINA SCIENCE HIGH SCHOOL', 'DAISY  B. . REVILLA', 'Q1M3: Processes and Landforms along Plate Boundaries', '', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"background-color:white\"><span style=\"font-family:Roboto\"><span style=\"color:#333333\">Good day and Mabuhay, learners!&nbsp;&nbsp;</span></span></span></span></span></span><span style=\"font-family:Roboto\"><span style=\"font-size:16px\">Welcome to quarter 1, week 5.</span></span></p>\r\n\r\n<p><strong><span style=\"font-family:Roboto\"><span style=\"font-size:16px\">Module 3: Processes and Landforms along Plate Boundaries&nbsp;</span></span></strong></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:Roboto\"><span style=\"color:#333333\">After going through this module, you are expected to&nbsp;</span></span></span><strong><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">explain the different processes along the plate boundaries. S10ES-Ia-j-36.3.&nbsp;</span></span></span></strong><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Specifically,</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">1.&nbsp; explain what happens when the oceanic plate and continental plate collide;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">2.&nbsp; identify the landforms associated with oceanic and continental plate convergence;&nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">3.&nbsp; explain what happens when two oceanic plates collide;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">4.&nbsp; identify the landforms associated with oceanic plate convergence;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; 5. explain what happens when two continental plate boundaries collide; and&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">6.&nbsp; identify the landforms associated with continental plate convergence.&nbsp;</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">For your tasks:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.&nbsp; &nbsp; Access the soft copy of the DLM in the eLearning Platform or using this link:&nbsp;</span><br />\r\n<span style=\"color:#3300ff\">https://drive.google.com/file/d/1sDn8tWvkc1YOdP0geNPVt_OslDVkv5OB/view?usp=sharing</span><br />\r\n<span style=\"color:black\">2. Read and study &ldquo;What Is It&rdquo; on pages 5-6, 9, and 13 for self-learning.<br />\r\n3. Try to answer the assessment on pages 7, 11, and 15. Compare your answers to the answer key at the end of the module.<br />\r\n4. Research any famous geologic landforms,&nbsp;geological activities, and processes that were created by the convergent plate boundaries. Draw or&nbsp;have them printed (1 geologic landform for each type of convergent boundary).<br />\r\n5. Download the chart&rsquo;s template in the supplementary DLM of the eLP and print/copy in either A4-sized bond/ Oslo paper. Use coloring materials or cut-out/printed pictures for the&nbsp;illustrations and geologic landforms.<br />\r\n6. See the rubric guide in the supplementary DLM of eLP for your performance task #1.<br />\r\n7. Bring #4 and #5 to your synchronous class.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span></span></span></span></span></p>\r\n', '09', '2022', '19'),
(261, 'teacher7009191', '70', 'MARIKINA SCIENCE HIGH SCHOOL', 'MA. VICTORIA  G. . AMBAS', 'Instructions for this week, Sept. 19-23, 2022', '', '<p>Hello Grade 10!</p>\r\n\r\n<p>Your WLP has been sent to you so please be guided accordingly. Make sure that you will be able to do the tasks indicated there. Furthermore, follow instructions well.</p>\r\n', '09', '2022', '19'),
(262, 'teacher14609191', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Module 5 Midpoint and Division of Line Segment', '', '<p><span style=\"color:#27ae60\"><em><strong>Good day, Grade 10 learners!</strong></em></span></p>\r\n\r\n<p>Please make time to read and do the following:</p>\r\n\r\n<p>1. Access the soft copy of the SLM at eLearning platform. You can also access the following modules in this link: <strong><a href=\"http://bit.ly/Q1AnGeomModules\">bit.ly/Q1AnGeomModules</a></strong></p>\r\n\r\n<p>2. Access the video link&nbsp;for self-learning.&nbsp;<strong><a href=\"https://www.youtube.com/watch?v=bozVx8Phq YY\">https://www.youtube.com/watch?v=bozVx8Phq YY</a></strong></p>\r\n\r\n<p>3. Read and study the following activities in the module. (Self-learning)</p>\r\n\r\n<ul>\r\n	<li>What&rsquo;s In on pg. 3</li>\r\n	<li>What&rsquo;s New on pg. 4</li>\r\n	<li>What Is It on pp. 4-8</li>\r\n</ul>\r\n\r\n<p>4. After reading the module and then watching the video.<em><strong> <span style=\"color:#8e44ad\">Answer and submit What I Have Learned on pg. 8.</span></strong></em><span style=\"color:#8e44ad\"> </span>You may access the link:&nbsp;<strong><a href=\"https://www.canva.com/design/DAFL-ppt7 UU/NXNZm9V96XdXCYjUwAX_lg/view?ut m_content=DAFL-ppt7UU&amp;utm_campaign =designshare&amp;utm_medium=link&amp;utm_sou rce=sharebutton&amp;mode=preview\">https://www.canva.com/design/DAFL-ppt7 UU/NXNZm9V96XdXCYjUwAX_lg/view?ut m_content=DAFL-ppt7UU&amp;utm_campaign =designshare&amp;utm_medium=link&amp;utm_sou rce=sharebutton&amp;mode=preview</a></strong></p>\r\n\r\n<p>5. Bring the following during the face-to-face session. <em>(Kindly be familiar with the What I Can Do of Module 4 &amp;5)</em></p>\r\n\r\n<ul>\r\n	<li>1 short bond paper</li>\r\n	<li>scissors</li>\r\n	<li>coloring materials</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have concerns, kindly message so I can assist you! Thank you and have a good day!</p>\r\n', '09', '2022', '19'),
(263, 'teacher14609192', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Module 5 Midpoint and Division of Line Segment', '', '<h1><span style=\"color:#e74c3c\"><em><strong>Kindly submit the Module 5 What I Have Learned in the</strong></em></span><span style=\"color:#2980b9\"><em><strong> eNote tab</strong></em></span><span style=\"color:#e74c3c\"><em><strong>.</strong></em></span> Thank you!&nbsp;</h1>\r\n', '09', '2022', '19'),
(264, 'teacher7009192', '70', 'MARIKINA SCIENCE HIGH SCHOOL', 'MA. VICTORIA  G. . AMBAS', 'link for additional video on the lesson', '', '<p>Grade 10 here is another link for an additional video lesson on our topic for this week. Kindly watch and take note of the different types of accessibility.</p>\r\n\r\n<p>https://www.youtube.com/watch?v=89YO_0MWlH8&amp;t=826s</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '19'),
(265, 'teacher10509191', '105', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'IMELDA  C . ALCANZO', '21st Century', '', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\">Instruction for 21<sup>st</sup> Century</span></strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Read and study the lesson about the <strong>Texts and Contexts of 21stCentury Philippine Literature</strong></span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<ol start=\"2\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Read the story <strong>of One Day on The Road Temistokles M. Adlawan</strong></span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<ol start=\"3\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Activity: Respond critically to the following questions to process the selection (<strong>One Day on The Road)</strong></span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<ol start=\"4\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Watch the </span><a href=\"https://www.youtube.com/watch?v=6FR06d3SePs\" style=\"color:#0563c1; text-decoration:underline\"><span style=\"font-size:12.0pt\">https://www.youtube.com/watch?v=6FR06d3SePs</span></a></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:48px; margin-right:15px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Guide Questions:</span></span></span></p>\r\n\r\n<p style=\"margin-left:48px; margin-right:15px\">&nbsp;</p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">What can you say about the transportation system in our country?</span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:48px; margin-right:27px\">&nbsp;</p>\r\n\r\n<ol start=\"2\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">What are the usual problems of the transport industry and how does the industry in general address these problems?</span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:7px; margin-right:15px\">Note: Access your eLibro on your platform for the Module 3 of 21st Century</p>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n', '09', '2022', '19'),
