(268, 'teacher142109192', '1421', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROXANNE  R . TAMAYO', 'TLE WEEK 5', '', '<p><span style=\"font-size:18px\">Good day studentsl! For our asynchronous activities, kindly do the following tasks: </span></p>\r\n\r\n<p><span style=\"font-size:18px\">a. Read <strong>&ldquo;Module 2 Lesson 1: Types of Entepreneurship and the Entrepreneur&rdquo;,</strong> pages 2-5. </span></p>\r\n\r\n<p><span style=\"font-size:18px\">b. For practice exercise, answer <strong>&quot;What&rsquo;s New&rdquo;</strong> on page 3-4 </span></p>\r\n\r\n<p><span style=\"font-size:18px\">c. Accomplish <strong>&ldquo;What&#39;s More&quot; </strong>on pages 5 and be ready to present your output next face-to-face meeting. </span></p>\r\n\r\n<p><span style=\"font-size:18px\">If you have questions, you may send me a message and I&#39;m willing to assist you. Thank you.</span></p>\r\n', '09', '2022', '19'),
(269, 'teacher12009203', '120', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'LESLIE MICHELLE  M . SALCEDA', '', '', '<p><strong>Q1M3-Reading/Viewing for Author&rsquo;s Purpose</strong></p>\r\n\r\n<p>Good day eLearners!</p>\r\n\r\n<p>For this week&#39;s tasks kindly work on the activities in Module 3. Write your answers in your English notebook:</p>\r\n\r\n<p>a. What I Know &ndash; pp. 2-3</p>\r\n\r\n<p>b. What&rsquo;s New &ndash; p. 4</p>\r\n\r\n<p>c. What Is It &ndash; pp. 5-6</p>\r\n\r\n<p>For your&nbsp;<strong>Performance Task</strong>, work on&nbsp;<strong>What I Can Do&nbsp;</strong>pp. 9-11 by group&nbsp;<em>(assigned group is posted in the comment section)</em>. Choose ONE from the styles in presenting your output. A member shall submit the group output on this link:&nbsp;<a href=\"https://forms.gle/M1YQVrhpXA4nArRz6?fbclid=IwAR2PLO0tsZu3QvV0Amf275yY_Uc4lcBYeB7hL9PTB3zVL-WEmA46iR8A8n8\" rel=\"nofollow noopener\" tabindex=\"0\" target=\"_blank\">https://forms.gle/M1YQVrhpXA4nArRz6</a>&nbsp;or to eNote.</p>\r\n\r\n<p>For the&nbsp;<strong>quiz</strong>,<strong>&nbsp;</strong>go to the Assessment Summative Tab and answer <strong>Q1M3-Quiz 3-Reading/Viewing for Author&rsquo;s Purpose</strong></p>\r\n\r\n<p><br />\r\n<strong>DEADLINE: September 23, 2022 (Friday)</strong><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Note:</strong></p>\r\n\r\n<p>You may access the first quarter modules by clicking this link:<br />\r\n<a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Ftinyurl.com%2F4bz88dzr%3Ffbclid%3DIwAR1uNRFE5KyvPTwJrGQGTFjL9pm8QojxIQg16KpIt59g_nwNzSM6Dmkwpyk&amp;h=AT1rx37W4nwaTyC45cP-mXaTKyIVhOz9aq9hBprCWaqS8tI-8elAfdc3G6Ppk9ViLkXS0Y0E87hWtZq0k7NzdSCnHDNrKuLbugBdQUISF1B-ejeh3Y6WklgHHR_ZFHcUtr-Zt5ci-Q&amp;__tn__=-UK-R&amp;c[0]=AT2AOlcCeawpKaVGRKFFVSHeyFnd6w520oVToHEiQgeJpePhQNt7Uo8XqjqxuW0WeTECqqHA-NWWlZqzIydLGEmfYgRIhyxvDX4JITlkhNHeL_YmRVjD9ypu5CmxmjVeAaIbY-TzB2aLHWdtkD7coGzEORsKCxbyv_AeR2YorkxCgz66oo3ir2inipwNksTsS-G2lmsio7z38q6oEA\" rel=\"nofollow noopener\" tabindex=\