(270, 'teacher12909201', '129', 'MARIKINA SCIENCE HIGH SCHOOL', 'ALFRED BENEDICT   G. . RECLOSADO', 'Exercise 04', '', '<p>Use the move and rectangular marquee tool to solve the puzzle. Use the e-note and Google drive for your output. Name your file as Exercise 04. Export or save your file in .png format.</p>\r\n\r\n<p>Activity Link :&nbsp; https://tinyurl.com/yxpr75kr</p>\r\n\r\n<p>* Please use Photopea (https://www.photopea.com/) if you do not have Adobe Photoshop installed.</p>\r\n', '09', '2022', '20'),
(271, 'teacher736209211', '7362', 'MARIKINA SCIENCE HIGH SCHOOL', 'CARLO  R . DELACRUZ', 'Welcome to our Consumer Chemistry 9 Class!', '', '<p>Announcement:</p>\r\n\r\n<p>Read and study for our next topic:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Organic and Inorganic Compounds</li>\r\n	<li>Hydrocarbons&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p>Reminder: Do not forget to bring your quiz notebook and index card for our next meeting.&nbsp;</p>\r\n\r\n<p>See you all next week. :)</p>\r\n', '09', '2022', '21'),
(272, 'teacher135909216', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'RHGP_Q1 – M2: Discovering the Road  to Self-Discipline', '', '<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-family:arial\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Good Day Creadible!</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Read and Understand&nbsp; this module 2 for RHGP entitled&nbsp;</span></span></span></span></span><strong>Discovering the Road to Self-Discipline</strong><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\"><strong>&nbsp;</strong>then do the following tasks:</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">a.&nbsp;You can do it&nbsp;<strong>(notebook)</strong></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">b.&nbsp;What I have Learned&nbsp;<strong>(notebook)</strong></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">c.&nbsp;Share your Thoughts &amp; Feelings&nbsp;<strong>(short bondpaper)<br />\r\n<br />\r\nSubmission: SET A - Monday (Sept. 26, 2022)</strong></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SET B - Tuesday (Sept. 27, 2022)</strong></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\"><strong>Thank you. :)</strong></span></span></span></span></span></p>\r\n', '09', '2022', '21'),
(273, 'teacher135909217', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Q1-Module 3 - Structural Standards', '', '<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Good Day Tech. Drafting Learners!</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Don&#39;t forget to read and study our first Lesson Module 3&nbsp; - Structural Standards. Check DLM tab <strong>Supplementary</strong> for the Module.</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">Thank you&nbsp;</span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:14px\"><span style=\"font-family:arial,sans-serif\">-Ma&#39;am Salamat</span></span></span></span></span></p>\r\n', '09', '2022', '21'),
