(275, 'teacher11809226', '118', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'SHIELA  B . MORENO', 'DIGITAL POSTER MAKING', 'image/Screenshot 2022-09-22 123708.png', '<p><strong><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Good day e- Learners!</span></span></span></strong></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Can you make good arguments now? Let&rsquo;s see how well you do by doing this activity.&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>Poster Making Activity</strong></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Create a poster that deals with the issues/ topics to be given below. The poster should contain the structure of an argumentative essay- the hook, claim, proof, and conclusion.&nbsp; (see your Module 2 page 14 for the sample poster).&nbsp;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Here are the possible topics:</span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Gender Inequality ( Are Women Weaker than Men)</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Freedom of Expression (Should Teenagers Be Allowed to Hold Government Position?</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Healthy Lifestyle (Why Soft drinks are not Allowed in School?)</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Anti- Bullying (Why Do We Have Bullies?)</span></span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '22');
