(276, 'teacher11809227', '118', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'SHIELA  B . MORENO', 'MODULE 2 LESSON 2 CONDITIONALS', '', '<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>Good day, Awesomeness!</strong></span></span></span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>Let&rsquo;s start this week with love in our hearts! Today, we shall start working on Module 2: Lesson No. 2: Conditionals. Before we meet later for our synchronous class, kindly do the following tasks:</strong></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>1. Watch these videos:&nbsp;</strong></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"list-style-type:disc\"><a href=\"https://www.youtube.com/watch?v=3ob5hQTOwWM\" style=\"text-decoration:none\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#1155cc\"><strong><u>https://www.youtube.com/watch?v=3ob5hQTOwWM</u></strong></span></span></span></a></li>\r\n	<li style=\"list-style-type:disc\"><a href=\"https://www.youtube.com/watch?v=1ZrngfleXuE\" style=\"text-decoration:none\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#1155cc\"><strong><u>https://www.youtube.com/watch?v=1ZrngfleXuE</u></strong></span></span></span></a><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>&nbsp;</strong></span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><a href=\"https://www.youtube.com/watch?v=9RQvWUGMzHo\" style=\"text-decoration:none\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#1155cc\"><strong><u>https://www.youtube.com/watch?v=9RQvWUGMzHo</u></strong></span></span></span></a><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>&nbsp;</strong></span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><a href=\"https://www.youtube.com/watch?v=AUTkyrbxGOc\" style=\"text-decoration:none\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#1155cc\"><strong><u>https://www.youtube.com/watch?v=AUTkyrbxGOc</u></strong></span></span></span></a></li>\r\n</ul>\r\n\r\n<p style=\"list-style-type:disc\">2.&nbsp;<span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>Do the following tasks in your module 2 Lesson 2</strong></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>What I know B. Conditionals pages 3-4</strong></span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>What&rsquo;s In Page 18</strong></span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>What&rsquo;s New page 19</strong></span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>Read and study What Is It pages 20-22</strong></span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>What&rsquo;s More Activity 1 page 22&nbsp;</strong></span></span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><strong>See you later for our synchronous class.&nbsp;</strong></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '22'),
(277, 'teacher288009222', '2880', 'PARANG HIGH SCHOOL', 'VANDON  T . BORELA', '', '', '<p>September 23, 2022, Friday</p>\r\n\r\n<p>Performance Task.</p>\r\n\r\n<p>Research any famous geologic landform that was created by convergent oceanic &ndash; oceanic plate boundary movement and create an infographic showing its, location, origin, and other interesting facts.</p>\r\n\r\n<p>You may do it</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>hand-drawn in short bond paper</p>\r\n	</li>\r\n	<li>\r\n	<p>PowerPoint /publisher then print paste it on your notebook</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rubrics for scoring</p>\r\n\r\n<p>Content (10 pts) Accurate and detailed information is provided.</p>\r\n\r\n<p>Organization (5 pts) Information are systematically organized, and it is easy for the reader to understand</p>\r\n\r\n<p>Visual Appeal (5 pts) Letter, colors, images, layouts, and other visual elements help in the expressing overall idea of the infographics</p>\r\n\r\n<p>Citation (5 pts). All sources of information are cited using APA style.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Due on September 27, 2022, Tuesday</p>\r\n', '09', '2022', '22'),
(278, 'teacher9909231', '99', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'RAYMOND  C . MAGADIA', 'RATIONAL ALGEBRAIC EXPRESSIONS', '', '<p>GOOD MORNING ELEARNERS!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>OUR TOPIC FOR NEXT WEEK IS ALL ABOUT RATIONAL ALGEBRAIC EXPRESSIONS.</p>\r\n\r\n<p>OUR OBJECTIVES FOR NEXT WEEK IS FOR YOU TO BE ABLE TO:</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\">1. Defines and illustrates rational algebraic expressions&nbsp;&nbsp; </span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2. Simplifies Rational Algebraic Expressions (with common monomial factors)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3. Simplifies Rational Algebraic Expressions (with expressions factorable by difference of two squares&nbsp;</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">and sum and difference of two cubes)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">4.Simplifies Rational Algebraic Expressions (with perfect squares trinomials and general trinomials)</span></span></p>\r\n\r\n<p>TO EXPLORE THE LESSON, KIDNLY WATCH THE FOLLOWING.</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">GRADE 8 MATH Q1 EP5: RATIONAL ALGEBRAIC EXPRESSIONS</span></span></strong></span></span></p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=GgpF_WOnIbw\">https://www.youtube.com/watch?v=GgpF_WOnIbw</a></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">GRADE 8 MATH Q1 EP 6 SIMPLIFYING RATIONAL ALGEBRAIC EXPRESSIONS</span></span></strong></span></span></p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=6kKxT3mFZvI\">https://www.youtube.com/watch?v=6kKxT3mFZvI</a></p>\r\n\r\n<p>FOR YOUR GROUP WORKS:</p>\r\n\r\n<p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">GROUP 1 &amp; 3: WHAT&rsquo;S IN, PP. 3 &ndash; 4 AND WHAT&rsquo;S NEW PP. 4 &ndash; 5 &nbsp;</span></span></span></span></p>\r\n\r\n<p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">GROUP 2 &amp; 4: WHAT&rsquo;S IN, P. 14 </span></span></span></span></p>\r\n\r\n<p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Submit it (MP4 format) on the GDRIVE that I have given to you.&nbsp;</span></span></span></span></p>\r\n\r\n<p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Thank you!</span></span></span></span></p>\r\n', '09', '2022', '23'),
(279, 'teacher9509232', '95', 'MARIKINA SCIENCE HIGH SCHOOL', 'MERCED  A. . ANSAY', '', '', '<p>Hi there! Due to the suspension of classes last Tuesday, Sept. 20, 2022, the afternoon session is required to answer the 5 items assessment online.&nbsp;</p>\r\n\r\n<p>MAAnsay</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '23'),
