(281, 'teacher7209262', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Q1_W6_Epiko mula sa Mesopotamia at Pananda sa Mabisang Paglalahad', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Magandang araw sa inyo Grade 10,</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Sa ikaanim na linggo ng unang kapat nais kong ipaalala ang mga sumusunod:</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">I. BAGO ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</span></span></strong><br />\r\n<span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">A. Basahin at aralin ang mga sumusunod na gawain sa module (Self-learning):</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">MODYUL 6: Pagsulat ng Pananaw sa Epiko, Paggamit ng Hudyat sa Pagsusunod-sunod at Pag-uugnay ng Pangyayari at Pagbibigay-kahulugan batay sa Konteksto ng Pangungusap</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Suriin pp. 9-10</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Isaisip p. 12</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">&nbsp;B. Subukang sagutin ang mga gawain sa ibaba at ikumpara ang inyong kasagutan sa susing sagot. Sa mga nais ng paglilinaw mangyaring magpatulong sa guto. Isumite ang inyong alintana o katanungan sa<em> </em>DISCUSSION TAB. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Modyul 6:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Subukin A at B pp. 1-2</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">C. Panoorin ang video link sa ibaba para sa sariling pagkatuto.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://www.youtube.com/watch?v=GEFfhRMg2Ec\" style=\"color:blue; text-decoration:underline\">https://www.youtube.com/watch?v=GEFfhRMg2Ec</a> Epiko mula sa Mesopotamia: Epiko ni Gilgamesh DepEd TV-Official Youtube Channel-timeframe na 1:25-22:10</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://drive.google.com/file/d/1WA1SgG3mJ4Rb-rTOw_LMENsvO6tIehw8/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/1WA1SgG3mJ4Rb-rTOw_LMENsvO6tIehw8/view?usp=sharing</a> Epiko mula sa Mesopotamia at Pananda sa Mabisang Paglalahad</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">D. Sagutin ang Paunang Pagsusulit#1.6 na nasa ASSESSMENT TAB.<br />\r\n<br />\r\nE. Paghandaan ang isasagawang gawain sa harapang pagkaklase.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">UNANG BAHAGI: Bigyang pansin gawain ng bawat pangkat, mangyaring pagbatayan ang gabay na gawain sa ibaba:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 2: Gamit ang limang (5) sekwensiyal na pang-ugnay, ilahad ang pagsusunod-sunod ng pangyayari sa akdang binasa. Gumamit ng sariling pananalita ang paglagom nito.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 1:&nbsp; Sa tulong ng limang (5) kronolohikal na pang-ugnay, magbigay ng katulad na sitwasyon na inilalarawan sa akda na nakikita pa ring ginagawa sa kasalukuyan.&nbsp; Maglahad ng partikula o tiyak na gawain.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 3: Bumuo ng proseso na tatalakay sa paraan ng tao kung paano siyang makaalis sa yungib na hindi niya natural na panirahan. Maglahad ng limang (5) pang-ugnay na prosidyural sa magbibigay ng kahulugan at kabuluhan sa linya ng akda.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">IKALAWANG BAHAGI: Gawain pa para sa lahat, bumuin ito bilang pangkatan. Gamit ang tiyak na linyang nakatalaga sa bawat pangkat, ipaliwanag ang kahulugan ng mga linya sa sariling pangungusap na maaaring halaw sa pangyayari sa akda na kaugnay ng ilang pangyayari sa daigdig. Gumamit ng limang (5) pang-ugnay.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 1-Ang pagkalito ng mga paningin ay dalawang uri o nanggagaling sa dalawang dahilan, maaring mula sa paglabas ng liwanag o patungo sa liwanag.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 2-Ang ideya ng kabutihan ay nananatili sa huli at matatagpuan lamang nang may pagpupunyagi.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">GROUP 3-Ang katotohanan ay walang kahulugan kundi anino ng mga imahe.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><strong>II. MATAPOS ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</strong><br />\r\nUnang Bahagi</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Basahin ang Buod ng Hudhud: Kwento ni Aliguyon sa Modyul 6, bigyang hinuha ang katangian ng tauhan at talakayin ang tunggaliang makikita sa epiko. Gumamit ng hindi bababa sa limang (5) pananda sa mabisang paglalahad. Gamitin ang isa (1) sa bawat kategorya.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Ikalawang Bahagi</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Sumulat ng pagkukumpara mula sa epiko ni Gilgamesh at Aliguyon. Talakayin ang isyung pandaigdig na iniuugnay sa buhay ng mga Pilipino gayundin ang sariling damdamin at saloobin tungkol sa sariling kultura kung ihahahambing sa kultura ng ibang bansa. Gamitin ang isa (1) pananda sa bawat kategorya sa paglalahad na hindi bababa sa lima (5).</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '26'),
(282, 'teacher135909268', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Module 3- Foundation Planning ', '', '<p>Good day Tech. Draft learners!</p>\r\n\r\n<p>You may now start to do Performance Task (PT) #3 Module 3-Foundation Planning.&nbsp;</p>\r\n\r\n<p>Do WHAT I CAN DO on page 13. Do it in Oslo paper (landscape) scale: 1:100mts</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you and Keep safe</p>\r\n', '09', '2022', '26'),
(283, 'teacher9509273', '95', 'MARIKINA SCIENCE HIGH SCHOOL', 'MERCED  A. . ANSAY', '', '', '<p>Hello there! You will be given time for ELP orientation. Explore the tabs while waiting for the date of orientation.</p>\r\n\r\n<p>The assigned assessment will be re-assigned once the orientation has done.&nbsp;</p>\r\n\r\n<p>MAAnsay</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '27'),
(284, 'teacher65751', '6575', '', 'NASIAD , MENERE  R.', 'Video Tutorial_mobile app', '', '<h3><span style=\"font-family:Georgia,serif\">Good day. </span></h3>\r\n\r\n<p><span style=\"font-family:Georgia,serif\">You may <strong>click the link </strong>or<strong> copy and paste the link on your browser </strong>&nbsp;to watch the video tutorial for mobile app.&nbsp; Afterwards, please find time to answer the quick survey. Thank you very much.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-family:Georgia,serif\">Have a great time!&nbsp;</span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Georgia,serif\"><strong>Video tutorial link</strong>: https://www.youtube.com/watch?v=xPtDvvhAFqg</span></p>\r\n\r\n<p><span style=\"font-family:Georgia,serif\"><strong>Feedback:</strong>&nbsp;https://forms.gle/3GUqLjLSKxuTK4vd8</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '09', '2022', '27'),
(285, 'teacher70009273', '700', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'FREDERICK  O . DACUT', 'Arts-9 Western Classical Arts (painting and sculpture)', '', '<p>Good afternoon guys, kindly answer the 2 assessments in mapeh (health and arts) in your most convenient time. The due date of the assessment would be on Oct. 7, 2022 please make sure you will answer before the said date, God bless you all.</p>\r\n', '09', '2022', '27'),
(286, 'teacher12809271', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'First Quarter Trigonometry Modules', '', '<p><strong>Good day Grade 9 Students!</strong></p>\r\n\r\n<p>I already shared the links for First Quarter Trigonometry Modules. Just go to Standard DLM and click the provided links.&nbsp;</p>\r\n\r\n<p>Thanks!&nbsp;<img alt=\"smiley\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/regular_smile.png\" style=\"height:23px; width:23px\" title=\"smiley\" /></p>\r\n\r\n<p>-M&#39; Lily</p>\r\n', '09', '2022', '27'),
(287, 'teacher12909282', '129', 'MARIKINA SCIENCE HIGH SCHOOL', 'ALFRED BENEDICT   G. . RECLOSADO', 'Exercise 05', '', '<p>Use the move, transform and rectangular marquee tool to solve the puzzle. Use the E-learning Platform e-note and Google drive for your outputs. Name your file as Exercise 05. Export or save your file in .png format.</p>\r\n\r\n<p>Activity Link :&nbsp; https://tinyurl.com/3uah8yu5</p>\r\n\r\n<p>* Please use Photopea (https://www.photopea.com/) if you do not have Adobe Photoshop installed.</p>\r\n', '09', '2022', '28'),
