(290, 'teacher12809302', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 04: Angular Speed', '', '<p>Good day Grade 9 Learners!</p>\r\n\r\n<p><strong>Topic:</strong> <span style=\"color:#c0392b\"><em><strong>Module 4: Angular Speed</strong></em></span></p>\r\n\r\n<p><strong>Period:</strong> <span style=\"color:#c0392b\"><em><strong>Qtr 1_Wk 5, September 19 - 23, 2022</strong></em></span></p>\r\n\r\n<p><strong>Instructions:</strong>&nbsp;Please take note of the activities to be accomplished:</p>\r\n\r\n<p>1.&nbsp; &nbsp;For Concept Exploration Activity</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Download the template from Supplementary Materials with file name <strong>Module 04_What I Have Learned</strong>. Write your answers directly on the tempate, then save as pdf file. Upload your output in eNote with the same file name format.</p>\r\n\r\n<p>2.&nbsp; &nbsp;For Performance Task</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Down load the template from the Supplementary Materials with file name <strong>PT3_Angular Speed</strong> and print it. Draw your diagram and show your complete solutions on the space provided. Submit the hard copy of your output during face-to-face session.</p>\r\n', '09', '2022', '30'),
(291, 'teacher12809303', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 05: Linear Speed', '', '<p>Good day Grade 9 Learners!</p>\r\n\r\n<p><strong>Topic:</strong>&nbsp;<span style=\"color:#c0392b\"><em><strong>Module 5: Linear Speed</strong></em></span></p>\r\n\r\n<p><strong>Period:</strong>&nbsp;<span style=\"color:#c0392b\"><em><strong>Qtr 1_Wk 6, September 26 - 30, 2022</strong></em></span></p>\r\n\r\n<p><strong>Instructions:</strong>&nbsp;Please take note of the activities to be accomplished:</p>\r\n\r\n<p>1.&nbsp; &nbsp;For Concept Exploration Activity</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Download the template from Supplementary Materials with file name&nbsp;<strong>Module 5_What I Have Learned [Trigo, Q1_Wk 6]</strong>. Write your answers directly on the tempate, then save as pdf file. Upload your output in eNote with the same file name format.</p>\r\n\r\n<p>2.&nbsp; &nbsp;For Performance Task</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Down load the template from the Supplementary Materials with file name&nbsp;<strong>PT4_Liinear Speed [Trigo, Q1_Wk 6]</strong>&nbsp;and print it. Draw your diagram and show your complete solutions on the space provided. Submit the hard copy of your output during face-to-face session.</p>\r\n', '09', '2022', '30'),
(292, 'teacher12809304', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 06: Triangles', 'image/sohcahtoa-all.png', '<p>Good day Grade 9 Learners!</p>\r\n\r\n<p><strong>Topic:</strong>&nbsp;<span style=\"color:#c0392b\"><em><strong>Module 6: Triangles</strong></em></span></p>\r\n\r\n<p><strong>Period:</strong>&nbsp;<span style=\"color:#c0392b\"><em><strong>Qtr 1_Wk 7, October 3 - 10, 2022</strong></em></span></p>\r\n\r\n<p><strong>Instructions:</strong>&nbsp;Please take note of the activities to be accomplished:</p>\r\n\r\n<p>1.&nbsp; &nbsp;For Concept Exploration Activity</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Download the template from Supplementary Materials with file name&nbsp;<strong>Module 6_Additional Activites [Trigo, Q1_Wk 7]</strong>. Write your answers directly on the tempate, then save as pdf file. Upload your output in eNote with the same file name format.</p>\r\n\r\n<p>2.&nbsp; &nbsp;For Performance Task</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Down load the template from the Supplementary Materials with file name&nbsp;<strong>PT5_Triangles [Trigo, Q1_Wk 7]</strong>&nbsp;and print it. Draw your diagram and show your complete solutions on the space provided. Submit the hard copy of your output during face-to-face session.</p>\r\n', '09', '2022', '30'),
(293, 'teacher10310021', '103', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'JOE MAR  O . PANGUE', 'MATHEMATICS 9', '', '<p>HeLLo 9th Graders!</p>\r\n\r\n<p>How are you? I hope you are good and healthy:)</p>\r\n\r\n<p>Now, please do the following task:</p>\r\n\r\n<p>1. Answer the Module 3 - &quot;DISCRIMINANT Oof Quadratic Equation&quot;</p>\r\n\r\n<p>Write your answer in your Mathamatics notebook.</p>\r\n\r\n<ol>\r\n	<li>WHAT I NEED TO KNOW -Study</li>\r\n	<li>What Is It &ndash; p. 3,&nbsp; - Study</li>\r\n	<li>What I know - p 1- Answer</li>\r\n	<li>What&#39;s In - p. 2 - Answer</li>\r\n	<li>What&rsquo;s More &ndash; p. 4 - Answer</li>\r\n</ol>\r\n\r\n<p>Thank you:)&nbsp;</p>\r\n', '10', '2022', '02'),
(295, 'teacher7210021', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Q1_W7_Nobela mula sa Pransiya at Panghalip Bilang Panuring', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Magandang araw sa inyo Grade 10,</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Sa ikapitong linggo ng unang kapat nais kong ipaalala ang mga sumusunod:</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">I. BAGO ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</span></span></strong><br />\r\n<span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">A. Basahin at aralin ang mga sumusunod na gawain sa module (Self-learning):</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">MODYUL 7: Pagsusuri sa Kabanata ng Nobela (Humanismo o Alinmang Angkop na Pananaw)</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Suriin pp. 10-11</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">MODYUL 8: Pagsulat ng Suring-basa (Akdang Pampanitikang Mediterranean)</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Tuklasin B p. 3-6</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">B. Subukang sagutin ang mga gawain sa ibaba at ikumpara ang inyong kasagutan sa susing sagot. Sa mga nais ng paglilinaw mangyaring magpatulong sa guto. Isumite ang inyong alintana o katanungan sa<em> </em>DISCUSSION TAB. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Modyul 7:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-</span></span> <span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Tayahin pp. 16-17</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">C. Panoorin ang video link sa ibaba para sa sariling pagkatuto.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://www.youtube.com/watch?v=FMH3C5NL24g\" style=\"color:blue; text-decoration:underline\">https://www.youtube.com/watch?v=FMH3C5NL24g</a> Nobela mula sa Pransya: Ang Kuba ng Notre Dame DepEd TV-Official Youtube Channel-timeframe na 5:30-22:42.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://drive.google.com/file/d/1klNcPiJPbCFLaDiNRgGNet0LlIfOf9-Q/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/1klNcPiJPbCFLaDiNRgGNet0LlIfOf9-Q/view?usp=sharing</a> Nobela mula sa Pransiya at Panghalip Bilang Panuring</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">D. Bukas ang aking gmeet link na <a href=\"https://meet.google.com/wjp-tcsg-wmf\" style=\"color:blue; text-decoration:underline\">https://meet.google.com/wjp-tcsg-wmf</a> tuwing Lunes ng 1:20-2:20NH. Mangyaring pumasok kung mayroon kayong tanong o paglilinaw sa aking asignatura.</span></span></span></span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><strong>II. MATAPOS ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</strong></span></span></span></span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Basahin ang bahagi ng noebelang Titser ni Liwayway Arceo sa Module 7, Tuklasin B pp. 4-7. Pumili ng angkop na pananaw pampanitikan na lumutang sa bahagi ng kabanatang binasa. Maaaring gamitin ang pagbibigay katangian sa tauhan o paglalarawan sa kultura na natatagpuan sa tagpo/eksena ng kabanatang binasa.</span></span></span></span></p>\r\n', '10', '2022', '02'),
(297, 'teacher14610021', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'AnGeom GMeet Link', '', '<p>Good day, Grade 10 Learners!<br />\r\n<br />\r\nPlease note that the Analytic Geometry Google Meet Link is <em><strong><a href=\"http://bit.ly/ANGEOM\">https://bit.ly/ANGEOM</a>.</strong></em></p>\r\n\r\n<p>If you have questions or other concern please let me know by entering on this link. The link will be open from 8:00-8:30AM only. Thank you and have a good day!</p>\r\n', '10', '2022', '02'),
(298, 'teacher14610032', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'AnGeom GMeet Link', '', '<p>Good morning, Grade 10 Learners!<br />\r\n<br />\r\nPlease be guided that the GMeet Link for Analytic Geometry is <em><strong><a href=\"http://bit.ly/ANGEOM\">https://bit.ly/ANGEOM</a>.</strong></em></p>\r\n\r\n<p>If you have concerns or questions, please free to enter the link. Thank you and have a good day!</p>\r\n', '10', '2022', '03'),
(299, 'teacher288010031', '2880', 'PARANG HIGH SCHOOL', 'VANDON  T . BORELA', 'Science 10 Module 4 ', '', '<p><strong>October 3, 20222, Monday - Concept Exploration</strong></p>\r\n\r\n<p>Lesson 4. Convection Current</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Read the information presented in Module 4 Lesson 4 &ndash;&nbsp;<strong>What Is It</strong>&nbsp;on&nbsp;<strong>pages 23 to 24</strong>. This will help you in understanding how the layers of the Earth beneath the crust cause movement among lithospheric plates.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&middot; 2. Do&nbsp;<strong>Module 4 Lesson 4 &ndash; What&rsquo;s More on page 25</strong></p>\r\n\r\n<p>3. Write your answers in your Science notebook. Due on October<br />\r\n4, 2022, Tuesday.</p>\r\n\r\n<p>4. Each group/table will bring the following for the experiment.</p>\r\n\r\n<p>a. 1L Cooking oil</p>\r\n\r\n<p>b. Colored chalk preferably red</p>\r\n', '10', '2022', '03'),
(300, 'teacher7110031', '71', 'MARIKINA SCIENCE HIGH SCHOOL', 'MARK ANTHONY   F. . CASIMIRO', 'Research Template', '', '<p>Good morning everyone! I hope that everyone is doing fine. The research plan template has just been uploaded here. You can just download it. And also, please be reminded of the format of our paper.<br />\r\nFont style: Times New roman Font size: 12 Double Spacing justified Top, bottom, left and right- 1 inch<br />\r\n&nbsp;</p>\r\n', '10', '2022', '03'),
(305, 'teacher288010062', '2880', 'PARANG HIGH SCHOOL', 'VANDON  T . BORELA', '', '', '<p>October 7, 2022, Friday</p>\r\n\r\n<p>Learners Generated Output</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ACTIVITY 8D - HOW DO WE COOK BY CONVECTION?</p>\r\n\r\n<p>Palitaw is a kind of sweet, chewy, and flattened rice cake. This Filipino rice cake is prepared by soaking glutinous rice grains in water overnight and then processed as a dough. The dough is flattened into small pieces and cooked in boiling water until they float; this is the reason it was called palitaw. Based on your knowledge about convection current, make a sketch that can explain why palitaw floats in boiling water. In your Science notebook sketch the convection current occurring in making the said rice cake.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Due date: Oct 11,2022, Tuesday</p>\r\n', '10', '2022', '06'),
(306, 'teacher12910091', '129', 'MARIKINA SCIENCE HIGH SCHOOL', 'ALFRED BENEDICT   G. . RECLOSADO', 'Exercise 06', '', '<p>Use the E-learning Platform e-note and Google drive for your outputs. Name your file as Exercise 06. Export or save your file in .png format.<br />\r\nActivity Link :&nbsp; https://tinyurl.com/2euxacxx</p>\r\n', '10', '2022', '09'),
(307, 'teacher142110091', '1421', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROXANNE  R . TAMAYO', 'TLE WEEK 8', '', '<p style=\"margin-left:40px\"><span style=\"font-size:22px\">Good day learners! For this week, in preparation for our next face-to-face meeting, kindly do the following task at home.</span></p>\r\n\r\n<p style=\"margin-left:40px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-size:22px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">1. Read &ldquo;<strong><em>Module 3 Lesson 1:</em></strong></span></span><strong><em> </em></strong><strong><em><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\">Personal Entrepreneurial Competencies (PEC&rsquo;s)</span></em></strong><strong><em><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\">&rdquo;,</span></em></strong><em><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"> pages 4-5.</span></em></span></span></p>\r\n\r\n<ol>\r\n	<li style=\"list-style-type:none\"><span style=\"font-size:22px\">2.&nbsp;<span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">For practice exercise, answer&nbsp;<strong><em><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\">&quot;What&rsquo;s More&rdquo; on pages 5-6</span></em></strong></span></span></span></span></li>\r\n	<li style=\"list-style-type:none\">&nbsp;</li>\r\n	<li style=\"list-style-type:none\"><span style=\"font-size:22px\">3.&nbsp;<span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Arial Narrow&quot;,sans-serif\"><span style=\"color:black\">Choose one of the entrepreneurial competencies that was mentioned in <strong>module 3 lesson 1, pages 3-5.</strong> Draw or print a picture of a scenario that demonstrates your chosen competencies.</span></span></span></s