(317, 'teacher7210103', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Q1_W8_Tula mula sa Ehipto at Pananda sa Pagpapahayag ng Emosyon o Damdamin', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Magandang araw sa inyo Grade 10,</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Sa ikawalong linggo ng unang kapat nais kong ipaalala ang mga sumusunod:</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">I. BAGO ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</span></span></strong><br />\r\n<span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">A. Basahin at aralin ang mga sumusunod na gawain sa module (Self-learning):</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">MODYUL 8: Pagsulat ng Suring-basa (Akdang Pampanitikang Mediterranean)</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Suriin pp. 7-10</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">B. Subukang sagutin ang mga gawain sa ibaba at ikumpara ang inyong kasagutan sa susing sagot. Sa mga nais ng paglilinaw mangyaring magpatulong sa guto. Isumite ang inyong alintana o katanungan sa<em> </em>DISCUSSION TAB. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Modyul 8:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-</span></span><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Isagawa pp. 15-17</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">C. Panoorin ang video link sa ibaba para sa sariling pagkatuto.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://www.youtube.com/watch?v=-cI5VUfKuOI\" style=\"color:blue; text-decoration:underline\">https://www.youtube.com/watch?v=-cI5VUfKuOI</a> Pangwakas na Gawain sa Panitikang Mediterranean: Panunuring Pampanitikan DepEd TV-Official Youtube Channel-timeframe na 6:15-23:55</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://drive.google.com/file/d/1eqOlss3XpPCv8IA9-nC8FVyDkCmAeSN5/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/1eqOlss3XpPCv8IA9-nC8FVyDkCmAeSN5/view?usp=sharing</a> Tula mula sa Ehipto at Pananda sa Pagpapahayag ng Emosyon o Damdamin</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">D. Bukas ang aking gmeet link na </span></span><a href=\"https://meet.google.com/wjp-tcsg-wmf\" style=\"color:blue; text-decoration:underline\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">https://meet.google.com/wjp-tcsg-wmf</span></span></a><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"> tuwing Lunes ng 1:20-2:20NH. Mangyaring pumasok kung mayroon kayong tanong o paglilinaw sa aking asignatura.</span></span></span></span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><strong>II. MATAPOS ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</strong></span></span></span></span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Bumuo ng isang suring-basa sa tulang itatakda ng guro. Sundin ang balangkas sa ibaba at gamitin ang lima (5) o higit pang pananda sa pagbibigay ng tiyak na damdamin sa pagpapaliwanag sa alegoryang matatagpuan sa akda at pag-uugnay nito sa mga nakikita sa kasalukuyang panahon.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">I.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tema o Paksa ng Akda</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">II.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Panauhan, Tauhan at Karakter</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">III.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tagpuan/Panahon at Kultura</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">IV.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kaisipan/Ideyang Taglay ng Akda</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">V.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Estilo ng Pagsulat at Kaanyuan nito</span></span></span></span></p>\r\n', '10', '2022', '10'),
