(319, 'teacher10310112', '103', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'JOE MAR  O . PANGUE', 'Mathematics', '', '<p>HeLLo 11th Graders!</p>\r\n\r\n<p>Welcome to the e-learning and Welcome Back to SchooL:)</p>\r\n\r\n<p>As your teacher, I welcome all of you to the Mathematics Class . I&rsquo;m looking forward to engaging in this topic with you over the coming weeks.&nbsp;</p>\r\n\r\n<p>How are you? I hope you are good and healthy:)</p>\r\n\r\n<p>Now, please do the following task:</p>\r\n\r\n<p>1. Answer your activity sheet about Division of Integers posted below.</p>\r\n\r\n<p><img alt=\"Open photo\" src=\"https://scontent.xx.fbcdn.net/v/t1.15752-9/310593274_1128752261067170_3930615197766031458_n.png?stp=dst-png_p403x403&amp;_nc_cat=108&amp;ccb=1-7&amp;_nc_sid=aee45a&amp;_nc_ohc=iy279BsxC_EAX_h5HsA&amp;_nc_ad=z-m&amp;_nc_cid=0&amp;_nc_ht=scontent.xx&amp;oh=03_AVJOy8YWPXwhKxgBhx2YhtBHbVmAGvjkwF4pZo2d3jDvfA&amp;oe=6368E8FF\" /></p>\r\n\r\n<p>Write your answer in your Mathamatics notebook.</p>\r\n\r\n<p>Thank you:)</p>\r\n', '10', '2022', '11'),
