(323, 'teacher121910121', '1219', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'KYRAH ANDREA  S . PEREZ', 'Module 1- Essential Tools and Equipment in Animation', '', '<p>Hello Animation Competency! Please answer the following from Module 1<br />\r\n<strong>Written works:</strong><br />\r\n&nbsp; &nbsp; &nbsp; What I know:<br />\r\n&nbsp; &nbsp; &nbsp; What&#39;s More:<br />\r\n&nbsp; &nbsp; &nbsp; What I Have Learned<br />\r\n<br />\r\n<strong>Performance Task:</strong><br />\r\nPlease read carefully and do ACTIVITY-WORKSHEET-1<br />\r\n<br />\r\nSubmit your output in the ENOTE SECTION.<br />\r\nHave a nice and productive day!</p>\r\n', '10', '2022', '12'),
