(327, 'teacher8810121', '88', 'MARIKINA SCIENCE HIGH SCHOOL', 'JASMINE  P. . LORENZO', 'FIRST QUARTER IPT', 'image/GRADE-7-IPT-Q1 (1).pdf', '<p>Here&#39;s a copy of your IPT. Download the file and secure your own copy. Upload the file on this link when done:&nbsp;https://drive.google.com/drive/folders/1W-0LcT-aPSxAuuncG-IHT-bxPGFAPUBw?usp=sharing</p>\r\n\r\n<p>Communicate properly to accomplish the task within the given time. Be guided by the rubrics when working. Good luck!</p>\r\n', '10', '2022', '12'),
