(330, 'teacher12410121', '124', 'MARIKINA SCIENCE HIGH SCHOOL', 'JENNY  C. . DELA VEGA', 'FIRST QUARTER OUTPUTS', '', '<p>Written Works</p>\r\n\r\n<p>1. Posttest 1</p>\r\n\r\n<p>2. Posttest 2</p>\r\n\r\n<p>3. Posttest 3</p>\r\n\r\n<p>4. Classifying Substances</p>\r\n\r\n<p>5. Concentration of Solutions</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Performance Tasks</p>\r\n\r\n<p>1. Waste Management</p>\r\n\r\n<p>2. Matter on Labels</p>\r\n\r\n<p>3. Slambook</p>\r\n\r\n<p>4. Mixtures Vlog</p>\r\n\r\n<p>5. Concentration of Solutions</p>\r\n', '10', '2022', '12'),
(331, 'teacher8810123', '88', 'MARIKINA SCIENCE HIGH SCHOOL', 'JASMINE  P. . LORENZO', 'WEEK 9 SKIMMING AND SCANNING LGO', '', '<p>LGO for Skimming and Scanning. Click on this link:&nbsp;<a href=\"https://en.calameo.com/read/004425509c9d23d5aba41?fbclid=IwAR1xZynuGL9U7Ru8Be9lkIScy-b0-piNB1_g6BVGnqc71PaYKbHjL9cZPQ8\" rel=\"nofollow noopener\" tabindex=\"0\" target=\"_blank\">https://en.calameo.com/read/004425509c9d23d5aba41</a></p>\r\n\r\n<p>Read the passage and answer the questions that follow. Write your answers on a 1/4 sheet of paper.</p>\r\n', '10', '2022', '12'),
(332, 'teacher8710123', '87', 'MARIKINA SCIENCE HIGH SCHOOL', 'MARY CRIS  M. . MIRABEL', 'INTEGRATIVE PERFORMANCE TASK', 'image/GRADE-7-IPT-Q1.pdf', '<p>Good morning! Here&#39;s your copy of the IPT. Upload your final output on this link:&nbsp;<a href=\"https://tinyurl.com/IPTQ1INDEPENDENCE?fbclid=IwAR2sQ0Jpts0jkU__FcOlbDpQtAhQsFmMR3M2WM0xI1JWdigcE--oZjB4n5U\" rel=\"nofollow noopener\" tabindex=\"-1\" target=\"_blank\">https://tinyurl.com/IPTQ1INDEPENDENCE</a></p>\r\n\r\n<p>Please coordinate with your groupmates and finish the task within the given time. Be guided by your rubrics. Thank you!</p>\r\n\r\n<p>&nbsp;</p>\r\n', '10', '2022', '12'),
