(335, 'teacher13510131', '135', 'MARIKINA SCIENCE HIGH SCHOOL', 'JOSHUA CALEB   P. . PACLETA', 'Online Class', '', '<p><strong>ATTENTION</strong></p>\r\n\r\n<p>For those who have journalism-related questions and concerns, please meet me here by 11:05 AM</p>\r\n\r\n<p>https://meet.google.com/hvc-gezf-snx&nbsp;</p>\r\n', '10', '2022', '13'),
(336, 'teacher736210131', '7362', 'MARIKINA SCIENCE HIGH SCHOOL', 'CARLO  R . DELACRUZ', 'REMINDERS FOR WEEK 9', '', '<p>Good morning Grade 9 students, please be reminded of the following for our meeting on Week 9 (October 17-21, 2022)&nbsp;</p>\r\n\r\n<p>- BRING SHORT BOND PAPER AND COLORING MATERIALS<br />\r\n- BRING 1/4 SHORT BOND PAPER<br />\r\n- REMINDER FOR QUIZ #3<br />\r\n- STUDY NAMING OF ALCOHOL AND CARBOXYLIC ACID</p>\r\n\r\n<p>Thank you everyone.<img alt=\"smiley\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/regular_smile.png\" style=\"height:23px; width:23px\" title=\"smiley\" /><br />\r\n&nbsp;</p>\r\n', '10', '2022', '13'),
