(338, 'teacher288010133', '2880', 'PARANG HIGH SCHOOL', 'VANDON  T . BORELA', 'Science 10 Module 5 Performance Task', '', '<p>October 14, 2022, Friday</p>\r\n\r\n<p>Asynchronous session - Learners Generated Output</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>PERFORMANCE TASK 3: Activity 9c. Position Paper</p>\r\n\r\n<p>As a student, evaluate Wegener&#39;s hypothesis based on the evidence you have learned. Write a &#39;position paper&#39; on whether the evidence of the theory of continental drift is compelling and conclusive enough for scientific acceptance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Rubrics for scoring</p>\r\n\r\n<p>Content (10 pts) Accurate and detailed information is provided.</p>\r\n\r\n<p>Organization (10 pts) Information are systematically organized, and it is easy for the reader to understand</p>\r\n\r\n<p>Citation (5 pts). All sources of information are cited using APA style</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Write your Position paper in the Science notebook. Due on October 18, 2022, Tuesday.</p>\r\n', '10', '2022', '13'),
(343, 'teacher12810143', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 07: Trigonometric Ratios', '', '<p>Good day <strong><span style=\"color:#e74c3c\">Grade 9 Accountability</span></strong>!</p>\r\n\r\n<p><strong>Topic:&nbsp;<span style=\"color:#c0392b\"><em>Module 7: Trigonometric Ratios</em></span></strong></p>\r\n\r\n<p><strong>Period:&nbsp;<span style=\"color:#c0392b\"><em>Qtr 1_Wk 8, October 10 - 14, 2022</em></span></strong></p>\r\n\r\n<p><strong>Instructions:&nbsp;</strong>Please take note of the activity to be accomplished:</p>\r\n\r\n<p>1. For&nbsp;<strong>Written Work #7</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp;</strong>Answer and submit&nbsp;<strong>WW7_Module 7: Trigonometric Ratios [Qtr 1_Wk 8: October 10-14, 2022]&nbsp;</strong>via google form https://forms.gle/vtjqoPWiTVXRDwzk9.&nbsp;</p>\r\n', '10', '2022', '14'),
(344, 'teacher12810144', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 07: Trigonometric Ratios', '', '<p>Good day <span style=\"color:#2980b9\"><strong>Grade 9 Confidentiality</strong></span>!</p>\r\n\r\n<p><strong>Topic:&nbsp;<span style=\"color:#c0392b\"><em>Module 7: Trigonometric Ratios</em></span></strong></p>\r\n\r\n<p><strong>Period:&nbsp;<span style=\"color:#c0392b\"><em>Qtr 1_Wk 8, October 10 - 14, 2022</em></span></strong></p>\r\n\r\n<p><strong>Instructions:&nbsp;</strong>Please take note of the activity to be accomplished:</p>\r\n\r\n<p>1. For&nbsp;<strong>Written Work #7</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp;</strong>Answer and submit&nbsp;<strong>WW7_Module 7: Trigonometric Ratios [Qtr 1_Wk 8: October 10-14, 2022]&nbsp;</strong>via google form https://forms.gle/vtjqoPWiTVXRDwzk9.&nbsp;</p>\r\n', '10', '2022', '14'),
(345, 'teacher12810145', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 08: Trigonometric Ratios of Special Angles', '', '<p>Good day <span style=\"color:#c0392b\"><strong>Grade 9 Learners</strong></span>!</p>\r\n\r\n<p><strong>Topic:&nbsp;<span style=\"color:#c0392b\"><em>Module 08: Trigonometric Ratios of Special Angles</em></span></strong></p>\r\n\r\n<p><strong>Period:&nbsp;<span style=\"color:#c0392b\"><em>Qtr 1_Week 9,</em></span></strong><span style=\"color:#c0392b\"><strong><em>&nbsp;October 17 - 21, 2022</em></strong></span></p>\r\n\r\n<p><strong>Instructions:&nbsp;</strong>Please take note of the activities to be accomplished within the given time:</p>\r\n\r\n<p>1.&nbsp; &nbsp; &nbsp;For Concept Exploration Activity</p>\r\n\r\n<ul>\r\n	<li>Watch the video: Trigonometric Ratios&nbsp;</li>\r\n</ul>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=Sdfbu0ZjQYE&amp;t=210s\">Trigonometric Ratios of Special Angles</a></p>\r\n\r\n<ul>\r\n	<li>Download the template from Supplementary Materials with file name&nbsp;<strong>Module 8_Additional Activities [Trigo, Q1_Wk 9]</strong>. Write your answers on a 1 whole sheet of paper or directly on the template (print).&nbsp;Submit the activity on or before October 20/Thursday.</li>\r\n</ul>\r\n\r\n<p>2.&nbsp; &nbsp; &nbsp;For Classroom Based Activities</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Bring the following materials:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Short Bond Paper</li>\r\n	<li>One (1) construction paper</li>\r\n	<li>Ruler</li>\r\n	<li>Scissors</li>\r\n	<li>Paste/Glue</li>\r\n	<li>Scientific Calculator</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you!</p>\r\n', '10', '2022', '14'),
(346, 'teacher121910152', '1219', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'KYRAH ANDREA  S . PEREZ', 'Animation Backup Drive', '', '<p>Hello Competency! For the backup files please click the link below or copy the url for the Google Drive link. Thanks.</p>\r\n\r\n<p><a href=\"https://drive.google.com/drive/folders/1REbozpevjUq4uMBdvzKK31FVco91VBbe?usp=sharing\">GRADE 11 BACKUP DRIVE</a></p>\r\n\r\n<p>https://drive.google.com/drive/folders/1REbozpevjUq4uMBdvzKK31FVco91VBbe?usp=sharing</p>\r\n', '10', '2022', '15'),
