(348, 'teacher8610166', '86', 'MARIKINA SCIENCE HIGH SCHOOL', ' RAFAELA ARLENE  V. . GUPIT', 'First Quarterly Assessment/First Periodic Test', '', '<p>Have a blessed Sunday. In preparation for the First Quarterly Assessment/First Periodic Test, kindly reanswer the given home-based activities: Asynchronous-Learner Generated Output from Week 2 if time permits. Write the letter of the correct answer on a whole clean sheet of intermediate pad paper. Every day is a chance to learn. Happy learning. Thank you, keep safe, stay healthy, and God bless us more,</p>\r\n\r\n<p>&nbsp;</p>\r\n', '10', '2022', '16'),
(349, 'teacher7410161', '74', 'MARIKINA SCIENCE HIGH SCHOOL', 'DAISY  B. . REVILLA', 'Module 5: Evidences of Plate Movements', '', '<p>Good day learners!</p>\r\n\r\n<p>The purpose of this module is to help you understand the evidence that<br />\r\nsupports plate movements. The module is divided into two lessons, namely:<br />\r\n&nbsp; &nbsp;<strong>Lesson 1</strong> &ndash; Evidence of Continental Drift<br />\r\n&nbsp; &nbsp;<strong>Lesson 2</strong> &ndash; Magnetic Stripping and Magnetic Reversal</p>\r\n\r\n<p><br />\r\nAfter going through this module, you are expected to enumerate the lines of<br />\r\nevidence that supports plate movement. <strong>S10ES &ndash; Ia-j-36.6</strong><br />\r\nSpecifically, you are expected to:<br />\r\n1. trace the existence of fossils of plants and animals as evidence found in the<br />\r\npresent continents that support the fitting of drifted continents;<br />\r\n2. cite other proofs of Continental Drift Theory, and<br />\r\n3. explain how magnetic stripping and magnetic reversal on the seafloor<br />\r\nprovides evidence for seafloor spreading.</p>\r\n\r\n<p>For your tasks today:&nbsp;</p>\r\n\r\n<p>1. Access the soft copy of the Module in the standard DLM of the eLP or using<br />\r\nthis link: <span style=\"color:#2980b9\">https://drive.google.com/file/d/1VUUg8ELWIGcdgj1qK2rT80QhDDnGxXKA/view?usp=sharin</span>g.&nbsp;</p>\r\n\r\n<p>2.&nbsp;Read and study &ldquo;What Is It&rdquo; on pages 7-8 and 13-14 of Module 5 for self-learning.</p>\r\n\r\n<p>3. Try to answer the Assessment on pages 9 and 15. Compare your answers to the answer key at the end of the module.</p>\r\n\r\n<p><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '10', '2022', '16'),
(350, 'teacher7410162', '74', 'MARIKINA SCIENCE HIGH SCHOOL', 'DAISY  B. . REVILLA', 'Module 5: Evidences of Plate Movements', '', '<p>Good day learners!</p>\r\n\r\n<p>The purpose of this module is to help you understand the evidence that<br />\r\nsupports plate movements. The module is divided into two lessons, namely:<br />\r\n&nbsp; &nbsp;<strong>Lesson 1</strong> &ndash; Evidence of Continental Drift<br />\r\n&nbsp; &nbsp;<strong>Lesson 2</strong> &ndash; Magnetic Stripping and Magnetic Reversal</p>\r\n\r\n<p><br />\r\nAfter going through this module, you are expected to enumerate the lines of<br />\r\nevidence that supports plate movement. <strong>S10ES &ndash; Ia-j-36.6</strong><br />\r\nSpecifically, you are expected to:<br />\r\n1. trace the existence of fossils of plants and animals as evidence found in the<br />\r\npresent continents that support the fitting of drifted continents;<br />\r\n2. cite other proofs of Continental Drift Theory, and<br />\r\n3. explain how magnetic stripping and magnetic reversal on the seafloor<br />\r\nprovides evidence for seafloor spreading.</p>\r\n\r\n<p>For your tasks today:&nbsp;</p>\r\n\r\n<p>1. Access the soft copy of the Module in the standard DLM of the eLP or using<br />\r\nthis link: <span style=\"color:#2980b9\">https://drive.google.com/file/d/1VUUg8ELWIGcdgj1qK2rT80QhDDnGxXKA/view?usp=sharin</span>g.&nbsp;</p>\r\n\r\n<p>2.&nbsp;Read and study &ldquo;What Is It&rdquo; on pages 7-8 and 13-14 of Module 5 for self-learning.</p>\r\n\r\n<p>3. Try to answer the Assessment on pages 9 and 15. Compare your answers to the answer key at the end of the module.</p>\r\n\r\n<p><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '10', '2022', '16'),
(351, 'teacher14610173', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Q1 Week 9 Announcement', '', '<h3><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Hi, Grade 10!<br />\r\n<br />\r\nWe are already on the Week 9 of Quarter 1. Please be guided with the following topics as they are part of our Summative Test this coming October 25, 2022.&nbsp;</span></span></h3>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Rectangular Coordinate System</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Distance and Directed Distance</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Slope and Angle of Inclination</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Midpoint and Division of Line Segments</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Equation of Lines and Family of Lines</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Area of Triangle using Matrices and Determinants</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Also, for all the students who failed to reach the passing score of 6 points in the Summative Assessment 1.5, you are required to do the AnGeom Activity 1.8. This activity shall be submitted in a clean sheet of paper and will be handed in during our AnGeom time. Thank you and have a good day!<br />\r\n<br />\r\n(?&#39;?&#39;?)</span></span></p>\r\n', '10', '2022', '17'),
(352, 'teacher14610174', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Q1 Week 9 Announcement', '', '<h3><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Hi, Grade 10!<br />\r\n<br />\r\nWe are already on the Week 9 of Quarter 1. Please be guided with the following topics as they are part of our Summative Test this coming October 25, 2022.&nbsp;</span></span></h3>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Rectangular Coordinate System</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Distance and Directed Distance</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Slope and Angle of Inclination</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Midpoint and Division of Line Segments</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Equation of Lines and Family of Lines</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Area of Triangle using Matrices and Determinants</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-size:12px\"><span style=\"font-family:Georgia,serif\">Also, for all the students who failed to reach the passing score of 6 points in the Summative Assessment 1.5, you are required to do the AnGeom Activity 1.8. This activity shall be submitted in a clean sheet of paper and will be handed in during our AnGeom time. Thank you and have a good day!<br />\r\n<br />\r\n(?&#39;?&#39;?)</span></span></p>\r\n', '10', '2022', '17'),
(353, 'teacher70010172', '700', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'FREDERICK  O . DACUT', 'Physical fitness test - module 1', 'image/PERFORMANCE TASK IN PE.docx', '<p>Good day kiddos!&nbsp;<br />\r\nRe: Physical fitness test<br />\r\nKindly finish the remaining fitness test in your home, please make sure to begin with a warm-up exercise before taking the fitness test. Thank you.&nbsp;</p>\r\n\r\n<p>PS: Attached herewih is the answer sheet in PE, kindly write your output and print it then submit in our face to face class. To those online learners kindly submit your output in the ENOTE</p>\r\n', '10', '2022', '17'),
(354, 'teacher7210173', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Q1_W9_Laguhang Pagtataya ng Araling Pangwika', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Magandang araw sa inyo Grade 10,</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Sa ikasiyam linggo ng unang kapat nais kong ipaalala ang mga sumusunod:</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">I. BAGO ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</span></span></strong><br />\r\n<span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">A. Basahin at aralin ang mga sumusunod na gawain sa module (Self-learning):</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Aralin 1: Gamit ng Pandiwa Bilang Aksiyon, Karanasan o Pangyayari</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Aralin 2: Pang-ugnay sa Pagpapasimula, Pagpapadaloy at Pagwawakas</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Aralin 3: Pahayag sa Pagbibigay ng Neutral at Matatag na Pananaw</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Aralin 4: Pahayag sa Pagsusunod-sunod ng Pangyayari</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Aralin 5: Pananda sa Mabisang Paglalahad</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Aralin 6: Panghalip Bilang Panuring</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">&nbsp;B. Paghandaan ang mga sumusunod na paksa na magsisilbing paksa ng debate o pagtatalo. Sa mga nais ng paglilinaw mangyaring magpatulong sa guro. Isumite ang inyong alintana o katanungan sa DISCUSSION TAB. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Ang kalayaan ba sa pamamahayag ay pangangailan sa lipunan?</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Sang-ayon ka ba na nagiging katarungan ang sensura sa pagkontrol ng media?</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Makatarungan bang magkaroon ng legal na basehan ang moral na pamantayan?</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">II. MATAPOS ANG HARAPANG PAGKAKLASE (ASYNCHRONOUS)</span></span></span></span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">Balikan ang mga video lesson ng bawat araling ating napag-aralan. Muling aralin ang pagtalakay sa araling pampanitikang nailahad nitong unang kapat. </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Q1_W2_Video Lesson_Mitolohiya mula sa Roma Italya at Gamit ng Pandiwa:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://drive.google.com/file/d/1djc-qeyxqW00kTtONbaow-iMBSOVPrj8/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/1djc-qeyxqW00kTtONbaow-iMBSOVPrj8/view?usp=sharing</a> &nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Q1_W3_Video Lesson_Parabula mula sa Syria at Pang-ugnay sa Pagpapasimula, Pagpapadaloy at Pagwawakas:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://drive.google.com/file/d/18pXUJUSKyhi5MqY6Uero0G2WeR9cO5AA/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/18pXUJUSKyhi5MqY6Uero0G2WeR9cO5AA/view?usp=sharing</a> &nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Q1_W4_Video Lesson_Maikling Kuwento mula sa Pransiya at Pahayag sa Pagbibigay ng Pananaw:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">&nbsp;<a href=\"https://drive.google.com/file/d/17INbqZYoB7DoRsKoPH3FQ392DTYACzBF/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/17INbqZYoB7DoRsKoPH3FQ392DTYACzBF/view?usp=sharing</a> &nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Q1_W5_Video Lesson_Sanaysay mula sa Gresya at Pahayag sa Pagsusunod-sunod ng Pangyayari:</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\"><a href=\"https://drive.google.com/file/d/1rn_2YauHCOV15ZXT4faPntUzB9h3t4B2/view?usp=sharing\" style=\"color:blue; text-decoration:underline\">https://drive.google.com/file/d/1rn_2YauHCOV15ZXT4faPntUzB9h3t4B2/view?usp=sharing</a> &nbsp;</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Tahoma&quot;,sans-serif\">-Q1_W6_Video Lesson_Epiko mula sa Mesopotamia at Pananda sa Mabisang Paglalahad