(356, 'teacher12810186', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 08: Trigonometric Ratios of Special Angles', '', '<p>Good day&nbsp;<strong>Grade 9 Learners</strong>!</p>\r\n\r\n<p><strong>Topic:&nbsp;<em>Module 8: Trigonometric Ratios of Special Angles</em></strong></p>\r\n\r\n<p><strong>Period:&nbsp;<em>Qtr 1_Wk 9, October 17 - 21, 2022</em></strong></p>\r\n\r\n<p><strong>Instructions:&nbsp;</strong>Please take note of the activity to be accomplished:</p>\r\n\r\n<p>1. For&nbsp;<strong>Written Work #8</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp;</strong>Answer and submit&nbsp;<strong>WW8_Module 87: Trigonometric Ratios of Special Angles [Qtr 1_Wk 9: October 17-21, 2022]&nbsp;</strong>via google form <a href=\"https://forms.gle/qpAJy4wdXmBqMZyX6\">https://forms.gle/qpAJy4wdXmBqMZyX6</a>.&nbsp;</p>\r\n', '10', '2022', '18'),
(357, '657510181', '6575', 'SCHOOL DIVISION OFFICE-MARIKINA', 'MENERE  R. NASIAD ', '', '', '<h2 style=\"font-style:italic\">Good afternoon po, we are now seeing your feedback and concerns regarding the platform. Please continue soliciting their feedback so that we can include other suggestions for the updated version for next school year.</h2>\r\n\r\n<h2 style=\"font-style:italic\">Enter</h2>\r\n\r\n<h2 dir=\"auto\" style=\"font-style:italic\">You sent</h2>\r\n\r\n<h2 style=\"font-style:italic\">Good day.&nbsp; We hope we have helped you the best way we could for a more meaningful and enjoying online learning. Please click the link below should you have feedback, comments, concerns and suggestions.&nbsp; We anticipate your active participation.&nbsp; <a href=\"https://docs.google.com/spreadsheets/d/1blCEa1k9XDLEVPBztFJrX9F8Mgwmnh6dfDckylzgEfw/edit?fbclid=IwAR14zUuGC-sXzWK-Yiw0m9DX-v7MBVDDc-xZqKEeN7Gj0vhJTcJyctUUy6g#gid=0\" rel=\"nofollow noopener\" tabindex=\"-1\" target=\"_blank\">https://docs.google.com/spreadsheets/d/1blCEa1k9XDLEVPBztFJrX9F8Mgwmnh6dfDckylzgEfw/edit?fbclid=IwAR0W4tW6ew0LAaloP1qEzfy0n_sHxgC0gGseQ0tzJNiKnAYX3jyPT6SMiqI#gid=0</a></h2>\r\n\r\n<h2 style=\"font-style:italic\"><a href=\"https://docs.google.com/spreadsheets/d/1blCEa1k9XDLEVPBztFJrX9F8Mgwmnh6dfDckylzgEfw/edit?fbclid=IwAR0QbOy2sDQMoTdtoqVhPzVhuLVLcGw-jjmfgFxSpjbZXzJ7ZFKSPb0C1Q0#gid=0\" rel=\"nofollow noopener\" tabindex=\"-1\" target=\"_blank\">Google Forms: Sign-in</a></h2>\r\n', '10', '2022', '18'),
(358, 'teacher337910181', '3379', 'PARANG HIGH SCHOOL', 'MARU  U . PANGANIBAN', 'Panimulang Pagbati', '', '<p>Magandang buhay baitang 8!</p>\r\n\r\n<p>Pagbati sa ating lahat! Ako ay lubos na nagagalak sapagkat muli na nating magagamit ang ating eLearning App para sa ating online na pag-aaral.&nbsp;</p>\r\n\r\n<p>Ugaliin nating bisitahin ang ating eLearning app para sa mga update at aralin sa bawat linggo.</p>\r\n\r\n<p>Maaari kayong mag-pm kung sakaling kayo man ay may katanungan.</p>\r\n\r\n<p>Muli, mainit na pagbati sa inyong lahat!</p>\r\n\r\n<p>Nagmamahal,</p>\r\n\r\n<p>Sir Mup</p>\r\n', '10', '2022', '18'),
