(362, 'teacher9510211', '95', 'MARIKINA SCIENCE HIGH SCHOOL', 'MERCED  A. . ANSAY', '', '', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Hello there!</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The attached activity, &ldquo;Q1-HOME-BASED-ACTIVITIES (A-LEARNER GENERATED OUTPUT)&rdquo; in the eNote/DLM-Supplementary are for those learners who have missed to submit/turn in their output/s on time regardless of any reason/s. Choose the activity that you are gonna accomplish to make up for your missing output/s. The number of activities that each learner will accomplish must be based on the number of his/her missing output/s. Indicate the Quarter, Module Number, and Activity Title in your output. Be mindful to follow the proper heading.&nbsp;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Refer to the following references to figure out your missing output/s:</span></span></span></p>\r\n\r\n<ol>\r\n	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Copy of WLP for week 2 to week 4 (LEARNER GENERATED OUTPUT)</span></span></span></li>\r\n	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">File of your Returned output/s</span></span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Accomplish and submit the output/s on or before November 3, 2022 via ELP. </span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">MAAnsay</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '10', '2022', '21'),
(363, 'teacher14610215', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'IPT 1 Digital Brochure', '', '<p><span style=\"font-size:16px\"><span style=\"font-family:Georgia,serif\">Hi, Grade 10! Please be reminded that the dealine of submission of&nbsp;IPT 1 Digital Brochure is today, October 21, 2022 at 5:00 PM. Thank you!</span></span></p>\r\n', '10', '2022', '21'),
(364, 'teacher9210236', '92', 'MARIKINA SCIENCE HIGH SCHOOL', 'EMELIND  S. . MOLINA', '1st Periodical Test', '', '<p>Good morning everyone!</p>\r\n\r\n<p>Reminders po ,magbalik aral para sa modules 1-6 at maghanda para sa 1st Periodical Test.</p>\r\n\r\n<p>thank you</p>\r\n\r\n<p>esm</p>\r\n', '10', '2022', '23'),
(365, 'teacher9510242', '95', 'MARIKINA SCIENCE HIGH SCHOOL', 'MERCED  A. . ANSAY', '', '', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Hi there! Click the link below to submit your output/s in the &ldquo;Q1-HOME-BASED-ACTIVITIES (A-LEARNER GENERATED OUTPUT).&rdquo; </span></span></span></p>\r\n\r\n<p><a href=\"https://drive.google.com/drive/folders/1-ueidyRTkkBy2Vn-BJhKLfa-VS0yKHhA?usp=sharing\" style=\"text-decoration:none\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#1155cc\"><u>https://drive.google.com/drive/folders/1-ueidyRTkkBy2Vn-BJhKLfa-VS0yKHhA?usp=sharing</u></span></span></span></a></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">We&rsquo;re gonna use this link while waiting for the eNote tab to fix.&nbsp;</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">MAAnsay</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '10', '2022', '24'),
(366, 'teacher14610246', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Q1 Week 10 Announcement', '', '<h2><span style=\"font-family:Georgia,serif\"><span style=\"font-size:16px\">Hi there Grade 10!&nbsp;<br />\r\n<br />\r\nI hope you&#39;re all well. Please review our previous lesson and make sure that you have prepared your scientific calculator for tomorrow&#39;s Quarterly Examination. You may use the modules, PPTs, assessments and other activities to help you recall our lessons.&nbsp;<br />\r\n<br />\r\nSubmission of the AnGeom Notebook with the Reflection will be tomorrow as well after the exam.&nbsp;<br />\r\n<br />\r\nFinally, make sure you are well rested so can concentrate more on our exam. Kayang kaya nyo yung exam! AJA! Fighting!<br />\r\n<br />\r\n(?&#39;?&#39;?)</span></span></h2>\r\n', '10', '2022', '24'),
(367, 'teacher135910313', '1359', 'SSS NATIONAL HIGH SCHOOL', 'EDNALYN  M . SALAMAT', 'Submission of Performance Task Outputs', '', '<p>Good day!</p>\r\n\r\n<p>Kindly upload your check and graded Performance Task for the 1st Quarter until NOVEMBER 4, 2022 @ 6:00PM ONLY. Thankyou.</p>\r\n', '10', '2022', '31'),
