(376, 'teacher12811221', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Module 11: Laws of Sines and Cosines', '', '<p>Good day&nbsp;<strong>Grade 9 Learners</strong>!</p>\r\n\r\n<p><strong>Topic:&nbsp;<em>Module 11: Laws of Sines and Cosines</em></strong></p>\r\n\r\n<p><strong>Period:&nbsp;<em>Qtr 2_Wk 3, November 21 - 25, 2022</em></strong></p>\r\n\r\n<p><strong>Instructions:&nbsp;</strong>Please take note of the activity to be accomplished:</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp;</strong>Answer and submit&nbsp;<strong>Module 11_Laws of Sines and Cosines [Trigo, Qtr 2_Wk 3]</strong>. Write your answers on a one (1) whole sheet of paper.&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;To be submitted within the week.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you</p>\r\n', '11', '2022', '22'),
(378, 'teacher70911222', '709', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARTHA MAE  D . RONDOLO', 'MODULE 5: KALAGAYAN AT GAMPANIN NG MGA KABABAIHAN SA ASYA', '', '<p>Magandang Araw<span style=\"color:#2980b9\">&nbsp;Grade 7 eLearners!</span><img alt=\"smiley\" src=\"https://www.elearningmarikina.ph/ckeditor/plugins/smiley/images/regular_smile.png\" title=\"smiley\" /></p>\r\n\r\n<p>Para sa linggong ito, ang mga sumusunod ang mga kailangan ninyong isagawa para sa modyul na ito:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Subukan sagutin ang mga sumusunod na gawain:&nbsp;\r\n	<ul>\r\n		<li>Balikan ( Pahina 3)</li>\r\n		<li>Tuklasin (Pahina 4)</li>\r\n	</ul>\r\n	</li>\r\n	<li>Basahin at intindihin ang SURIIN&nbsp; &nbsp; &nbsp; &nbsp;(Pahina 5-7)</li>\r\n	<li>Gawin ang&nbsp;<span style=\"color:#e74c3c\">KARAGDAGANG GAWIN (PERFORMANCE TASK #4)&nbsp;</span></li>\r\n	<li>Maghanda para sa Assessment #5</li>\r\n</ul>\r\n\r\n<p>Maraming Salamat!&nbsp;<img alt=\"wink\" src=\"https://www.elearningmarikina.ph/ckeditor/plugins/smiley/images/wink_smile.png\" title=\"wink\" /></p>\r\n', '11', '2022', '22'),
(381, 'teacher70011241', '700', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'FREDERICK  O . DACUT', '', '', '<p>Good morning kiddos...<br />\r\nHealth topics:<br />\r\nmodule 1 : drug scenario in the Philippines<br />\r\nmodule 2: prevention of drug use and abuse<br />\r\n<br />\r\nPE topics:<br />\r\nmodule 1: Social dances / ballroom dances<br />\r\nperformance tasks: waltz and cha cha cha dances</p>\r\n', '11', '2022', '24'),
(384, 'teacher70911292', '709', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARTHA MAE  D . RONDOLO', 'MGA KONTRIBUSYONG NG MGA SINAUNANG LIPUNAN AT KOMUNIDAD SA ASYA', '', '<p><span style=\"font-family:Comic Sans MS,cursive\">Magandang Araw Grade 7- eLearners!</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">Basahin at intindihin ang modyul 6: Mga Kontribusyon ng mga Sinaunang Lipunan at Komunidad sa Asya.</span></p>\r\n\r\n<p><span style=\"font-family:Comic Sans MS,cursive\">Maraming Salamat!?</span></p>\r\n', '11', '2022', '29'),
(385, 'teacher10612011', '106', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'BRYAN  D . AURELIO', 'LINGGO 4-ANUNSYO', '', '<p><span style=\"font-size:14px\"><span style=\"font-family:Comic Sans MS,cursive\">Magandang araw eLearners!</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Comic Sans MS,cursive\">Sa linggong ito ay muli tayong tutuklas ng mga panibagong kaalaman. Upang magabayan ka sa pag-aaral ng Modyul 1, mangyaring sundin mo lamang ang mga sumusunod na gawain sa ibaba:</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Comic Sans MS,cursive\">1. Magtungo sa bahaging DLM at buksan ang link ng modyul 1 na makikta rito. Basahin at unawain ang bahaging SURIIN.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Comic Sans MS,cursive\">2. Sagutin mo rin ang maikling pagsusulit sa ASSESSMENT TAB. (Maikling Pagsusulit 1 at 2)</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Comic Sans MS,cursive\">3. Magtungo ka rin sa bahaging DISCUSSION TAB at sagutin mo ang maikling tanong kaugnay sa araling iyong binasa.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Comic Sans MS,cursive\">Kung ikaw ay may katanungan, malaya kang makapagtatanong sa bahaging DISCUSSION TAB.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Comic Sans MS,cursive\">Maligayang pag-aaral!&nbsp;</span></span></p>\r\n', '12', '2022', '01'),
