(397, 'teacher12912161', '129', 'MARIKINA SCIENCE HIGH SCHOOL', 'ALFRED BENEDICT   G. . RECLOSADO', 'Exercise 06', '', '<p>Use the clone stamp tool for this activty. Use the e-note and Google drive for your output. Name your file as C# - Surname_Initials_Exer06. Export or</p>\r\n\r\n<p>save your file in .psd format.</p>\r\n\r\n<p>Activity Link :&nbsp; https://tinyurl.com/mwmrbx3n</p>\r\n\r\n<p>* Please use Photopea (https://www.photopea.com/) if you do not have Adobe Photoshop installed.</p>\r\n', '12', '2022', '16'),
(398, 'teacher14612161', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Q2 Week 6 Announcement', '', '<p><span style=\"font-size:14px\"><span style=\"font-family:Georgia,serif\">Good day, learners! I hope everyone is doing well. Before the year ends, kindly make sure that all tasks are done and do not forget to keep your Cheat Sheet. Lastly, all on January 4, 2023, we will continue our remaining modules. Please refer to the following schedule:</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Georgia,serif\"><strong>Week 7 </strong>(January 4 - 7) - <em>Module 4 Ellipse</em><br />\r\n<strong>Week 8</strong> (January 10 - 14) - <em>Module 4 Ellipse &amp; Module 5 Hyperbola</em><br />\r\n<strong>Week 9</strong> (January 17 - 21) - <em>Module 5 Hyperbola</em><br />\r\n<br />\r\nI hope you get ready as we welcome the New Year! Merry Christmas and Happy Holidays.&nbsp;<br />\r\n<br />\r\n(?&#39;?&#39;?)<br />\r\n~Ms. Rina</span></span></p>\r\n', '12', '2022', '16');
