(399, 'teacher8812161', '88', 'MARIKINA SCIENCE HIGH SCHOOL', 'JASMINE  P. . LORENZO', 'JUST A FEW REMINDERS :-)', '', '<p>Hi!</p>\r\n\r\n<p>Before we officially take our Christmas vacation, just take note of the following:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Find time to work on your backlogs (if there&#39;s still any).</p>\r\n\r\n<p>2. Prepare for the last weeks remaining before the upcoming exams.&nbsp;</p>\r\n\r\n<p>3. Make sure you&#39;re ready when we get back.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I hope you&#39;ll enjoy your much deserved Christmas break. I wish you&#39;ll be able to spend it with people that matters the most to you. Let&#39;s make it worthwhile.</p>\r\n\r\n<p>The best of holidays, everyone! See you on January 4. :-)</p>\r\n', '12', '2022', '16'),
(400, 'teacher12312161', '123', 'MARIKINA SCIENCE HIGH SCHOOL', 'MA.LORENA   S. . ALEJANDRIA', 'Reminders!!!', '', '<p>Good day, everyone!&nbsp;</p>\r\n\r\n<p>While having salad and mango graham, take time to read Module 6 - Space Rocks. Kindly ask your parents also for some superstitious beliefs about meteors.&nbsp;</p>\r\n\r\n<p>Enjoy the Christmas break. Be safe. And always remember the reason for the season.&nbsp;</p>\r\n\r\n<p>Merry Christmas, mga anak!&nbsp;</p>\r\n', '12', '2022', '16'),
(401, 'teacher8712161', '87', 'MARIKINA SCIENCE HIGH SCHOOL', 'MARY CRIS  M. . MIRABEL', 'Filipino 7', '', '<p>Magandang Araw sa inyong lahat!</p>\r\n\r\n<p>Pangungunang pagbati ng maligayang pasko sa inyong lahat. Ganun pa man ngayong darating na bakasyon ay wag kalimutan ang ating mga natalakay na aralin. Maaring magbalik aral sa mga modyul 1-5 na ating natalakay na makikita sa supplementary materials. Salamat!</p>\r\n\r\n<p>Ms. Mirabel</p>\r\n', '12', '2022', '16'),
(402, 'teacher12412161', '124', 'MARIKINA SCIENCE HIGH SCHOOL', 'JENNY  C. . DELA VEGA', 'ANNOUNCEMENT', '', '<p>Good day class!</p>\r\n\r\n<p>Make sure that you have accomplished all the second quarter deliverables:</p>\r\n\r\n<p>WRITTEN WORKS</p>\r\n\r\n<p>1. Postest 1 Module 1</p>\r\n\r\n<p>2. Quiz # 1</p>\r\n\r\n<p>3. Quiz # 2</p>\r\n\r\n<p>4. Quiz # 3</p>\r\n\r\n<p>5. Quiz # 4</p>\r\n\r\n<p>PERFORMANCE TASKS</p>\r\n\r\n<p>1. LGO 1 - Microscope Infographic&nbsp;</p>\r\n\r\n<p>2. LGO 2 - Poster&nbsp;</p>\r\n\r\n<p>3. LGO 3 - Poem</p>\r\n\r\n<p>4. PT 1 (Group Activity) - History of the microscope</p>\r\n\r\n<p>5. PT2 (Group Activity) - Focusing under the microscope</p>\r\n\r\n<p>6. PT3 (Group Activity) - Fashion Show (cell organelles)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Review for the upcoming second quarter examination..</p>\r\n\r\n<p>Merry Christmas and Happy New Year!</p>\r\n', '12', '2022', '16'),
(403, 'teacher9712161', '97', 'MARIKINA SCIENCE HIGH SCHOOL', 'LANA  M. . MATUSALEM', 'Magandang Hapon Klase!', '', '', '12', '2022', '16'),
(404, 'teacher9012161', '90', 'MARIKINA SCIENCE HIGH SCHOOL', 'SHANDIELYN   S. . ABDON', 'ANNOUNCEMENT!', '', '<p>Hello everyone,<br />\r\n<br />\r\nPlease be reminded of the following:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Find time to work on your backlogs.</li>\r\n	<li>Prepare for the remaining weeks before the exam.</li>\r\n	<li>Make sure you&#39;re ready when we get back.<br />\r\n	<br />\r\n	Stay safe and Happy Holidays!<br />\r\n	&nbsp;</li>\r\n</ul>\r\n', '12', '2022', '16'),
(405, 'teacher9712162', '97', 'MARIKINA SCIENCE HIGH SCHOOL', 'LANA  M. . MATUSALEM', 'FILIPINO 8_IKAANIM NA LINGGO', '', '<p>Magandang Hapon Klase!<br />\r\n<br />\r\nKumusta? Nawa&#39;y kayo ay nasa mabuting kalagayan.<br />\r\n<br />\r\nBago natin tuluyang damhin ang ating maikling bakasyon ay nais kong mgabigay ng paalala hinggil sa ating mga nakalipas na gawain. Siguraduhin na nakapasa/nakasagot na ng mga ss:<br />\r\n<br />\r\n~Maikling Pagsusulit Bilang 1-3.<br />\r\n~Gawaing Pagganap Bilang 1 at 2.<br />\r\n<br />\r\nMaligayang Pasko at Manigong Bagong Taon</p>\r\n', '12', '2022', '16'),
(409, 'teacher13112161', '131', 'MARIKINA SCIENCE HIGH SCHOOL', 'MARY GLENN   D. . NAS', 'EDUKASYON SAPAGPAPAKATAO 7', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mapagpalang araw Grade 7</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Paalala :</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1. Isulat ang mga aral na natutunan at tiyak na paraan ng pagsasabuhay sa bawat modyul. sa Dyornal.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2. Isulat ang mga naging karanasan na nangyari sa panahon ng christmas vacation at tukuyin kung ito ay may konsensiya at likas na batas moral.</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3. Huwag kalimutang mag-enjoy at magpasalamat sa tunay na kahulugan ng Pasko sa ating buhay sa ating pamilya at kapwa.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">4. Maligayang Pasko at masaganang bagong taon.&nbsp;</span></span></p>\r\n', '12', '2022', '16'),
(410, 'teacher13112162', '131', 'MARIKINA SCIENCE HIGH SCHOOL', 'MARY GLENN   D. . NAS', 'Edukasyon sa Pagpapakatao 8', '', '<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mapagpalang araw Grade 8</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Paalala :</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">1. Isulat ang mga aral na natutunan at tiyak na paraan ng pagsasabuhay sa bawat modyul. sa Dyornal.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">2. Isulat ang mga naging karanasan na nangyari sa panahon ng christmas vacation at tukuyin kung ito ay may pakikipagkaibigan.</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3. Huwag kalimutang mag-enjoy at magpasalamat sa tunay na kahulugan ng Pasko sa ating buhay sa ating pamilya at kapwa.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">4. Maligayang Pasko at masaganang bagong taon.&nbsp;</span></span></p>\r\n', '12', '2022', '16'),
(411, 'teacher13912161', '139', 'MARIKINA SCIENCE HIGH SCHOOL', 'REBEKAH   L. . PRESORES', 'Research Logbook', '', '<p>Good afternoon, Moderation! Finish your research logbooks consisting of experiments 1-3. Submission is on our first meeting in January. Thank you!</p>\r\n', '12', '2022', '16'),
(412, 'teacher7012171', '70', 'MARIKINA SCIENCE HIGH SCHOOL', 'MA. VICTORIA  G. . AMBAS', 'Reminders', '', '<p>Good evening Grade 10!</p>\r\n\r\n<p>Above all, allow me to greet everyone a very Merry Christmas a and a Wonderful New year! This post is just a reminder&nbsp;that come January, we will have our Post Test for Module 4- Claims of Fact, Policy and Value and discussion of Module 5- Writing an Expository Essay. This is all. So again, happy holidays to everyone. See you all on January 4, 2023.&nbsp;<img alt=\"smiley\" src=\"https://elearningmarikina.ph/ckeditor/plugins/smiley/images/regular_smile.png\" style=\"height:23px; width:23px\" title=\"smiley\" /></p>\r\n', '12', '2022', '17'),
(413, 'teacher7212191', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Tagubilin para sa Gawaing Pagganap', '', '<p>Magandang araw sa inyo Grade 10,<br />\r\n<br />\r\nSa pagsulat ng inyong talumpati na siyang itatanghal sa klase mangyari sundin ang gatnubay na nasa presentasyon ng gawain. Mariin ang paalala na sundin ang format ng posisyon, diskusyon at konklusyon.<br />\r\n<br />\r\nAng kopya nito ay marapat na sumunod sa&nbsp; print format na Tahoma, 11, 1.5 line spacing, 1 inch margin all side sa 8.5x11 na papel.<br />\r\n<br />\r\nPara sa mga hindi pa nakapagsusumite ng tula at dagli, mangyaring gamitin ang panahong ito para makapagcomply na hindi nagagawang gawain.&nbsp;Maraming salamat!</p>\r\n', '12', '2022', '19'),
(415, 'teacher1512202', '15', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROBIN  R. . LEYCO', 'year of the rabbit', '', '<p><strong>2023 is a year of the&nbsp;Water&nbsp;Rabbit</strong>, starting from January 22nd, 2023&nbsp;(Chinese New Year), and ending on&nbsp;February 9th, 2024&nbsp;(Chinese New Year&#39;s Eve).&nbsp;The sign of Rabbit is a symbol of longevity, peace, and prosperity&nbsp;in Chinese culture.&nbsp;<strong>2023 is predicted to&nbsp;be a year of hope</strong>.</p>\r\n', '12', '2022', '20'),
(416, 'teacher1512203', '15', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'ROBIN  R. . LEYCO', '', '', '<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" width=\"303\" height=\"189\">This year marks 2023 on the Western calendar, or on the Chinese calendar the Year of the Rabbit, beginning on Sunday, January 22, 2023.</p>\r\n<p><a href=\"https://www.chiff.com/home_life/holiday/chinese-new-year-rabbit.htm\">The Rabbit</a>&nbsp;represents the 4th year in the 12 year cycle of the&nbsp;<a href=\"https://www.chiff.com/home_life/holiday/chinese-zodiac.htm\">Chinese zodiac</a>.</p>\r\n<p>Like the houses of the zodiac in Western astrology, the animals of Chinese astrology are thought by many to dictate personality traits or, in the wider scope of things, even impact world events in any year they rule.</p>\r\n<p>Those born under the sign of the rabbit, and those with compatible signs, can benefit from luck or good fortune during an Rabbit year. Those include 1927, 1939, 1951, 1963, 1975, 1987, 1999, 2011, and 2023.</p>', '12', '2022', '20'),
