(421, 'teacher9201061', '92', 'MARIKINA SCIENCE HIGH SCHOOL', 'EMELIND  S. . MOLINA', 'AP 9: EKONOMIKS', '', '<p>Good Day!</p>\r\n\r\n<p>Magsisimula tayo sa ating Arain 1 Module 1:Paikot na Daloy ng Ekonomiya.</p>\r\n\r\n<p>Dalhin ang mga sumusunod na gamit sa araw ng Face to Face:</p>\r\n\r\n<p>- Pandikit (glue)</p>\r\n\r\n<p>-coloring materials</p>\r\n\r\n<p>-larawan sa magazin para makabuo ng Paikot na daloy ng ekonomiya</p>\r\n', '01', '2023', '06'),
(422, 'teacher14601071', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Announcement for Grade 10 - Kindness', '', '<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px\">Hi, <em><strong>10 - Kindness</strong></em>!<br />\r\n<br />\r\nI hope everything is fine! Since the classes are suspended. Kindly make sure that you read and be ready for the tasks next week regarding Module 4 Ellipse. There will be no performance task, however, we will still answer Summative Assessment 2.5.&nbsp; Thank you and looking forward to meet you again next week!</span></p>\r\n', '01', '2023', '07'),
(423, 'teacher736201081', '7362', 'MARIKINA SCIENCE HIGH SCHOOL', 'CARLO  R . DELACRUZ', 'Reminder for our online meeting', '', '<p>This is a reminder for our online class that will be starting this week. The class will take place via Google Meet and the link to join is:</p>\r\n\r\n<p><a href=\"https://meet.google.com/akm-xqmg-mdk\" target=\"_new\">https://meet.google.com/akm-xqmg-mdk</a></p>\r\n\r\n<p>In order to make sure that the class runs smoothly and is beneficial for everyone, please make sure to follow these rules:</p>\r\n\r\n<ol>\r\n	<li>Please join the class on time.</li>\r\n	<li>Keep your camera on at all times during class.</li>\r\n	<li>Mute your microphone when you are not speaking.</li>\r\n</ol>\r\n\r\n<p>I look forward to seeing you all online and having a productive and engaging class. See you everyone.&nbsp;</p>\r\n', '01', '2023', '08'),
(425, 'teacher70901082', '709', 'JESUS DELA PEÑA NATIONAL HIGH SCHOOL', 'MARTHA MAE  D . RONDOLO', 'Module 5 Kalagayan at Gampanin ng mga Kababaihan sa Asya', '', '<p>Magandang Araw&nbsp;Grade 7- eLearners!</p>\r\n\r\n<p>Para sa linggong ito, sagutan ang mga gawain na makikita sa ating Discussion tab.&nbsp;</p>\r\n\r\n<p>Salamat!?</p>\r\n', '01', '2023', '08'),
(426, 'teacher9501081', '95', 'MARIKINA SCIENCE HIGH SCHOOL', 'MERCED  A. . ANSAY', '', '', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Attention: This is to inform you that we&rsquo;re not yet having an assessment on Module 3. With this, get ready for the Q2-Module3-Assessment on Wednesday, January 11, 2023 during face to face session.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">MAAnsay</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '01', '2023', '08'),
