(428, 'teacher14601082', '146', 'MARIKINA SCIENCE HIGH SCHOOL', 'RINALYN  M. . SALAMAT', 'Q2 Week 8 Announcement', '', '<p><span style=\"font-size:16px\"><span style=\"font-family:Georgia,serif\">Good day, <em><strong>Grade 10 learners</strong></em>!<br />\r\n<br />\r\nI hope this finds you well. We are in the first week of the blended learhaning and with that please be reminded that the GMeet link for our class is <em><strong><a href=\"http://bit.ly/ANGEOM\">bit.ly/ANGEOM</a></strong></em>.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:Georgia,serif\">Please be guided as well that you should heve read our Modules 4 and 5 before attending our class. Thank you and have a good day!</span></span></p>\r\n', '01', '2023', '08'),
