(436, 'teacher12801095', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'The Function Hexagon', 'image/the function hexagon.png', '<p>Good day&nbsp;<strong>Grade 9 Sincerity</strong>!</p>\r\n\r\n<p><strong>Topic:&nbsp;<em>The Function Hexagon</em></strong></p>\r\n\r\n<p><strong>Period:&nbsp;<em>Quarter 2</em></strong></p>\r\n\r\n<p><strong>Instructions:&nbsp;</strong></p>\r\n\r\n<p>1. Download&nbsp;Module 12_The Function Hexagon with Rubrics [Trigo, Qtr 2] from Supplementary Materials under DLM tab.</p>\r\n\r\n<p>2. Study the speil provided and take note of the standard rubrics on how you will be graded.&nbsp;</p>\r\n\r\n<p>3. Provide a video presentation of your performance task and submit your output in the google drive link provided:&nbsp;https://drive.google.com/drive/folders/1ln9AVmgOly1QR3UGjNGLltZS93Jr_90P?usp=share_link</p>\r\n\r\n<p>4. Submission: on/before January 20, 2023/Friday</p>\r\n\r\n<p>Thank you</p>\r\n', '01', '2023', '09'),
