(440, 'teacher7201101', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Q2_W8_Gawaing Pagganap at Laguhang Pagtataya', '', '<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Magandang araw sa inyo Grade 10,&nbsp;<br />\r\n<br />\r\nNarito ang aking tagubilin ukol sa ating pagtitipon.<br />\r\n<br />\r\n1.&nbsp;Sa klase synchronous, nakabukas ang link na: <a href=\"https://meet.google.com/wjp-tcsg-wmf?fbclid=IwAR3L1jLC7gwVbwJrhOWGma4IvBvxRxLTBel7UIxrWMinJOA25FwUEYGJvkM\" rel=\"nofollow\" tabindex=\"-1\" target=\"_blank\">https://meet.google.com/wjp-tcsg-wmf</a> kung mayroon katanungan o paglilinaw sa gawain. Iwasang maging paulit-ulit ang tanong kung nakalagay naman ito sa gatnubay ng gawaing pagganap. Kung walang katanungan, ilaan ang oras na matapos ang talumpati.<br />\r\n<br />\r\n2.&nbsp;Sa klaseng asynchronous, ipinaaalala na: </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">A. I-print ang nasabing talumpati sa 8.5x11 na size ng papel sa pormat na tinakda. Ibigay ito sa harapang pagtitipon bago manalumpati sa harapan. B. Sikaping mag-ensayo sa harap ng salamin upang masanay sa eye contact at makita ang pagkilos at kumpas ng kamay habang nagsasalita. C. Idiin ang mga salitang naging bigyang tuon para hindi maging monotone. Tandaan na mahalaga ang baryasyon ng tinig.<br />\r\n<br />\r\nNais kong ibahagi sa inyo ang isang pagsasanay bago kumuha ng laguhang pagsusulit sa Miyerkules. Mangyaring sagutan ito sa inyong kuwaderno. Gamitin ang link na: <a href=\"https://docs.google.com/document/d/1f4-o0hqXCFynsp3449Bsscne3KqqSJZk/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true&amp;fbclid=IwAR37gAqVDRAIqglDlTyHi--16QvRqRpsWnGakqGSvixh1fGt9UAJcc-02lo\" rel=\"nofollow\" tabindex=\"-1\" target=\"_blank\">https://docs.google.com/document/d/1f4-o0hqXCFynsp3449Bsscne3KqqSJZk/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true</a> Maaari ninyong tingnan kung tama ang inyong naging pagsagot gamit ang susing kasagutan sa link na: <a href=\"https://docs.google.com/document/d/1D7t8Iyij241ppiRcmurQghCZ9vMGyH73/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true&amp;fbclid=IwAR0y1bADeN-K9opHtl4k0pyGtseZ6zWKCi7fzANDQEksrb-v9SzqhQD4gL8\" rel=\"nofollow\" tabindex=\"-1\" target=\"_blank\">https://docs.google.com/document/d/1D7t8Iyij241ppiRcmurQghCZ9vMGyH73/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true</a><br />\r\n<br />\r\n3.&nbsp;Sa harapang pagkaklase, kukuha ang mag-aaral ng laguhang pagsusulit habang manaka-nakang nananalumpati ang bawat isa. Balikan ang aralin sa mga sumusunod na paksa: </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">A. Pokus ng Pandiwa </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">B. Matalinhagang Pamamahayag (Tayutay) </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">C. Mga Paraan ng Pagpapalawak ng Pangungusap </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">D. Mga Teoryang Pampanitikan</span></span></p>\r\n', '01', '2023', '10'),
(441, 'teacher7201102', '72', 'MARIKINA SCIENCE HIGH SCHOOL', 'LAWRENCE   M. . DIMAILIG', 'Q2_W8_Gawaing Pagganap at Laguhang Pagtataya', '', '<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Magandang araw sa inyo Grade 10,&nbsp;<br />\r\n<br />\r\nNarito ang aking tagubilin ukol sa ating pagtitipon.<br />\r\n<br />\r\n1.&nbsp;Sa klase synchronous, nakabukas ang link na: <a href=\"https://meet.google.com/wjp-tcsg-wmf?fbclid=IwAR3L1jLC7gwVbwJrhOWGma4IvBvxRxLTBel7UIxrWMinJOA25FwUEYGJvkM\" rel=\"nofollow\" tabindex=\"-1\" target=\"_blank\">https://meet.google.com/wjp-tcsg-wmf</a> kung mayroon katanungan o paglilinaw sa gawain. Iwasang maging paulit-ulit ang tanong kung nakalagay naman ito sa gatnubay ng gawaing pagganap. Kung walang katanungan, ilaan ang oras na matapos ang talumpati.<br />\r\n<br />\r\n2.&nbsp;Sa klaseng asynchronous, ipinaaalala na: </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">A. I-print ang nasabing talumpati sa 8.5x11 na size ng papel sa pormat na tinakda. Ibigay ito sa harapang pagtitipon bago manalumpati sa harapan. B. Sikaping mag-ensayo sa harap ng salamin upang masanay sa eye contact at makita ang pagkilos at kumpas ng kamay habang nagsasalita. C. Idiin ang mga salitang naging bigyang tuon para hindi maging monotone. Tandaan na mahalaga ang baryasyon ng tinig.<br />\r\n<br />\r\nNais kong ibahagi sa inyo ang isang pagsasanay bago kumuha ng laguhang pagsusulit sa Miyerkules. Mangyaring sagutan ito sa inyong kuwaderno. Gamitin ang link na: <a href=\"https://docs.google.com/document/d/1f4-o0hqXCFynsp3449Bsscne3KqqSJZk/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true&amp;fbclid=IwAR37gAqVDRAIqglDlTyHi--16QvRqRpsWnGakqGSvixh1fGt9UAJcc-02lo\" rel=\"nofollow\" tabindex=\"-1\" target=\"_blank\">https://docs.google.com/document/d/1f4-o0hqXCFynsp3449Bsscne3KqqSJZk/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true</a> Maaari ninyong tingnan kung tama ang inyong naging pagsagot gamit ang susing kasagutan sa link na: <a href=\"https://docs.google.com/document/d/1D7t8Iyij241ppiRcmurQghCZ9vMGyH73/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true&amp;fbclid=IwAR0y1bADeN-K9opHtl4k0pyGtseZ6zWKCi7fzANDQEksrb-v9SzqhQD4gL8\" rel=\"nofollow\" tabindex=\"-1\" target=\"_blank\">https://docs.google.com/document/d/1D7t8Iyij241ppiRcmurQghCZ9vMGyH73/edit?usp=share_link&amp;ouid=117348226815323752823&amp;rtpof=true&amp;sd=true</a><br />\r\n<br />\r\n3.&nbsp;Sa harapang pagkaklase, kukuha ang mag-aaral ng laguhang pagsusulit habang manaka-nakang nananalumpati ang bawat isa. Balikan ang aralin sa mga sumusunod na paksa: </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">A. Pokus ng Pandiwa </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">B. Matalinhagang Pamamahayag (Tayutay) </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">C. Mga Paraan ng Pagpapalawak ng Pangungusap </span></span></p>\r\n\r\n<p><span style=\"font-size:10px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">D. Mga Teoryang Pampanitikan</span></span></p>\r\n', '01', '2023', '10'),
(442, 'teacher12701101', '127', 'MARIKINA SCIENCE HIGH SCHOOL', 'CATHERINE   C. . MARCELLA', 'Pagbati', '', '<p>Happy New Year!</p>\r\n\r\n<p>Binabati ko po kayo sa pagtanggap sa lahat ng hamon sa inyong buhay.Ipagpatuloy ito sa sarili pag-unlad para makatulong din sa iba.</p>\r\n\r\n<p>Nawa&#39;y maayos ang kalagayan ng lahat.</p>\r\n', '01', '2023', '10'),
(443, 'teacher12801106', '128', 'MARIKINA SCIENCE HIGH SCHOOL', 'LILIBETH   C. . PULIDO', 'Second Quarter Modules with Answer Key', '', '<p><strong>Good day Grade 9 Learners!</strong></p>\r\n\r\n<p>I already shared all Trigonometry Second Quarter Modules with Answer Key in DLM under Standard Materials. You may access and/or download the modules. Practice answering the exercises from the modules and check your answers.&nbsp;</p>\r\n', '01', '2023', '10'),
(444, 'teacher14501101', '145', 'MARIKINA SCIENCE HIGH SCHOOL', 'JOSEPHINE  L. . MOLINA', 'Mathematics 10 Quiz # 2.1', '', '<p>Good afternoon Grade 10!&nbsp; Please access the Mathematics 10 Quiz # 2.1 here.&nbsp; Have a printed copy in letter size paper.&nbsp; Bring your copy during our face to face classess.&nbsp; Thank you very much!</p>\r\n', '01', '2023', '10'),
