(1, '2563', 'MATH-0715ST1ST1', 'MATH-0715ST1ST125631', '<p>The Philippines is one of the five countries in the world that have not started in-person classes since the pandemic began, affecting the right to learn of more than 27 million Filipino students. While new variants are causing a rise of infections, UNICEF is advocating for a phased reopening of schools, beginning in low-risk areas. This can be done on a voluntary basis with proper safety protocols in place.</p>\r\n\r\n<p>&quot;The first day of school is a landmark moment in a child&#39;s life&mdash;setting them off on a life-changing path of personal learning and growth. Most of us can remember countless minor details&mdash;what clothes we wore, our teacher&#39;s name, who we sat next to. But for millions of children, that important day has been indefinitely postponed,&quot; said UNICEF Executive Director Henrietta Fore. &quot;As classes resume in many parts of the world, millions of first graders have been waiting to see the inside of a classroom for over a year. Millions more may not see one at all this school term. For the most vulnerable, their risk of never stepping into a classroom in their lifetime is skyrocketing.&quot;</p>\r\n', '1', '', '1'),
(2, '4778', 'ENG-104777ST1ST1', 'ENG-104777ST1ST147781', '<p>segegewwe</p>\r\n', '1', '', '1'),
(3, '2563', 'ENG-0715FT1ST1', 'ENG-0715FT1ST125631', '<p>goifdgodfg;dlfjg;fdxjgldfjgdjhptuhrtjh/fgjhfgjhpgfhgfhhk&#39;gfkhgf;lhkjhfg</p>\r\n', '1', '', '1'),
(4, '2563', 'MATH-0715ST1ST2', 'MATH-0715ST1ST22563105', 'Mathematics help you in solving numbers.\r\nIt can be addition, subtraction, division, multiplication or something more like algebraic methods, square root etc. Mathematics is a big help for each and everyone of us. It help us everyday not only in solving your money but also in building houses etc.', '1', '', '1'),
(5, '7627', 'ENG-087613FT1ST1', 'ENG-087613FT1ST176271', '<p>Coronavirus disease (COVID-19) is an infectious disease caused by the SARS-CoV-2 virus.</p>\r\n\r\n<p>Most people who fall sick with COVID-19 will experience mild to moderate symptoms and recover without special treatment. However, some will become seriously ill and require medical attention.</p>\r\n', '1', '', '1'),
(6, '7627', 'ENG-087613ST1ST1', 'ENG-087613ST1ST176271', '<p>The virus can spread from an infected person&rsquo;s mouth or nose in small liquid particles when they cough, sneeze, speak, sing or breathe. These particles range from larger respiratory droplets to smaller aerosols.</p>\r\n', '1', '', '1'),
(9, '7627', 'ENG-087613FT1ST2', 'ENG-087613FT1ST276271', '<p>&quot;Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?&quot;</p>\r\n', '1', '', '1'),
(26, '8064', 'ARA-072495FT1ST2', 'ARA-072495FT1ST280641', '<p><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ujhuhushdshdusodhsohdsiohdishidhsihdishdhsidhs</p>\r\n\r\n<p>sfsfosjfjosfospfsfosfsf</p>\r\n', '1', '', '1'),
(27, '8064', 'ARA-072495FT2ND1', 'ARA-072495FT2ND180641', '<p><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ang pula ay simbolo ng umaga araw&nbsp; at tapang ngbuhay at gabi kabutihan kalma ng buhay puti</p>\r\n', '1', '', '1'),
(28, '8064', 'ARA-072495FT3RD1', 'ARA-072495FT3RD180641', '<p><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>apoy ay&nbsp; tapang at liyab ng buhay at pagsubok sa buhay</p>\r\n', '1', '', '1'),
(29, '8064', 'ARA-072495FT4TH1', 'ARA-072495FT4TH180641', '<p>alon ng buhay ay makisabay sa uso&nbsp;</p>\r\n', '1', '', '1'),
(30, '8064', 'ARA-072495ST4TH1', 'ARA-072495ST4TH180641', '<p><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/8/8c/Umzugskarton.jpg/1200px-Umzugskarton.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:20px\"><strong>ang box ay sa buhay ay kanlungan, silugan at bahay na kaya ka protektahan pagdating ng anu mang sakuna sa buhay</strong></span></p>\r\n', '1', '', '1'),
(31, '8066', 'ARA-072495FT1ST2', 'ARA-072495FT1ST280661', '<p>Ang Araw at gabi</p>\r\n', '1', '', '1');
