(1, 'MATH-10145FT1ST1', 1, 'A SEQUENCE WITH NO DEFINITE NUMBER OF TERMS IS CALLED __________.', 'D', 'FINITE ', 'DOMAIN', 'RANGE', 'INFINITE', 'TEST I', ''),
(2, 'MATH-10145FT1ST1', 2, 'A SEQUENCE HAS NTH TERM ?? = 5? ? 1. WHAT IS THE 4TH TERM? ', 'D', '17', '16', '18', '19', 'TEST I', ''),
(3, 'MATH-10145FT1ST1', 3, 'IF ?? = 50 AND THE NTH TERM OF THE SEQUENCE IS ?? = 4? ? 2, WHAT IS THE VALUE OF N?', 'A', '12', '13', '14', '15', 'TEST I', ''),
(4, 'MATH-10145FT1ST1', 4, 'GIVEN THE SEQUENCE 5, 6, 8, 11, … HOW CAN EACH TERM BE FOUND?', 'C', 'ADD 2 TO EACH TERM', 'MULTIPLY 2 TO EACH TERM', 'ADD CONSECUTIVE 1,2,3,.. TO EACH TERM', 'SUBTRACT 2 TO EACH TERM', 'TEST I', ''),
(5, 'MATH-10145FT1ST1', 5, 'WHAT IS THE RULE THAT DESCRIBES THE SEQUENCE 5,10,15, 20? ', 'B', '?? = ? + 4', '?? = 5?', '?? = 4? + 1', '?? = 3? + 2', 'TEST I', '<p>What is the rule that describes the sequence 5,10,15, 20? A. ?? = ? + 4 B. ?? = 5? C. ?? = 4? + 1 D. ?? = 3? + 2</p>\r\n'),
(6, 'MAP-07710FT1ST1', 1, 'WHICH OF THE FOLLOWING BEST DESCRIBES THE VOICE OF THE PEOPLE? ', 'A', 'FOLKSONG', 'LITURGY', 'DEVOTIONAL', 'SECULAR', 'TEST I', ''),
(7, 'MAP-07710FT1ST1', 2, 'IT IS ALSO CALLED CHURCH MUSIC.  ', 'B', 'FOLKSONG', 'LITURGY', 'DEVOTIONAL', 'SECULAR', 'TEST I', ''),
(8, 'MAP-07710FT1ST1', 3, 'IT IS NOT ONLY FOR ENTERTAINMENT BUT ALSO FOR OTHER SIGNIFICANT SOCIAL FUNCTIONS AND PURPOSES LIKE COURTING FOR LOVE IN A WOMAN. ', 'D', 'FOLKSONG', 'LITURGY', 'DEVOTIONAL', 'SECULAR', 'TEST I', ''),
(9, 'MAP-07710FT1ST1', 4, 'IT IS A HYMN THAT ACCOMPANIES RELIGIOUS OBSERVANCES AND RITUALS. ', 'C', 'FOLKSONG', 'LITURGY', 'DEVOTIONAL', 'SECULAR', 'TEST I', ''),
(10, 'MAP-07710FT1ST1', 5, 'IT IS WRITTEN BY THE FOLK AND IS SUNG TO ACCOMPANY DAILY ACTIVITIES. ', 'A', 'FOLKSONG', 'LITURGY', 'DEVOTIONAL', 'SECULAR', 'TEST I', ''),
(11, 'MAP-07710FT1ST1', 6, 'WHAT DO YOU CALL TO THESE PHILIPPINE EPIC NARRATIVES OF THE LIFE OF JESUS CHRIST, FOCUSED ON HIS PASSION, DEATH, AND RESURRECTION? ', 'A', 'PASYON', 'SALUBONG', 'SENAKULO', 'SANTACRUZAN', 'TEST I', ''),
(12, 'MAP-07710FT1ST1', 7, 'IT IS A PLAY DEPICTING THE LIFE AND SUFFERING OF JESUS CHRIST. ', 'C', 'PASYON', 'SALUBONG', 'SENAKULO', 'SANTACRUZAN', 'TEST I', ''),
(13, 'MAP-07710FT1ST1', 8, 'IT IS A FILIPINO WORD THAT TRANSLATES TO \"MEETING\" BECAUSE IT IS A RITUAL THAT REENACTS THE MEETING OF JESUS CHRIST AND HIS MOTHER, MARY AFTER HIS RESURRECTION ', 'B', 'PASYON', 'SALUBONG', 'SENAKULO', 'SANTACRUZAN', 'TEST I', ''),
(14, 'MAP-07710FT1ST1', 9, 'IT HONORS THE FINDING OF THE TRUE CROSS BY HELENA OF CONSTANTINOPLE (KNOWN AS REYNA ELENA) AND CONSTANTINE THE GREAT. ', 'D', 'PASYON', 'SALUBONG', 'SENAKULO', 'SANTACRUZAN', 'TEST I', ''),
(15, 'MAP-07710FT1ST1', 10, 'WHICH OF THE FOLLOWING HAS A STANDARD ELEMENT OF EPIC POETRY AND IS INTERWOVEN WITH A COLORFUL, DRAMATIC THEME? ', 'A', 'PASYON', 'SALUBONG', 'SENAKULO', 'SANTACRUZAN', 'TEST I', ''),
(16, 'MAP-07710FT1ST1', 11, 'IT IS ORIGINALLY A WAR SONG; THIS SONG IN TRIPLE TIME CAN BE OF ANY TOPIC: LOVE, RESENTMENT, OR ASOCIAL COMMENTARY. ', 'B', 'KUNDIMAN', 'KUMINTANG', 'PAMULINAWEN', 'PANDANGGO', 'TEST I', ''),
(17, 'MAP-07710FT1ST1', 12, 'IT IS CONSIDERED AS A PHILIPPINE FOLK DANCE WHICH HAS BECOME POPULAR IN THE RURAL AREAS OF THE PHILIPPINES. ', 'D', 'KUNDIMAN', 'KUMINTANG', 'PAMULINAWEN', 'PANDANGGO', 'TEST I', ''),
(18, 'MAP-07710FT1ST1', 13, 'WHAT DO YOU CALL THIS ILOCANO FOLK SONG THAT TELLS ABOUT A MAN WHO IS COURTING A STONE-HEARTED GIRL? ', 'C', 'KUNDIMAN', 'KUMINTANG', 'PAMULINAWEN', 'PANDANGGO', 'TEST I', ''),
(19, 'MAP-07710FT1ST1', 14, 'THESE FOLK SONGS WERE SUBTLY PATRIOTIC BUT TYPICALLY DISGUISED AS LOVE SONGS. WHAT IS THIS? ', 'A', 'KUNDIMAN', 'KUMINTANG', 'PAMULINAWEN', 'PANDANGGO', 'TEST I', ''),
(20, 'MAP-07710FT1ST1', 15, '-	IT IS THE OLDEST AND MOST POPULAR SONG AMONG CHRISTIAN FILIPINOS. ', 'B', 'KUNDIMAN', 'KUMINTANG', 'PAMULINAWEN', 'PANDANGGO', 'TEST I', ''),
(22, 'SCI-0995FT1ST2', 1, 'MOST VEINS CARRY DEOXYGENATED BLOOD FROM THE DIFFERENT PARTS OF THE BODY TO THE       HEART. WHICH  VEINS CARRY OXYGENATED BLOOD?', 'B', 'INFERIOR VENA CAVA', 'PULMONARY VEIN', 'RENAL VEIN', 'SUPERIOR VENA CAVA', 'TEST I', ''),
(23, 'SCI-0995FT1ST2', 2, 'WHICH BLOOD CELL IS RESPONSIBLE FOR THE ABSORPTION OF OXYGEN IN THE BLOOD?', 'C', 'PLATELETS                                   ', 'BWHITE BLOOD CELLS ', '  RED BLOOD CELL         ', '  BACTERIA', 'TEST I', ''),
(24, 'SCI-0995FT1ST2', 3, 'WHAT DO YOU CALL THE PART OF THE RESPIRATORY SYSTEM THAT LOOKS LIKE BUNCH OF GRAPE WHERE      THE EXCHANGE OF GASES OCCURS?', 'A', 'ALVEOLI                                                                       ', 'BRONCHI    ', 'LARYNX        ', ' TRACHEA', 'TEST I', ''),
(25, 'SCI-0995FT1ST2', 4, 'WHICH STATEMENT IS FALSE?        ', 'C', ' THE BLOOD IN THE AORTA IS OXYGENATED.       ', 'THE BLOOD IN SUPERIOR VENA CAVA IS DEOXYGENATED.         ', 'THE BLOOD IN THE PULMONARY VEIN IS DEOXYGENATED.        ', ' THE BLOOD IN THE PULMONARY ARTERY IS DEOXYGENATED.', 'TEST I', ''),
(26, 'SCI-0995FT1ST2', 5, 'WHICH IS THE FUNCTION OF THE RESPIRATORY SYSTEM? THE RESPIRATORY SYSTEM PROVIDES ______     TO THE BODY.       ', 'C', 'CARBON DIOXIDE AND OXYGEN                            ', ' CARBON DIOXIDE      ', ' OXYGEN                                              ', 'BLOOD', 'TEST I', ''),
(27, 'SCI-0995FT1ST2', 6, 'WHICH IS THE CORRECT ORDER OF AIRFLOW DURING EXHALATION?', 'B', 'ALVEOLI, BRONCHUS, BRONCHI, TRACHEA, LARYNX, PHARYNX, NASAL CAVITY OR NOSE', 'NOSE OR NASAL CAVITY, PHARYNX, LARYNX, TRACHEA, BRONCHI, BRONCHUS, ALVEOLI', 'PHARYNX, TRACHEA, BRONCHUS, BRONCHI, LARYNX, ALVEOLI, NASAL ACTIVITY OR NOSE', 'NASAL CAVITY OR NOSE, BRONCHI, TRACHEA, PHARYNX, LARYNX, ALVEOLI, BRONCHUS', 'TEST I', ''),
(28, 'SCI-0995FT1ST2', 7, 'A FLAP TISSUE THAT PREVENTS THE BACKFLOW OF BLOOD BETWEEN THE ATRIA AND THE VENTRICLE.', 'D', 'EPIGLOTTIS ', 'VEIN', 'ARTERY', 'VALVE', 'TEST I', ''),
(29, 'SCI-0995FT1ST2', 8, 'WHICH BLOOD CELL IS RESPONSIBLE FOR BLOOD CLOTTING?', 'B', 'RED BLOOD CELL', 'PLATELET', 'WHITE BLOOD CELL', 'HEMOGLOBIN', 'TEST I', ''),
(30, 'SCI-0995FT1ST2', 9, 'A DOME-SHAPED MUSCLE THAT SEPARATES THE CHEST CAVITY AND ABDOMINAL CAVITY THAT HELPS TO       INCREASE THE PRESSURE DURING INHALATION IS CALLED ________?', 'D', ' LUNGS', 'HEART ', 'LIVER', ' DIAPHRAGM', 'TEST I', ''),
(31, 'SCI-0995FT1ST2', 10, 'WHAT IS THE AUTOMATIC REACTION OF THE BODY WHEN FOREIGN MATERIAL ACCIDENTALLY  ENTERS       THE TRACHEA?', 'A', ' COUGH', 'SNEEZE', 'FEVER', 'CHOKE', 'TEST I', ''),
(32, 'SCI-0995FT1ST2', 11, 'DISEASES IN THE RESPIRATORY AND CIRCULATORY SYSTEMS CAN BE PREVENTED WITH A       HEALTHY LIFESTYLE.  WHICH AMONG THE GIVEN PRACTICES BEST PREVENTS MAN FROM THESE DISEASES?       I. EATING A BALANCE DIET             II. AVOIDING VICES            III. PROPER HYGIENE               IV. REGULAR EXERCISE', 'C', ' I AND II  ', 'I AND III ', ' I, III AND IV   ', ' I, II III AND IV', 'TEST I', ''),
(33, 'SCI-0995FT1ST2', 12, 'WHY SHOULD A PERSON QUIT SMOKING?', 'A', 'IT RAISES BLOOD PRESSURE AND LEADS TO CONSTRICTION OF BLOOD VESSELS.', 'IT CARRIES MORE OXYGEN BY THE BLOOD THROUGHOUT THE BODY.', 'IT KEEPS THE PERSON AWAKE AND ALERT FOR SEVERAL HOURS.', 'IT LEADS TO SLOWER HEART RATE WHEN RISING FROM MORE CONSUMPTION.', 'TEST I', ''),
(34, 'SCI-0995FT1ST2', 13, 'THE LUNGS AND HEART ARE VERY IMPORTANT IN OUR BODY, HOW CAN YOU KEEP  THEM STRONG?', 'B', 'SMOKE', 'HEALTHY LIFESTYLE ', 'SLEEP THE WHOLE DAY', 'EATING HEART - SHAPED FOODS', 'TEST I', ''),
(35, 'SCI-0995FT1ST2', 14, 'A CONDITION IN WHICH THE AIR SACS OF THE LUNGS ARE DAMAGED AND ENLARGED, CAUSING A     PERSON’S BREATHLESSNESS. WHICH OF THE FOLLOWING  DISEASES DAMAGED THE LUNGS?', 'B', ' ASTHMA ', 'EMPHYSEMA', 'AIR ALLERGY', 'COPD', 'TEST I', ''),
(36, 'SCI-0995FT1ST2', 15, ' CORONAVIRUS DISEASE OR COVID-19 OUTBREAK WEAKENS A PERSON’S HEALTH CONDITION THAT        LEADS INTO A SEVERE COMPLICATION CALLED __________.', 'C', 'ASTHMA', 'COLD', 'PNEUMONIA ', 'ALLERGY', 'TEST I', ''),
