(76, 'FIL-07106FT1ST2', 2, 'ANO ANG MAHIHINUHA MO SA SITWASYON SA ITAAS?', 'C', 'SIGURO AY GABI NA.', 'MARAHIL AY MAY PAPARATING NA LINDOL.', 'BAKA BUBUHOS ANG MALAKAS NA ULAN.', 'SA TINGIN KO MAAGANG GUMABI.', 'TEST I', '<p>Ang maaliwalas at magandang sikat ng araw ay napalitan ng biglang pagdilim ng langit, paghangin ng malakas at biglang pagkulog.&nbsp;</p>\r\n'),
(77, 'FIL-07106FT1ST2', 3, 'ANO KAYA ANG MAHIHINUHA MO SA GINAGAWA NI THELMA?', 'B', 'BAKA SIYA AY NAGKUKUNYARI LAMANG.', 'MARAHIL AY MAY INIINDANG SAKIT SI THELMA.', 'SIGURO AY AYAW NIYA LANG PUMASOK.', 'TILA NAGDA-DRAMA LAMANG SI THELMA.', 'TEST I', '<p>Oras-oras na lamang lumalabas ng klasrum si Thelma para pumunta sa CR. Pagkarating niya palang ay uupo saglit at biglang magpapaalam na lalabas uli. Sa tuwing umuupo siya ay hinahawakan niya ang kanyang tiyan at biglang yuyuko.</p>\r\n'),
(78, 'FIL-07106FT1ST2', 4, 'ANO ANG MAHIHINUHA MO KAY TOLITS?', 'B', 'SIGURO AY NAPAGALITAN SIYA NG MAGULANG NIYA.', 'BAKA SIYA AY HULI NA SA KLASE.', 'MARAHIL AY MAY PUPUNTAHAN SIYA.', 'TILA NAGLALARO SI TOLITS.', 'TEST I', '<p>Nagmamadaling naligo at nagbihis si tolits at tumakbo papasok ng paaralan. Pagdating niya ay nakita niya ang guro at mga kaklase niya na nagsisimula na sa klase.</p>\r\n'),
(79, 'FIL-07106FT1ST2', 5, 'ANO ANG MAHIHINUHA MO SA SITWASYON?', 'C', 'BAKA MALAKAS LANG TALAGA ANG ULAN.', 'MARAHIL MAGKAKAROON NG STORM SURGE.', 'SA TINGIN KO AY MAGSISIMULA NANG BUMAHA.', 'MAAARING TUMAAS LANG ANG TUBIG PERO HINDI BABAHA.', 'TEST I', '<p>Malakas ang buhos ng ulan na nagsimula sa Montalban. Bumuhos na rin ang ulan sa Marikina kaya naman ang tubig na nagmumula sa Montalban ay diretso sa ilog Marikina. Unti-unting tumaas ang sukat ng tubig kaya biglang nagpatunog ng sirena.&nbsp;</p>\r\n'),
