(232, 'UNDE-12141ST1ST1', 1, 'IT IS THE SCIENTIFIC STUDY OF HUMAN LIFE AND CULTURE.', 'D', 'ANTHROPOLOGY', 'POLITICAL SCIENCE', 'SOCIOLOGY', 'TOPOGRAPHY', 'TEST I', '<p>Online Assessment Instructions<br />\r\n<br />\r\nBefore taking the assessment:<br />\r\n1.Make sure you have stable internet connection.<br />\r\n2.You must complete the quest in Classcraft (content of the module and other references)<br />\r\n<br />\r\nDuring the assessment<br />\r\n1. Read the instructions, questions and statements carefully.<br />\r\n2. You may use your module and other learning material.<br />\r\n3. Answer each question/statement HONESTLY.<br />\r\n4. Do not share your answers or discuss it with anyone.<br />\r\n5. Double check your answer before clicking the &quot;submit&quot; button.<br />\r\n<br />\r\n*If you experience internet connection problem, report it to the teacher.</p>\r\n'),
