(238, 'UNDE-12141ST1ST1', 7, 'ARCHAEOLOGY DESCRIBES AND INTERPRETS HUMAN BEHAVIOR AND CULTURAL PATTERNS THROUGH REMAINS. WHICH OF THE FOLLOWING QUESTIONS IS  INCLUDED IN STUDYING IT?', 'D', 'HOW DID HUMAN GROUP GET FOOD?', 'WHAT WERE THEIR RELIGIOUS BELIEFS?', 'HOW DID THEY INTERACT WITH OTHERS?', 'ALL OF THE ABOVE', 'TEST I', ''),
(239, 'UNDE-12141ST1ST1', 8, 'WHICH OF THE FOLLOWING STATEMENT IS TRUE?', 'A', 'ANTHROPOLOGY AIMED TO UNDERSTAND OUR EVOLUTIONARY ORIGINS, OUR DISTINCTIVENESS AS A SPECIES, AND THE GREAT DIVERSITY IN OUR FORMS OF SOCIAL EXISTENCE ACROSS THE WORLD AND THROUGH TIME.', 'THE PEOPLE IN A HUMAN SOCIETY GENERALLY DOES NOT SHARE COMMON CULTURAL PATTERNS.', 'A 1945 WILLYS JEEP IS THE BASIS FOR JEEPNEY DESIGNS IN THE PHILIPPINES.', 'ALL OPTIONS ARE CORRECT.', 'TEST I', ''),
