(241, 'UNDE-12141ST1ST1', 10, 'WHICH OF THE FOLLOWING IS NOT TRUE ABOUT ANTHROPOLOGY?', 'C', 'IT IS A SCIENTIFIC STUDY ABOUT WHAT MAKES US HUMAN.', 'IT CAN BE DEFINED AS THE STUDY OF HUMANKIND IN ALL TIMES AND PLACES.', 'IT IS A STUDY OF HUMAN BEHAVIOR, CULTURE, INTERACTION, AND RELATIONSHIP BETWEEN HUMANS AND ENVIRONMENT.', 'IT IS DIVIDED INTO FIVE SUBFIELDS NAMELY ARCHAEOLOGY, BIOLOGICAL, CULTURAL, ETHNOGRAPHY AND LINGUISTIC.', 'TEST I', ''),
(242, 'UNDE-12141ST1ST2', 1, 'WHO COINED THE TERM \"SOCIOLOGICAL IMAGINATION\"?', 'A', 'WRIGHT MILLS', 'RIGHT MILLS', 'WRIGHT MILL', 'WRIGHTS MILL', 'TEST I', '<p>Online Assessment Instructions<br />\r\n<br />\r\nBefore taking the assessment:<br />\r\n1.Make sure you have stable internet connection.<br />\r\n2.You must complete the quest in Classcraft (content of the module and other references)<br />\r\n<br />\r\nDuring the assessment<br />\r\n1. Read the instructions, questions and statements carefully.<br />\r\n2. You may use your module and other learning material.<br />\r\n3. Answer each question/statement HONESTLY.<br />\r\n4. Do not share your answers or discuss it with anyone.<br />\r\n5. Double check your answer before clicking the &quot;submit&quot; button.<br />\r\n<br />\r\n*If you experience internet connection problem, report it to the teacher.</p>\r\n'),
(243, 'UNDE-12141ST1ST2', 2, 'HOW CAN WE SAY THAT A PERSON HAS “SOCIOLOGICAL IMAGINATION”? IF HE OR SHE HAS..', 'C', 'ACTIVE AWARENESS AND PARTICIPATION IN DIFFERENT ISSUES', 'CREATIVITY AND CRITICAL THINKING SKILLS SUCH AS ASKING HARD QUESTIONS ABOUT LIFE', 'VIVID AWARENESS OF RELATIONSHIP BETWEEN PRIVATE EXPERIENCE AND WIDE SOCIETY', 'VISION AND MISSION TO CHANGE THE SOCIETY AND TO MAKE A BETTER PLACE FOR EVERYONE', 'TEST I', ''),
(244, 'UNDE-12141ST1ST2', 3, 'WHICH OF THE FOLLOWING SCENARIO BEST DESCRIBE THE FUNCTIONALIST PERSPECTIVE?', 'A', 'ANA SEES SOCIETY AS A SYSTEM OF HIGHLY INTERRELATED PARTS THAT WORK TOGETHER.', 'JOSEPH BELIEVES THAT PHILIPPINES ARE CURRENTLY EXPERIENCING INJUSTICES AND INEQUAILITY.', 'LOLITA TENDS TO INTERPRET ALL FACIAL EXPRESSION OF HER CLASSMATE AS BEING “ABNORMAL”.', 'LITO DOES NOT AGREE THAT SOCIETY WORKS FOR THE BENEFIT OF THE WHOLE.', 'TEST I', ''),
