(247, 'UNDE-12141ST1ST2', 6, 'HOW CAN SOCIOLOGY HELP US UNDERSTAND OURSELVES AND OTHERS?', 'D', 'SOCIOLOGY PUSHES US TO CONSIDER MORE COMPLEX CONNECTIONS BETWEEN OUR PERSONAL LIVES AND THE LARGER WORLD.', 'WE STUDY SOCIOLOGY TO UNDERSTAND HOW BEHAVIOR IS SHAPED BY GROUP LIFE, AND IN TURN HOW GROUP LIFE IS AFFECTED BY INDIVIDUALS.', 'WE HAVE A SYSTEMATIC WAY TO STUDY HUMAN SOCIETY AND SOCIAL INTERACTION.', 'ALL OPTIONS ARE CORRECT.', 'TEST I', ''),
(248, 'UNDE-12141ST1ST2', 7, 'HOW DOES EMILE DURKHEIM STUDIED AND ANALYZED FUNCTIONALIST THEORY?', 'C', 'HE MOVED SOCIOLOGY INTO STUDY OF HUMAN EXPRESSION AND FUNCTIONS.', 'HE RESTRUCTURED THE SOCIETY AND LEAD A REVOLUTION ON 1858 TO 1917.', 'HE STUDIED SUICIDE AND LOOK AT THE DIFFERENT SOCIAL CAUSES OF IT.', 'HE WROTE A BOOK ABOUT FUNCTIONS AND STRUCTURE OF THE SOCIETY.', 'TEST I', ''),
(249, 'UNDE-12141ST1ST2', 8, 'WHICH OF THE FOLLOWING QUESTION IS NOT SOUGHT TO ANSWER BY POLITICAL SCIENCE?', 'D', 'WHO SHOULD HAVE A SAY?', 'HOW SHOULD COLLECTIVE DECISIONS BE MADE?', 'HOW MUCH INFLUENCE SHOULD EACH PERSON HAVE?', 'WHAT SHOULD WE PRODUCE?', 'TEST I', ''),
(250, 'UNDE-12141ST1ST2', 9, 'FORCES WHICH PRODUCE ORDER AND STABILITY', 'A', 'SOCIAL STATICS', 'SOCIAL DYNAMICS', 'SOCIOLOGY', 'SOCIETY', 'TEST I', ''),
(251, 'UNDE-12141ST1ST2', 10, 'HE IS THE FATHER OF THE SOCIAL CONFLICT THEORY AND ANALYZED HOW ECONOMIC SYSTEM OF CAPITALISM LEADS TO CONFLICT AND INEQUALITY AMONG DIFFERENT GROUPS IN SOCIETY.', 'B', 'HERBERT SPENCER', 'KARL MARX', 'AUGUSTE COMTE', 'HARRIET MARTINEAU', 'TEST I', ''),
(252, 'UNDE-12141ST1ST3', 1, 'IT CONTINUOUSLY RESTORES ITSELF WHENEVER CUSTOMS DO NOT FIT IN THE CURRENT SITUATION ANYMORE. IT DOES NOT REMAIN STAGNANT.? WHAT ARE THE CHARACTERISTICS OF CULTURE?', 'B', 'SHARED AND CONTESTED', 'DYNAMIC, FLEXIBLE, AND ADAPTIVE', 'HAS PATTERNED SOCIAL INTERACTIONS', 'INTEGRATED AND AT TIMES UNSTABLE', 'TEST I', '<p>According to R. Linton, ?A culture is a configuration of learned behaviors and<br />\r\nresults of behavior whose component elements are shared and transmitted by the<br />\r\nmembers of a particular society?. There are different aspects of culture like art, music,<br />\r\nlanguage, food, daily life, clothing, and religion to name a few.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Dynamic, Flexible, and Adaptive<br />\r\nCulture constantly changes and adapts to the current state of society. It<br />\r\ncontinuously restores itself whenever customs do not fit in the current situation<br />\r\nanymore. It does not remain stagnant. For instance, our educational system before<br />\r\nwas into traditional learning (face-to-face learning). In lieu of the COVID-19 pandemic,<br />\r\nit transitioned to blended learning to adapt to the ?new normal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Shared and Contested<br />\r\nCulture is learned and acquired through different interactions with people.<br />\r\nCulture is a shared learning experience. Because culture constantly changes, we get<br />\r\nto share the learning process with other people. If culture is learned and shared, it is<br />\r\nalso contested in various ways and situations. Because of diversity, culture is<br />\r\nsubjected to debate and analysis. For example, a foreigner learned some Filipino<br />\r\nwords like ?Kamusta?, ?Mahal kita?, ?Ano pangalan mo?? from his/her OFW co-worker.<br />\r\nLikewise, the OFW learned from the former. This is what we call social<br />\r\ndifferentiation. It is the distinction made between social groups and persons on the<br />\r\nbasis of biological, physiological, and socio-cultural factors, as sex, age, or ethnicity,<br />\r\nresulting in the assignment of roles and status within a society.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. Learned and Transmitted Through Socialization and Enculturation</p>\r\n\r\n<p>Socialization is the process by which we learn and internalize the foundations<br />\r\nand patterns of behavior that are laid low with culture.<br />\r\nEnculturation happens when we teach an individual or group of people the<br />\r\nnorms and values through unconscious repetition. For example, a person from a<br />\r\nprovince moved to Marikina for good.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>On the otherhand, acculturation happens to a person or group of people who<br />\r\nadopts the values, beliefs, practices, customs, and traditions of another culture. Its<br />\r\nthe process of cultural interaction and exchange.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. Integrated and At Times Unstable<br />\r\nAll aspects of a culture are related to one another and to truly understand a<br />\r\nculture, one must learn about all of its parts, not only a few.In order to keep the<br />\r\nculture functioning, all aspects of the culture must be integrated.For example, the<br />\r\nlanguage must be able to describe all the functions within the culture in order for<br />\r\nideas and ideals to be transmitted from one person to another.<br />\r\n<br />\r\n5. Requires Language and Other Forms of Communication<br />\r\nA particular language is unique to a specific group of people with a unique<br />\r\nculture. When people are interacting with another language, they are also interacting<br />\r\nwith the culture of that person. Learning other&#39;s language is studying the letters, rules<br />\r\nof grammar as well as understanding the deeper meaning, customs, and beliefs.</p>\r\n'),
(253, 'UNDE-12141ST1ST3', 2, 'ALTHOUGH ROMILA GETS ALONG WITH MEMBERS OF HER DEPARTMENT AND TEAM, SHE TENDS TO SPEND HER FREE TIME WITH OTHER COLLEAGUES WHO ARE OF ASIAN DESCENT, ESPECIALLY THOSE WHO ARE IN HER GENERATION. THIS SITUATION SUGGESTS THAT CULTURE', 'A', 'SHARED AND CONTESTED', 'ORGANIZED AND PATTERNED', 'INTEGRATED AND AT TIMES UNSTABLE', 'DYNAMIC AND ADAPTIVE', 'TEST I', ''),
(254, 'UNDE-12141ST1ST3', 3, 'ANA IS WALKING DOWN A QUIET STREET. SHE QUICKLY CLUTCHES HER HANDBAG CLOSER TO HER BODY AS SHE PASSES A MAN NAMED DIEGO. THEN, WHEN SHE SPOTS BELA WALKING TOWARD HER, SHE LOOSENS HER HOLD ON THE PURSE. TO ADDRESS THE SYSTEM, ONE MUST BE ABLE TO ADDRESS THE UNDERLINING PATTERNS. THIS IMPLIES THAT CULTURE', 'C', 'SHARED AND CONTESTED', 'DYNAMIC, FLEXIBLE, AND ADAPTIVE', 'HAS PATTERNED SOCIAL INTERACTIONS', 'ALL OPTIONS ARE CORRECT', 'TEST I', ''),
(255, 'UNDE-12141ST1ST3', 4, 'IT REFERS TO THE DIFFERENCES IN SOCIAL BEHAVIORS THAT DIFFERENT CULTURE EXHIBIT AROUND THE WORLD.', 'B', 'RELIGION', 'CULTURAL VARIATION', 'RELATIVISM', 'ETHNICITY', 'TEST I', '<p>Cultural variations refer to the differences in social behaviors that different<br />\r\ncultures exhibit around the world.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Religion &ndash; derived from the Latin word religare meaning ?to bind together.? It&rsquo;s a<br />\r\nsystem of beliefs and practices on a supernatural level.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ethnicity - It is the expression of the set of cultural ideas held by<br />\r\ndistinct ethics or indigenous group.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nationality - It is the legal relationship that binds a<br />\r\nperson and a country. It allows the state to protect and have jurisdiction over a person<br />\r\nThe term national can include both citizens and non-citizens.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SOCIAL DIFFERENCES<br />\r\nIt refers to the differences among the individuals based on social characteristics<br />\r\nand qualities. These differences include those associated with gender, sexual<br />\r\norientation, age, social class/ socioeconomic status, religion, and ability/ exceptionality.</p>\r\n'),
