(258, 'UNDE-12141ST1ST3', 7, 'IT REFERS TO THE TENDENCY TO ASSUME THAT ONE’S OWN CULTURE AND WAY OF LIFE REPRESENT THE NORM OR ARE SUPERIOR TO ALL OTHERS', 'D', 'CULTURAL RELATIVISM', 'SOCIALIZATION', 'SOCIETY', 'ETHNOCENTRISM', 'TEST I', ''),
