(289, 'SCI-0995ST1ST3', 2, 'WHICH OF THE FOLLOWING IS AN EXAMPLE OF A CODOMINANCE PATTERN OF INHERITANCE? ', 'D', 'WHEN A LONG-FURRED ANGORA RABBIT AND A SHORT-FURRED REX RABBIT REPRODUCE, THE RESULT CAN BE A RABBIT WITH FUR LONGER THAN A REX, BUT SHORTER THAN AN ANGORA. ', 'WHEN A BLACK AND A WHITE CHICKEN REPRODUCE AND NEITHER ALLELE IS COMPLETELY DOMINANT, THE RESULT IS A BLUE-FEATHERED BIRD.', 'ABOUT DOGS, LOTS OF LABRADOODLES HAVE WAVY HAIR. JUST LIKE HUMANS, THAT COMES FROM HAVING STRAIGHT-HAIRED AND CURLY-HAIRED PARENTS. THE RESULT IS AN INTERMEDIATE INHERITANCE: THE WAVY-HAIRED LABRADOODLE.', 'IN SOME CHICKENS, THE HETEROZYGOUS GENOTYPE LEADS TO A PHENOTYPE KNOWN AS ERMINETTE, FEATHERS WHICH ARE SPECKLED WITH BOTH BLACK AND WHITE.', 'TEST I', ''),
