(324, 'FIL-0897FT1ST3', 4, 'MAY TATLONG PANGUNAHING URI NG TUNOG SA PELIKULA. KARANIWANG TUNOG, MUSIKA, AT MGA DIYALOGO O PAG-UUSAP. MALIMIT SA MGA TUNOG NA ITO AY IDINARAGDAG PAGKATAPOS NA NG SHOOTING. HALIMBAWA, ANG TUNOG NG PINTO NA IBINABAGSAK, PATAK NG ULAN, KULOG, KIDLAT, INGAY NG MGA TUMATAKBONG SASAKYAN, AT PAG-UUSAP NG MGA TAO SA LANSANGAN. ANONG URI NG PAGBIBIGAY DEPINISYON ANG GINAMIT SA TALATA?', 'B', 'PAGBIBIGAY NG PORMAL NA DEPINISYON', 'PAGBIBIGAY NG HALIMBAWA', 'PAGLALARAWAN', 'PAGBIBIGAY NG IMPORMAL NA DEPINISYON', 'TEST I', ''),
