(326, 'FIL-0897FT1ST3', 6, '“ANG UNANG KALAGAYAN NOONG NAKALIPAS NA 50 TAON, ANG BABAE SA TAIWAN AY KATULAD SA KASAMBAHAY O HOUSEKEEPER. NGAYON, NAGBAGO NA ANG TUNGKULIN NG MGA BABAE AT ITO AY LALONG NAGGING KOMPLIKADO. SA BAHAY NG MGA TAIWANESE, SILA PA RIN ANG MAY PANANAGUTAN SA MGA GAWAING-BAHAY. NGUNIT SA LARANGAN NG TRAABAHO, INAASAHANG MAGAGAWA NILA KUNG ANO ANG NAGAGAWA NG MGA KALALAKIHAN.” - ANG KABABAIHAN NG TAIWAN: NGAYON AT NOONG NAKARAANG 50 TAON, PANITIKANG ASAYANO 9  ANONG TEKNIK ANG GINAMIT SA TALATA?', 'C', 'PAGSUSURI', 'PAGBIBIGAY KATUTURAN O DEPINISYON', 'PAGHAHAWIG AT PAGTATAMBIS', 'PAGSASALIN', 'TEST I', ''),
(327, 'FIL-0897FT1ST3', 7, 'AYUSIN ANG MGA PANGUNGUSAP AYON SA PAGKAKASUNOD-SUNOD NITO.\r\nI. ANG LANGGAM AY SIYANG PINAKAMASIPAG SA LAHAT NG KULISAP.\r\nII. ANG ANOMANG MUMO, BUTIL NG BIGAS O ASUKAL NA KAYANG MAKITA AY INIIPON AT INIIMBAK NIYA.\r\nIII. DAPAT TULARAN NG TAO ANG LANGGAM SA PAGGAWA.\r\nIV.INILALAAN NG LANGGAM ANG INIPON AT INIIMBAK NIYANG PAGKAIN PARA SA TAG-ULAN O TAG-ARAW MAN..\r\nV. ANG KASIPAGAN AY ISANG UGALING DAPAT NATING TAGLAYING LAHAT \r\n', 'D', 'I, II, III, IV, V', 'II, III, IV, V, ', 'V, IV, III, II, I', 'I, IV, II, III, V', 'TEST I', ''),
