(348, 'EDU-07131ST1ST1', 1, 'SA PAGPASOK NI ANNIE SA HIGH SCHOOL AY NAGING KAPANSIN PANSIN ANG KANYANG PAGIGING MATANGKAD. ISANG ARAW AY NILAPITAN SIYA NG ISANG VOLLEYBALL COACH NG PAARALAN AT INALOK SIYANG SUMALI. KAHIT MINSAN AY HINDI PA SIYA NAKAKAPAGLARO NG VOLLEYBALL KAYA NAGKAROON SIYA NG INTERES NA SUMALI DAHIL HANDA NAMAN SIYANG MAGSANAY. SA KABILA NG PAGAALALA AY NAGPASYA SIYA NA SUMALI. ANO KAYA ANG MAGIGING BUNGA NG DESISYON NI ANNIE?', 'C', 'MAGIGING MAHIRAP PARA SA KANYA DAHIL HINDI PA NIYA NASUSUBUKAG MAKAPAGLARO NG VOLLEYBALL KAHIT MINSAN', 'SA PAGTAGAL NG PANAHON AY MAGIGING MAHUSAY SIYA SA PAGLALARO DAHIL MAHIHIRAPAN SIYA MAKASABAY SA MGA KASAMAHANG MATAGAL NG NAGSASANAY.', 'MAGIGING MAHUSAY AT MATAGUMPAY SIYA SA PAGLALARO NG VOLLEYBALL DAHIL SA KANYANG INTERES AT KAHANDAAN NA DUMAAN SA PAGSASANAY PARA MATUTO.', 'HINDI SIYA MATUTUTO DAHIL WALA NAMAN SIYANG TALENT SA PAGLALARO NG VOLLEYBALL.', 'TEST I', ''),
(349, 'EDU-07131ST1ST1', 2, 'LIMANG TAONG GULANG PA LAMANG SI YVAN NG NATUKLASAN NG KANYANG MGA MAGULANG ANG KANYANG HUSAY SA PAGSASAYAW. SA MURANG EDAD, ISINASALI NA SIYA SA MGA CONTEST AT NAKILALA ANG KANYANG HUSAY SA PAGSASAYAW. NGUNIT NOONG SIYA AY MAG HIGH SCHOOL NAGING MAHIYAIN SIYA AT HINDI NA SUMASALI SA MGA CONTEST DAHIL NAHIHIYA AT NATATAKOT SIYANG HUMARAP SA MARAMING TAO. HINDI ALAM NG KANYANG GURO AT MGA KAMAG-ARAL ANG KANYANG TALENTO NGUNIT PALAGI PA RING SUMASAYAW SI YVAN SA KANILANG TAHANAN KASABAY ANG KANYANG MGA KAPATID. ANO ANG PANGUNAHING HADLANG SA PAGPAPAUNLAD NG TALENTO NI YVAN?', 'A', 'MAHINA ANG KANYANG TIWALA SA SARILING TALENTO AT KAKAYAHAN.', 'MALAKING TAKOT SA PAGHARAP SA MARAMING TAO.', 'KULANG SA PAG-EENSAYO.', 'WALANG SUPORTA NG MGA MAGULANG.', 'TEST I', ''),
(350, 'EDU-07131ST1ST1', 3, 'KUNG IKAW SI YVAN, ANO ANG DAPAT MONG GAWIN?', 'A', 'KAILANGAN KO PANG MAGSANAY UPANG IPAKITA ANG AKING TALENTO SA IBA GAYA NG KANYANG PAMILYA, KAMG-ANAK AT KAIBIGAN PARA HINDI MATAKOT AT MAHIYA SA HARAP NG MARAMING TAO.', 'IISIPIN KO NA AKO ANG PINAKAMAGALING SA PAGSAYAW SA AMING PAARALAN.', 'MAGDARASAL AT SASABIHIN SA SARILI NA : “MAGTITIWALA AKO SA AKING SARILI NA KAYA KONG HARAPIN AT LAGPASAN ANG AKING KAHINAAN”.', 'HIHINGI AKO NG TULONG SA AKING MGA KAPATID AT MAGULANG NA SAMAHAN AKO SA TUWING MAY PAGTATANGHAL.', 'TEST I', ''),
(351, 'EDU-07131ST1ST1', 4, 'MAGALING KA SA PAGGUHIT. NALAMAN MONG MAY CONTEST SA PAGGUHIT ANG IYONG PAARALAN. DAPAT KA BANG SUMALI?', 'A', 'OO, SAPAGKAT MAGPAPATURO AT MAGPAPATULONG AKO SA AKING KUYA.', 'HINDI DAHIL NAHIHIYA AKO', 'OO, PARA ANG AKING KAKAYAHAN AT TALENTO AY PATULOY NA MALINANG.', 'HINDI, DAHIL WALA AKONG TIWALA SA AKING SARILI.', 'TEST I', ''),
(352, 'EDU-07131ST1ST1', 5, 'BAKIT MAHALAGANG TUKLASIN AT PAUNLARIN MO ANG MGA ANGKING TALENTO AT KAKAYAHAN?', 'C', 'UPANG MAGKAROON KA NG TIWALA SA SARILI.', 'UPANG MALAMPASAN MO ANG IYONG MGA KAHINAAN.', 'UPANG MAISAKATUPARAN MO ANG MGA TUNGKULIN MO SA SARILI, LIPUNAN AT SA DIYOS.', 'UPANG HANGAAN KA NG MARAMING TAO.', 'TEST I', ''),
(353, 'EDU-07131ST1ST1', 6, 'NAKAPAG-ARAL KA NG IYONG ARALIN PARA SA DARATING NA PAGSUSULIT. BINULUNGAN KA NG IYONG KAIBIGAN NA MANGONGOPYA NA LANG SIYA SAYO KASI HINDI SIYA NAKAPAGARAL. ALIN SA MGA SUMUSUNOD ANG DAPAT MONG GAWIN.?', 'C', 'HUWAG SIYANG PANSININ.', 'HINDI PAGBIGYAN ANG BULONG NG KAIBIGAN.', 'SASABIHIN NA HINDI MAAARING MANGOPYA AT TUTULUNGAN NA LANG NA SIYA AY MAG-ARAL PARA SA SUSUNOD NA PAGSUSULIT.', 'PAGBIGYAN ANG HILIG NG KAKLASE SA KONDISYON NA PAKOPYAHIN DIN SIYA SA SUSUNOD NA PAGSUSULIT.', 'TEST I', ''),
(354, 'EDU-07131ST1ST1', 7, 'IKAW AY ISANG ISKOLAR SA ISANG PAARALAN NG MARIKINA. NAPALILIGIRAN KA NG MGA MAYAYAMAN NA KAMAG-ARAL. LABIS ANG IYONG PAGKABALISA DAHIL ALAM MONG HINDI KA MAKAKASABAY SA KANILA SA MARAMING BAGAY. ALIN SA MGA SUMUSUNOD ANG DAPAT MONG GAWIN?', 'C', 'MAKIKIPAGKAIBIGAN LAMANG SIYA SA MGA KAPWA NI ISKOLAR NA MAHIRAP DIN.', 'MAKISAMA SA LAHAT NG KAMAG-ARAL.', 'IPAKITA ANG TOTOONG PAGKATAO', 'HUWAG NG MAKISALAMUHA SA KAHIT KANINO.', 'TEST I', ''),
(355, 'EDU-07131ST1ST1', 8, 'SA IYONG PAG-AARAL AY LAGI KANG KINUKUTYA NG IYONG MGA MAG-AARAL NA MAHINA SA KLASE. ALIN SA MGA SUMUSUNOD ANG DAPAT MONG HUBUGIN SA IYONG SARILI?', 'D', 'MAGING POSITIBO AT MAGING MATAPANG ', 'KILALANIN ANG SARILI NG LUBOS', 'MAG-EHERSISYO', 'MAGKAROON NG TIWALA SA SARILI PARA SA PAGPAPASYA.', 'TEST I', '<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n'),
(356, 'EDU-07131ST1ST1', 9, 'PALAGI KANG SUMASALI SA MGA PALIGSAHAN NG LARONG CHESS SA IYONG PAARALAN NOONG IKAW AY NASA ELEMENTARYA PA LAMANG AT PALAGI KA DIN NAGWAWAGI. PAGKATUNGTUNG MO NG IKA-PITONG BAITING AY NAISALI KA ULIT SA PALIGSAHAN NG CHESS AT DITO AY NAKATIKIM KA NG UNANG PAGKATALO. ALIN SA MGA SUMUSUNOD ANG DAPAT MONG MAGING REAKSIYON?', 'A', 'TANGGAPIN ANG PAGKATALO AT BABAWI NALANG SA SUSUNOD NA PALIGSAHAN.', 'PAGAARALAN KO ANG AKING NAGING KAHINAAN.', 'IIYAK NA LAMANG AT HINDI NA SASALI SA SUSUNOD NA PALIGSAHAN.', 'MAKIKIPAG-AWAY', 'TEST I', ''),
(357, 'EDU-07131ST1ST1', 10, 'SA YUGTO NG PAGDADALAGA AY PINIPILIT NA NI JOCELYN NA MAGKAROON NG KASINTAHAN. ANG PANGUNGUSAP AY _________ .', 'B', 'TAMA, SAPAGKAT MAHALAGANG MAMULAT ANG MGA NAGDADALAGA SA PAGBUO NG RELASYON.', 'MALI, SAPAGKAT MAHALAGANG MASUKAT MUNA ANG KAHANDAAN NG ISIP AT DADAMIN SA PAGHAWAK NG ISANG SERYOSONG RELASYON.', 'MALI, SAPAGKAT HINDI PA MAAARING MAGKAROON NG SERYOSONG RELASYON ANG ISANG DALAGA.', 'TAMA, SAPAGKAT MAKAKATULONG ITO SA KANYA UPANG MAGING HANDA AT MATUTONG HUMAWAK NG SERYOSONG REALSYON.', 'TEST I', ''),
(358, 'EDU-07131ST1ST1', 11, 'SI JOSHUA AY LAGING MASAYA AT NAKAALALAY SA KANYANG INA SA NAGHAHANDA NG KANILANG LULUTUING PAGKAIN. MINSAN NAG INBENTO SIYA NG PAGKAIN. NAPAHANGA ANG KANYANG MAGULANG SA INIHANDANG PAYAK NGUNIT MASUSTANSYANG PAGKAIN ANO ANG MAAARING IBUNGA NITO SA KANYANG PAG-AARAL, HANAPBUHAY O NEGOSYO SA HINAHARAP?', 'C', 'MAKATUTULONG ANG KANYANG HILIG SA PAGKAKAROON NG TIWALA SA SARILI.', 'MAS GAGALING SI JOSHUA SA KANYANG HILIG DAHIL SA PATULOY NA PAGSASANAY DITO.', 'ANG KANYANG HILIG AY MAY KAUGNAYAN SA PIPILIIN NIYANG KURSO CULINARY ARTS SA HINAHARAP.', 'ANG HILIG NI JOSHUA AY MAGBIBIGAY SA KANYA NG MATIBASYON SA PAG-AARAL.', 'TEST I', ''),
(359, 'EDU-07131ST1ST1', 12, 'HILIG NI DIEGO ANG MAG-ALAGA NG MGA ASO, KAHIT ASONG LIGAW AY KANYANG DINADALHAN NG PAGKAIN, GINAGAMOT KUNG MAY SUGAT AT PINAPALIGUAN. DALAWANG BESES NA DING NANGANAK ANG KANYANG ASO, SIYA DIN ANG NAGPAANAK. ISANG ARAW NAKITA NIYA NA UNTI UNTING LUMALAKI ANG BUKOL SA DIBDIB NG ALAGANG NIYANG ASO NA SI YZA KAYA INARAL NIYA ITO SA INTERNET. NA KANYANGMALAMAN ANG SANHI, TINAWAGAN NIYA ANG KANYANG MGA KAPAMILYA AT KAIBIGAN, NAG-IPON DIN SIYA NG PERA UPANG MAPATANGGAL NIYA ITO SA VETERINARIAN DOCTOR.  SA IYONG OPINYON, ANO ANG KANYANG MAAARING KUNING PROPESYON PAGDATING NG TAMANG PANAHON? ', 'B', 'PSYCHOLOGIST', 'VETERINARY SOCIAL WORKER', 'DOCTOR NG MGA HAYOP', 'PAGNENEGOSYO', 'TEST I', ''),
(360, 'EDU-07131ST1ST1', 13, 'KUNG SI MIKA AY LAGING KASAMA NG KANYANG INA SA PAGNENEGOSYO AT MASAYA SIYANG TAGA TALA NA ARAW-ARAW NA BENTA AT GASTOS NG KANILANG 3 TINDAHAN. ALIN SA MGA SUMUSUNOD ANG ANGKOP NA PARAAN UPANG MAPAUNLAD NI MIKA ANG KANYANG HILIG KA? ', 'A', 'DAGDAGAN ANG KAALAMAN SA PAMAMAGITAN NG PANONOOD SA YOU TUBE PATUNGKOL SA COMPUTATIONAL SA EXCEL NA MAY FORMULA UPANG MAPABILIS ANG PAGTATALA.', 'GUMAMIT NG CALCULATOR', 'I-TALA SA SPREAD SHEET. ', 'ITAGO LAHAT NG RESIBO SA ISANG ENVELOP UPANG ITALA KADA LINGGO.', 'TEST I', ''),
(361, 'EDU-07131ST1ST1', 14, 'SI JONNA AT LEO AY MAGKAIBIGAN NA MAHILIG GUMUHIT NG LARAWAN GAMIT ANG COMPUTER. ALIN SA MGA SUMUSUNOD NA PAGPAPAUNLAD SA SARILI ANG NARARAPAT NILANG GAWIN?', 'A', 'ALAMIN ANG IBAT-IBANG ISTRATEHIYA AT MAGSANAY SA PAGGUHIT NITO.', 'MAGPOST SA MEDIA NG MGA NAILARAWAN UPANG PAGKAKITAAN.', 'MAGSANAY NA NGAYON AT MAGPLANO NA MAG-ENROLL NG ARTS AND DESIGN TRACK SA SHS.', 'MANOOD NG MGA PALABAS SA YOU TUBE.', 'TEST I', ''),
(362, 'EDU-07131ST1ST1', 15, 'ANO ANG PINAKAMAHALAGANG MAITUTULONG NG PAGKAKAROON NG BAGAY O GAWAIN NA KINAHIHILIGAN PARA SA PAGHAHANDA SA KUKUNING KURSO SA KOLEHIYO ?', 'B', 'MAKATUTULONG ANG HILIG UPANG MAKAKUHA NG TRABAHONG MAKAPAGBIBIGAY NG KASIYAHAN SA HINAHARAP.', 'MAKATUTULONG ANG HILIG UPANG MAPILI ANG ANGKOP NA KURSONG PANGAKADEMIKO O TEKNIKAL-BOKASYONAL', 'MAGTUTULAK ANG PAGKAKAROON NG KINAHIHILIGAN UPANG MAKAMIT ANG LABIS NA TAGUMPAY SA HINAHARAP.', 'MAKATUTULONG ANG HILIG UPANG MATIYAK NA MAIPAKIKITA ANG GALING SA PAG-AARAL UPANG MAITAAS ANG ANTAS NG PAGKATUTO', 'TEST I', ''),
(363, 'EDU-07131ST1ST1', 16, 'ALIN SA MGA PANGUNGUSAP ANG HIGIT NA NAGPAPAKITA NG PAGGANYAK SA IYO NA KUMILOS AT GUMAWA UPANG MAPAUNLAD ANG HILIG?', 'D', 'SI DENNIS HABANG GUMAGAWA AY HINDI NAPAPANSIN ANG ORAS.', 'SINA JOSHUA AT TONNIE AY MASAYA HABANG GUMAGAWA.', 'SI RAMON AY TINGIN NG TINGIN SA ORAS AT NAKIKIPAGKWENTUHAN SA KASAMAHAN.', 'SI LITO KAHIT MALIIT ANG SINIMULANG SWELDO AY MAKIKITA ANG KAWILIHAN SA PAGGAWA.', 'TEST I', ''),
(364, 'EDU-07131ST1ST1', 17, 'ALIN SA MGA SUMUSUNOD NA PALATANDAAN NG GAWAIN ANG HIGIT NA NAGBIBIGAY KASIYAHAN?', 'B', 'MATAMLAY HABANG GUMAGAWA.', 'HINDI NAKAKADAMA NG PAGKAINIP HABANG GUMAGAWA.', 'LAGING GINAGAWA SA LIBRENG ORAS', 'PATULOY GINAGAWA ANG ISANG BAGAY.', 'TEST I', ''),
(365, 'EDU-07131ST1ST1', 18, 'BAKIT KAILANGANG TUGMA ANG HILIG SA KURSONG KUKUNIN SA KOLEHIYO?', 'A', 'PALATANDAAN ITO NG MGA URI NG TRABAHO NA MAGBIBIGAY NG KASIYAHAN AT KAGANAPAN SA IYO BILANG TAO.', 'MAGBIBIGAY KAHULUGAN ITO SA BAWAT PANG-ARAW-ARAW NA GAWAIN.', 'MAKAPAGPAPAUNLAD ITO NG TALENTO AT KAKAYAHAN.', 'MAKATUTULONG ITO UPANG MATUKOY ANG BAGAY NA NAIS MONG GAWIN SA IYONG LIBRENG ORAS', 'TEST I', ''),
(366, 'EDU-07131ST1ST1', 19, 'ANG TAONG MATAGUMPAY AY MASAYANG NAGSISIKAP NA ______.', 'C', 'SIYASATIN ANG GAWAING PINILI.', 'IPINAGSASABI ANG GINAGAWA', 'MATAPOS AT IPINAGMAMALAKI ANG GINAWA', 'IPINAGYAYABANG ANG GINAGAWA', 'TEST I', ''),
(367, 'EDU-07131ST1ST1', 20, 'ANG TAONG NAGPAPAHALAGA SA PAGPAPAUNLAD NG ANG MGA HILIG AY______', 'D', 'GINAGAWA SA LIBRENG ORAS.', 'NAGBABASA NG PARAAN NG PAGPAPAUNLAD', 'SINISIYASAT ANG GAWING PINILI', 'NAGLALAAN NG PANAHON UPANG MAPAUNLAD ITO.', 'TEST I', '<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Ginagawa sa libreng oras.</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Nagbabasa ng paraan ng pagpapaunlad</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Sinisiyasat ang gawing pinili</span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Naglalaan ng panahon upang mapaunlad ito.</span></span></span></span></li>\r\n</ol>\r\n'),
(368, 'EDU-07131ST1ST1', 21, 'NAPATUTUNAYAN NA ANG PAGTUKLAS AT PAGPAPAUNLAD NG MGA ANGKING TALENTO AT KAKAYAHAN AY MAHALAGA SAPAGKAT ANG MGA ITO AY MGA KALOOB NA KUNG PAUUNLARIN AY MAKAHUHUBOG NG SARILI TUNGO SA _____________', 'A', 'PAGKAKAROON NG TIWALA SA SARILI.', 'PAGIGING MALIKHAIN AT MAPAMARAAN.', 'PAGIGING SIKAT AT MATAGUMPAY SA BUHAY.', 'PAGKAKAROON NG MAS MALAKING KAYAMANAN.', 'TEST I', ''),
(369, 'EDU-07131ST1ST1', 22, 'ALIN SA MGA SUMUSUNOD ANG PANGUNAHING DAHILAN BAKIT NASASABI NG ILANG TAO NA SILA AY IPINANGANAK NA WALANG TALENTO?', 'A', 'DAHIL HINDI SILA NAGLAAN NG PANAHON UPANG ITO AY TUKLASIN.', 'DAHIL MAYROON TALAGANG TAO NA IPINANGANAK NA WALANG TALENTO.', 'DAHIL HINDI NILA KINIKILALA ANG KANYANG MGA KAKAYAHAN AT TALENTO.', 'DAHIL HINDI PA PANAHON UPANG MATUKLASAN NILA ANG KANILANG TALENTO.', 'TEST I', '<p>??????</p>\r\n'),
(370, 'EDU-07131ST1ST1', 23, 'SI VENIZE AY MAGALING SA LARANGAN NG PAG-AWIT NGUNIT SA TUWING MAY PATIMPALAK AY  NAGDADALAWANG-ISIP SIYA SA PAGSALI. ANO ANG DAPAT NIYANG GAWIN? ', 'B', 'KAUSAPIN ANG KANYANG MGA KAIBIGAN AT HINGIN ANG KANILANG OPINION SA PAGSALI.', 'HINGIN ANG GABAY MULA SA DIYOS AT GAMITIN ANG PINAGKALOOB NA TALENTO MULA SA KANIYA.', 'HINDI NA LANG SASALI SA ANO MANG PATIMPALAK AT ITATAGO NA LAMANG SA SARILI ANG ANGKING TALENTO.', 'IPAGLILIBAN MUNA ANG NASABING PATIMPALAK AT KAPAG HANDA NA ANG SARILI SAKA LAMANG SASALI SA MGA PATIMPALAK.', 'TEST I', '<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n'),
(371, 'EDU-07131ST1ST1', 24, 'MULA SA ISANG PRIBADONG PAARALAN LUMIPAT SI JEAN SA PAMPUBLIKONG PAARALAN.  BIHIRA  SIYA MAKIPAG-USAP DAHIL TAKOT AT HINDI SANAY MAGSALITA NG TAGALOG. NGUNIT SA PINANGGALINGAN NA PAARALAN SIYA AY PANLABAN SA LAHAT NG LARANGAN AT NAGKAMIT NG UNANG KARANGALAN. PAKIRAMDAM NIYA AYAW SA KANIYA NG MGA KAMAG-ARAL NIYA. ANO ANG NARARAPAT GAWIN NI JEAN? ', 'D', 'TATAHIMIK NA LANG SA LOOB NG KLASE.', 'HINDI IINTINDIHIN ANG MGA KAMAG-ARAL.', 'WALANG GAGAWIN NA HAKBANG AT MAG-AARAL NG MAG-ISA.', 'MAGKAROON NG ISANG POSITIBONG PAKIKIPAG- UGNAYAN SA SARILI AT PAGTANGGAP SA HAMON MULA SA IBANG TAO.', 'TEST I', '<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n'),
(372, 'EDU-07131ST1ST1', 25, 'SI ALDRICH AY LIKAS NA MAHIYAIN SA HARAP NG MARAMING TAO KAHIT ITO AY MAHUSAY  MAGBIGAY NG KANYANG PANANALITA. PAANO MALALAMPASAN NIYA ANG GANITONG PANGYAYARI?', 'D', 'MAGSASALITA SA HARAP NG TAO KAHIT NAKAYUKO ANG ULO.', 'PALAGI NA LANG TATANGGIHAN ANG MGA IMBITASYON SA PANANALITA.', 'IBIBIGAY KO NA LAMANG SA TAGAPAGSALITA NG PROGRAMA ANG NAIS KONG SABIHIN NA PARTE NG PROGRAMA.', 'SA LOOB NG BAHAY HAHARAP SA SALAMIN AT MAG-EENSAYO PARA MABAWASAN ANG PAGKAMAHIYAIN ILALAGAY SA ISIP NA “KAYA KO! MAPAGTATAGUMPAYAN KO ANG PAGHARAP SA MARAMING TAO”.', 'TEST I', '<p style=\"margin-left:48px\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>\r\n'),
(373, 'EDU-07131ST1ST1', 26, 'KUNG ANG ISANG TAO AY MAHILIG SA MUSIKA, PAGBABASA NG LIBRO AT PANONOOD NG MOVIES, ANO ANG PINAKA MALAPIT NA NEGOSYO O HANAPBUHAY SA KANYA MULA SA MGA PAGPIPILIAN?', 'A', 'MUSICAL NOVELIST', 'MANG-AWIT', 'LIBRARIAN', 'TALENT SCOUT', 'TEST I', ''),
(374, 'EDU-07131ST1ST1', 27, 'SI CYNTHIA AY MAHILIG MAGLUTO AT GUSTO NIYA NA MAGING ISANG CHEF BALANG ARAW. ALIN SA MGA SUMUSUNOD NA PAGPAPAUNLAD SA SARILI ANG NARARAPAT NIYANG GAWIN?', 'A', 'ALAMIN ANG IBAT-IBANG LUTO AT MAGSANAY NA LUTUIN ITO.', 'MAGHANAP NG TRABAHO SA ISANG RESTAURANT PARA MATUTO AT MASANAY.', 'MAGSANAY NA NGAYON AT MAGPLANO NA MAG-ENROLL NG COOKERY SA SHS.', 'MANOOD NG MGA PALABAS SA TV', 'TEST I', ''),
(375, 'EDU-07131ST1ST1', 28, 'SI FRED AY MAHILIG MANGOLEKTA NG BATO DAHIL GUSTO NYANG PAG-ARALAN ANG KASAYSAYAN NITO. ANG LARANGAN NG KANYANG HILIG AY OUTDOOR NA MAY TUON SA DATOS. ANO ANG POSIBLENG MAGING PROPESYON NYA BALANG ARAW?', 'B', 'PAGMIMINA', 'MANANALIKSIK NA MAY KINALAMAN SA ARKEOLOHIYA', 'PWEDE NYANG GAWIN ANG “LITHIC ANALYSIS”. ITO AY ANG PAG-AARAL NG MGA SINAUNANG GAMIT NA GAWA SA BATO, ISA SA MGA GINAGAWA NG MGA ARKEOLOGO O ARCHEOLOGIST.', 'PAGTATAYO NG BAHAY SA BATO', 'TEST I', ''),
(376, 'EDU-07131ST1ST1', 29, 'ALIN SA MGA PANGUNGUSAP ANG NAGPAPAKITA NG KAHALAGAHAN NA MAPAUNLAD ANG ATING HILIG?', 'A', 'KAILANGANG PAGLAANAN NATIN NG ORAS ANG ATING HILIG.', 'ANG HILIG AY MAAARING MATUTUHAN NATIN SA ATING KARANASAN KAYA NAPAPAUNLAD NATIN ITO.', 'ANG HILIG AY MAAARING MAMANA, HINDI NA ITO KAILANGANG PAUNLARIN.', 'AYON SA MGA PAG-AARAL, ANG PAGLALAAN NG ORAS PARA SA MGA BAGAY NA ATING NAIS AT GUSTONG GAWIN AY NAKATUTULONG SA PAGPAPAUNLAD NG ATING PAGKATAO.', 'TEST I', ''),
(377, 'EDU-07131ST1ST1', 30, 'SI REA AY MAHILIG SA PAG-AWIT AT PAGSUSULAT NG MGA KANTA. ANO ANG LARANGAN AT TUON NG   HILIG NI REA?', 'B', 'LARANGAN: MUSICAL - TUON: IDEYA, TAO', 'LARANGAN: MUSICAL, LITERARY - TUON: IDEYA', 'LARANGAN: MUSICAL, ARTITISTIC - TUON: TAO, IDEYA', 'LARANGAN: MUSICAL, LITERARY - TUON: TAO, IDEYA, DATOS', 'TEST I', ''),
(378, 'EDU-07131ST1ST1', 31, 'SI JOSEPH AY MAHILIG SA PAG-EHERSISYO SA LABAS NG BAHAY, KATULAD NG JOGGING O BIKING KASAMA NG MGA KAIBIGAN.', 'A', 'LARANGAN: OUTDOOR – TUON: TAO', 'LARANGAN: PERSUASIVE – TUON: TAO', 'LARANGAN: OUTDOOR – TUON: BAGAY, TAO', 'LARANGAN: SOCIAL SERVICE – TUON: TAO', 'TEST I', '<ol start=\"31\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Si Joseph ay mahilig sa pag-ehersisyo sa labas ng bahay, katulad ng jogging o biking kasama ng mga kaibigan.</span></span></span></span></span></li>\r\n</ol>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: outdoor &ndash; Tuon: tao</span></span></span></strong></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: persuasive &ndash; Tuon: tao</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: outdoor &ndash; Tuon: bagay, tao</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: social service &ndash; Tuon: tao&nbsp;&nbsp; </span></span></span></span></span></li>\r\n</ol>\r\n');
