(379, 'EDU-07131ST1ST1', 32, 'NATUTUWA SI TINO KAPAG NAKIKITA NYA ANG KANYANG AMA NA NAGKUKUMPUNI SA BAHAY. ISANG ARAW AY SINUBUKAN NYANG GAMITIN ANG LAGARE, MARTILYO AT PAKO PARA AYUSIN ANG KANYANG LAMESA.', 'C', 'LARANGAN: SCIENTIFIC – TUON: BAGAY, IDEYA', 'LARANGAN: ARTISTIC – TUON: IDEYA', 'LARANGAN: MECHANICAL – TUON: BAGAY', 'LARANGAN: MECHANICAL – TUON: TAO  ', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Natutuwa si Tino kapag nakikita nya ang kanyang ama na nagkukumpuni sa bahay. Isang araw ay sinubukan&nbsp;</span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">nyang gamitin ang lagare, martilyo at pako para ayusin ang kanyang lamesa.</span></span></span></span></span></p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: Scientific &ndash; Tuon: bagay, ideya</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: artistic &ndash; Tuon: ideya</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: mechanical &ndash; tuon: bagay</span></span></span></strong></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: mechanical &ndash; Tuon: tao&nbsp;&nbsp; </span></span></span></span></span></li>\r\n</ol>\r\n'),
(380, 'EDU-07131ST1ST1', 33, 'MAGALING SI SALLY SA PAG-IISIP NG MGA STRATEHIYA KAYA GILIW NA GILIW SIYA SA PAGLALARO NG CHESS.', 'D', 'LARANGAN: SCIENTIFIC – TUON: IDEYA', 'LARANGAN: SCIENTIFIC, COMPUTATIONAL – TUON: BAGAY, IDEYA', 'LARANGAN: COMPUTATIONAL – TUON: TAO, BAGAY, IDEYA', 'LARANGAN: COMPUTATIONAL – TUON: IDEYA', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Magaling si Sally sa pag-iisip ng mga stratehiya kaya giliw na giliw siya sa paglalaro ng chess. </span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;A. &nbsp;&nbsp;&nbsp;Larangan: Scientific &ndash; Tuon: ideya</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;B. &nbsp;&nbsp;&nbsp;Larangan: Scientific, computational &ndash; Tuon: bagay, ideya</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;C.&nbsp;&nbsp; &nbsp;Larangan: computational &ndash; Tuon: tao, bagay, ideya</span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;D. &nbsp;&nbsp;&nbsp;<strong>Larangan: computational &ndash; Tuon: ideya</strong></span></span></span></span></span></p>\r\n'),
(381, 'EDU-07131ST1ST1', 34, 'SI JULIE AY NASISIYAHAN SA PAGTUKLAS NG MGA BAGONG LUTO O PUTAHE. PALAGI SIYANG NAGSASANAY MAGLUTO  UPANG SUBUKAN ANG IBAT-IBANG SANGKAP NA KANYANG SINUSUBUKANG PAGHALUIN.', 'A', 'LARANGAN: SCIENTIFIC – TUON: IDEYA', 'LARANGAN: ARTISTIC – TUON: BAGAY', 'LARANGAN: SCIENTIFIC, ARTISTIC – TUON: TAO, IDEYA', 'LARANGAN: SOCIAL SERVICE – TUON: TAO', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Si Julie ay nasisiyahan sa pagtuklas ng mga bagong luto o putahe. Palagi siyang nagsasanay magluto&nbsp;&nbsp;</span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">upang subukan ang ibat-ibang sangkap na kanyang sinusubukang paghaluin.</span></span></span></span></span></p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: Scientific &ndash; Tuon: ideya</span></span></span></strong></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: artistic &ndash; Tuon: bagay</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: Scientific, artistic &ndash; Tuon: tao, ideya</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Larangan: Social Service &ndash; Tuon: tao</span></span></span></span></span></li>\r\n</ol>\r\n'),
(382, 'EDU-07131ST1ST1', 35, 'SI DENNIS AY MAHILIG SA COMPUTER. HABANG SYA AY LUMALAKI AT NAG-AARAL, TUMUTULONG SIYA SA PAARALAN BILANG  COMPUTER LABORATORY ASSISTANT. ANO ANG KAUGNAYAN NITO SA KANYANG PAG-AARAL, HANAPBUHAY O NEGOSYO SA HINAHARAP?', 'C', 'ANG HILIG NI MARK AY MAGBIBIGAY SA KANYA NG KASIYAHAN HABANG NAG-AARAL', 'MAS GAGALING SI MARK SA KANYANG HILIG DAHIL SA PATULOY NA PAGSASANAY DITO.', 'ANG KANYANG HILIG AY MAY KAUGNAYAN SA PIPILIIN NIYANG KURSO SA HINAHARAP.', 'MAKATUTULONG ANG KANYANG HILIG SA PAGKAKAROON NG TIWALA SA SARILI.', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Si Dennis ay mahilig sa computer. Habang sya ay lumalaki at nag-aaral, tumutulong siya sa paaralan bilang &nbsp;</span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">computer laboratory assistant. Ano ang kaugnayan nito sa kanyang pag-aaral, hanapbuhay o negosyo sa&nbsp;</span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">hinaharap?</span></span></span></span></p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ang hilig ni Mark ay magbibigay sa kanya ng kasiyahan habang nag-aaral</span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mas gagaling si Mark sa kanyang hilig dahil sa patuloy na pagsasanay dito.</span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ang kanyang hilig ay may kaugnayan sa pipiliin niyang kurso sa hinaharap.</span></span></strong></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Makatutulong ang kanyang hilig sa pagkakaroon ng tiwala sa sarili.</span></span></span></span></li>\r\n</ol>\r\n'),
(383, 'EDU-07131ST1ST1', 36, 'ALIN SA MGA SUMUSUNOD ANG PINAKAMATAAS NA TUNGKULIN NG ISANG ANAK SA KANYANG MAGULANG?', 'A', 'SILA AY IGALANG, MAHALIN AT PAGKATIWALAAN', 'ANG MAGSILBING ISANG HALIMBAWA SA KANYANG MGA KAPATID', ' IBALIK SA KANILA ANG KATUMBAS NG KANILANG NAIBIGAY SIMULA NA IKAW AY IPINANGANAK', ' HUWAG PAGDAMUTAN ANG PAGTULONG SA IYONG PAMILYA', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Alin sa mga sumusunod ang pinakamataas na tungkulin ng isang anak sa kanyang magulang?</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A. &nbsp;&nbsp;&nbsp;<strong>Sila ay igalang, mahalin at pagkatiwalaan</strong></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; B.&nbsp; &nbsp;&nbsp;Ang magsilbing isang halimbawa sa kanyang mga kapatid</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; C.&nbsp; &nbsp;&nbsp;Ibalik sa kanila ang katumbas ng kanilang naibigay simula na ikaw ay ipinanganak</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D.&nbsp;&nbsp;&nbsp; Huwag pagdamutan ang pagtulong sa iyong pamilya.&nbsp;&nbsp; </span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(384, 'EDU-07131ST1ST1', 37, 'MAHALAGANG MAUNAWAAN NA ANG BAWAT TAO AY MAY INAASAHANG KAKAYAHAN AT KILOS SA BAWAT YUGTO NG BUHAY NA DAPAT TUGUNAN O GAMAPANAN UPANG', 'D', 'MALINANG ANG KANYANG TALENT AT KAKAYAHAN', 'MAGING HUWARAN SIYA SA LIPUNANG KANYANG GINAGALAWAN', 'MAGAWA ANG INAASAHAN SA KANYA NG  MGA MAGULANG', 'MAS LALO PA SIYANG MAGPURSIGE SA PAG-ABOT NG KANYANG PANGARAP AT MAGING RESPONSABLENG  MAMAMAYAN.', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mahalagang maunawaan na ang bawat tao ay may inaasahang kakayahan at kilos sa bawat yugto ng buhay na&nbsp;</span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">dapat tugunan o gamapanan upang </span></span></span></span></p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Malinang ang kanyang talent at kakayahan </span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Maging huwaran siya sa lipunang kanyang ginagalawan </span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Magawa ang inaasahan sa kanya ng&nbsp; mga magulang</span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mas lalo pa siyang magpursige sa pag-abot ng kanyang pangarap at maging responsableng&nbsp; mamamayan. </span></span></strong></span></span></li>\r\n</ol>\r\n'),
(385, 'EDU-07131ST1ST1', 38, 'ANG PAGTAMO NG BAGO AT GANAP NA PAKIKIPAG-UGNAYAN SA MGA KASING-EDAD SA PANAHON NG PAGDADALAGA AT PAGBIBINATA AY MAHALAGA UPANG ______ .', 'C', 'MAGKAROON NG KALARO NA MAGTUTURO NG PAKIKIPGA-UGNAYAN SA KASING EDAD.', 'MASIGURO NA MAYROONG TAONG TATANGGAP SA KANYANG MGA KALAKASAN AT KAHINAAN', 'MAPATUNAYAN SA LAHAT NG TAO ANG KAKAYAHANG MAKIKIPAG-UGNAYAN NANG MAAYOS SA KASING EDAD.', 'MAGKAROON NG MAKAKASUNDO NA TUTULONG UPANG MATANGGAP SA ISANG PANGKAT NA LABAS SA KANYANG PAMILYA', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ang pagtamo ng bago at ganap na pakikipag-ugnayan sa mga kasing-edad sa panahon ng pagdadalaga at&nbsp;</span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">pagbibinata ay mahalaga upang ______</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp; A. &nbsp;&nbsp;&nbsp;&nbsp;Magkaroon ng kalaro na magtuturo ng pakikipga-ugnayan sa kasing edad.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp; B. &nbsp;&nbsp;&nbsp;&nbsp;Masiguro na mayroong taong tatanggap sa kanyang mga kalakasan at kahinaan </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp; C.&nbsp;&nbsp; &nbsp;&nbsp;<strong>Mapatunayan sa lahat ng tao ang kakayahang makikipag-ugnayan nang maayos sa kasing edad</strong></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp; D.&nbsp;&nbsp;&nbsp;&nbsp; Magkaroon ng makakasundo na tutulong upang matanggap sa isang pangkat na labas sa kanyang pamilya</span></span></span></span></p>\r\n'),
(386, 'EDU-07131ST1ST1', 39, 'SI JENNY AY ISANG ISKOLAR SA ISANG PAMANTASANG KUNG SAAN NAPAPALIGIRAN SIYA NG MGA MAYAYAMAN NA MAG-AARAL. ALAM NIYA SA KANYANG SARILI NA HINDI NIYA KAYANG MAKISABAY SA MGA ITO. ANO ANG PINAKAMAINAM NA GAWIN NI LONA?', 'C', 'UMIWAS SA MGA ITO', 'MANAHIMIK AT ITUON NA LANG ANG SARILI SA PAG-AARAL', 'MAKIPAGKAIBIGAN SA KANILA AT MAGING TOTOO SA MGA ITO', 'MAGING TOTOO SA SARILI  ', 'TEST I', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Si Jenny ay isang iskolar sa isang pamantasang kung saan napapaligiran siya ng mga mayayaman na mag-aaral.&nbsp;</span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Alam niya sa kanyang sarili na hindi niya kayang makisabay sa mga ito. Ano ang pinakamainam na gawin ni&nbsp;</span></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Lona?</span></span></span></span></p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Umiwas sa mga ito</span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Manahimik at ituon na lang ang sarili sa pag-aaral</span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Makipagkaibigan sa kanila at maging totoo sa mga ito</span></span></strong></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Maging totoo sa sarili &nbsp;</span></span></span></span></li>\r\n</ol>\r\n'),
