INSERT INTO `news` (`nid`, `y`, `dateposted`, `pic`, `newstitle`, `author`, `newscontent`, `likes`, `views`, `ymd`) VALUES
(1, 2017, 'November 29, 2017', 'fabian.jpg', 'JDPNHS wins first place in ESP division poster making contest', 'By Cristina Sison Barde', '<p><i><b>Christian Aaron Fabian</b></i>, a Grade 10 student won first place in the recently concluded ESP Division Contest in Poster Making held at Concepcion Elementary School, Nov. 28, 2017.</p>\r\n<p>Edukasyon sa Pagpapakatao Department celebrated Filipino Values month with the theme, Pagkakaisa at pagkamahinahon: Tugon sa Mapanghamon at Makabagong Panahon. Poster Making Contest was joined by 15 student participants. Other contests were Bible Quiz, Tagis Talino, Jingle and Slogan Making.</p>\r\n<p>Awarding of winners was held the same day.</p>', '2', '13', '2017-11-29'),
(2, 2017, 'December 09, 2017', 'alynna.jpg', 'Dela Penian snatched 1<sup>st</sup> place in PMHA’s on the spot essay writing contest', 'By Cristina Sison Barde', '<p>“Promoting Mental health isn’t only about sanity but focuses on one’s individuality.”</p>\r\n<p>Another Dela Penian, <i><b>Alyanna B. Castillo</b></i>, triumphantly snatched 1<sup>st</sup> place in “On the Spot Essay Writing Contest” by Philippine Mental Health Association held in Marikina High School last October. This was joined by Secondary Schools in Marikina City.</p>\r\n<p>According to her, “It was quite challenging for me to write about the theme –The use of social media in promoting mental health. I don’t really have much idea about it especially mental health. Thanks to Ma’am Agnes for orienting me and of course to God for I was able to win.”</p>', '2', '15', '2017-12-09'),
(3, 2017, 'December 12, 2017', 'aducal.jpg', 'JDPNHS ranks 2<sup>nd</sup> in MADAC on-the-spot poster making contest', 'By Manuel O. Aydinan', '<p><i><b>Robert Ariel Aducal</b></i> of Grade 11 - Lynx ranked 2<sup>nd</sup> place in the On-the-Spot Poster Making Contest held at Barangka Elementary school on December 8, 2017.</p>\r\n<p>The contest was organized by Marikina Anti-Drug Abuse Council (MADAC) with the theme: Listening to the children and youth is the first step in helping them grow healthy and safety. Twenty participants from different public high schools in Marikina competed to win Php 1,800 for 1st place, Php 1, 400 for 2<sup>nd</sup> place and Php 1, 000 for 3<sup>rd</sup> place. The first placer was from Sta. Elena High School while the Third Placer was from Malanday National High School.</p>\r\n<p>“I wasn’t expecting to win, because the Malanday representative was very talented and often defeated me in these kind of contest,” said Robert Aducal.</p>\r\n<p>All artworks of participants will be displayed at the MADAC office.</p>', '2', '9', '2017-12-12'),
(4, 2017, 'September 13, 2017', 'jdpnhs-e-journ-2017.jpg', 'JDPNHS bags 8 gold medals in 19<sup>th</sup> division schools press conference and contest', 'eBantayog', '<p>Jesus Dela Peña National High School bagged 8 Gold medals in the recently concluded 19<sup>th</sup> Division Schools Press Conference and Contests held at Concepcion Elementary School on September 6.</p> \r\n<p>Announcement of winners and Awarding Ceremony was held at NCLC on September 11 and attended by the eJournalists and School Paper Advisers, Cristina S. Barde and Maru U. Panganiban.</p>\r\n<p>In English category, the winners are: Loraine Grace Bautista, 8<sup>th</sup> place in photojournalism; Aicha R. Sacro, 7<sup>th</sup>place in Feature Writing; and Robert Ariel Aducal, 5<sup>th</sup> place, Editorial Cartooning. While in Filipino Category, we have Angelica Mae Loyola, 2<sup>nd</sup> place, Pagwawasto at Pag-uulo; Remark C. Robas, 2<sup>nd</sup> place, Pagkuha ng Larawan; Leo Verdad, 7<sup>th</sup> place, Pagsulat ng Balita; Justine Rhem D. Oida, 10<sup>th</sup> place, Pagsulat ng Editoryal; and John Matthew A. Alvarez, 10<sup>th</sup> place, Agham at Panteknolohiya.</p>', '3', '11', '2017-09-13'),
(5, 2017, 'November 03, 2017', 'ubt.jpg', 'JDPNHS conducts periodical exam in english using UBT-TMS', 'By Admin', '<p>Jesus Dela Peña National High School conducts its online Periodical Exam using Ubiquitous Based Test-Test Management System(UBT-TMS) for English 7, the first in the Philippines public high school, with the help of EEO Philippines on Oct. 20, 2017.</p> \r\n<p>Approximately 190 Grade 7 students took their test using tablet at the school’s Audio Visual Room under the supervision of Ms. Saranzaya, Korean representative of the EEO Philippines, Ms. Cristina S. Barde, English teacher, and Ms. Jane S. David, Grade 7 class adviser.</p>\r\n<p>On Oct. 17, EEO Philippines team from Korea came for the second session of the eTeachers’ training for UBT-TMS, and to supervise the English Teachers, Cristina Barde, Rhea Zaragosa and Leslie Salceda in uploading the test questions with eLearning Coordinator and Assistant Principal Benedict M. Tabilas.</p> \r\n<p>Mr. Joseph Santos, eLearning Program Head and OIC Principal in JDPNHS said, “This technology enables our eLearning students take the test containing audio, videos and other multimedia using tablet. Add to this, it reduces teachers’ tasks; checking test papers and recording item analysis. We plan to conduct Periodical Exams thru UBT-TMS to all eLearning students in all subjects.”</p>\r\n<p>“This project is a partnership between Schools Division Office (SDO) Marikina and North Star Development Village, also with the help of the City Government. Mayor Marcy Teodoro donated 150 tablets to our school,” he ended.</p>', '1', '6', '2017-12-03'),
(6, 2018, 'February 23, 2018', 'ledesma.jpg', '2018 Battle of ICT wizards <em>\"ICT First. First in ICT\"</em>', 'By Aicha Sacro', '<p>Computer Assisted Learning Philippines held a city-wide public and private interschool competition on February 14, 2018 with the theme: \"ICT first. First in ICT.\" at Sen. Renato Compañero Cayetano Memorial Science and Technology High School, Pamayanang Diego Silang Ususan, Taguig City.</p>\r\n<p><b>Robin Arthur Ledesma</b>, a grade 10 ICT student of Jesus Dela Peña National High School (JDPNHS), represented the Division of Marikina as he battled with the ICT wizards in a Logo Making Contest using Adobe Photoshop. He victoriously snatched the 1<sup>st</sup> place and brought home another honor and achievement for the school.</p>\r\n<p>The win has justified that JDPNHS is a school to contend with when it comes to ICT.</p>', '1', '1', '2018-02-23'),
(7, 2018, 'January 05, 2018', 'filmfest.jpg', 'Have you scene this?', 'By Gabriel Vasquez', '<p>“… life is just one story. The one page called today, this one scene connects with others, overlaps and turns into a story.”</p> \r\n<p>If story line is king then the youth is its queen that steers the kingdom’s direction. It is in high school when students approach the peak of lust for adventure and imagination. This factor, alongside technological advancement, enables these students to become great film makers and create masterpieces.</p>\r\n<p>That’s why the Supreme Student Government decided to propose, adapt and later on implement a very notable event which is the Indite Film Festival. The title holds two definitions, “Indite” which means to compose or produce and the other which is “Indie”, a colloquialism of Independence or Independence, both of which is a total fit to film making. This kind-of-hidden spear carrier is more obvious on the first event poster.</p> \r\n<p>Students were tasked to form their own Production Team and were given three months to create their short-film themed to promote Integrity and respect and is open to all genre. All aspects of art in filming were aimed to be enhanced and performed by the Prod-teams. From directing, acting, cinematography, editing and of course the composition of each own sound-track which is sighted to discourage plagiarism. Something frowned upon by everyone in the art domain.</p>\r\n<p>The official film posters were already released to the public for online voting. All that is left for us to wait and witness are the Official Sound Tracks and the Short Films themselves.</p>', '1', '2', '2018-01-05'),
(8, 2018, 'January 05, 2018', 'bangungot.jpg', 'JDPNHS’ “Bangungot”, best trailer in 3<sup>rd</sup> Metro Manila AHD film festival regional level', 'By Admin', '<p>“Hope vs Risk of Pornography on the Youth of Metro Manila”</p> \r\n<p>The first production team of Jesus Dela Peña National High School named Introspection Production snatched victoriously the Best Trailer award on the 3rd Metro Manila Adolescence Health Disorder(AHD) Film Festival. Forty-three schools from different Divisions in NCR sent their schools to join the said competition, but only 8 official entries competed in the final judging on November 7, 2017.</p>\r\n<p>John Luis Sarmiento, the Bangungot Film Director, said, “Representing JDPNHS is already an honor and winning the Best Trailer definitely gives pride to our team. Winning is not the ultimate goal in this competition what is more important is the knowledge and experience that we gained throughout the journey. I hope that next year JDPNHS will join again to showcase the talent of Dela Penians in filming.“</p> \r\n<p>Aicha Sacro, Carlo Miguel Santos, John Luis Sarmiento and Bangungot were nominated for Best Actress, Best Actor, Best Director and Best Film respectively.</p>', '3', '4', '2018-01-05'),
(9, 2018, 'September 15, 2018', '20th-press-con.jpg', 'eBantayog, nag-uwi ng 6 na gintong medalya', 'Ni Maru U. Panganiban', '<p>Ang mga mag-aaral sa pamamahayag ay muling nag-uwi ng 6 na gintong medalya sa nakaraang 20<sup>th</sup> Division Schools Press Conference and Contests na iginawad sa Mababang Paaralan ng Parang.</p>\r\n<p>Naglaban-laban sa kompitisyong ito ang iba\'t ibang matataas na paaralan sa sangay ng Marikina - ang pribado at publikong mga paaralan. Siyam na kategorya para sa indibidwal na kompitisyon ang pinaglabanan at sa bawat kategorya ay may sampung pinakamahuhusay na mag-aaral ang pinarangalan at siguradong tutungo sa susunod na laban.</p>\r\n<p>Sa pamamahayag sa Filipino, nasungkit ng mga mag-aaral ang mga sumusunod na parangal:</p>\r\n<ul>\r\n<li>Ikawalong Puwesto - Jiro Ignacio (Pagwawasto at Pag-uulo ng Balita),</li>\r\n<li>Ikalawang Puwesto - Christian Aaron (Kartung Pang-Editoryal),</li>\r\n<li>Ikasiyam na Puwesto - Renzo Tante (Pagsulat ng Sports),</li>\r\n<li>Ikasampung Puwesto - Princess Pampilo (Pagsulat ng Kolum)</li>\r\n</ul>\r\n<p>Sa pamamahayag sa Ingles, nasungkit naman ang mga sumusunod na parangal:</p> \r\n<ul>\r\n<li>Ikalimang Puwesto - Jhay-Ef,</li>\r\n<li>Ikasampung Puwesto - Loraine Bautista (Photojournalism)</li>\r\n</ul>\r\n<p>Ang mga mag-aaral na nagwagi ay magiging kinatawan ng dibisyon ng Marikina para sa nalalapit na 2018 Regional Schools Press Conference and Contests na gaganapin sa ika-28 ng Setyembre mismo sa ating lungsod ng Marikina. Ito ay lalahukan ng mga mag-aaral sa iba\'t ibang dibisyon ng mga paaralan sa buong NCR.</p>\r\n<p>Kaya naman, ang kanilang mga tagapayo sa pamamahayag na sina G. Maru U. Panganiban (Filipino) at Gng. Cristina S. Barde (English) ay puspusan ang pag-eensayo sa mga kinatawan ng ating paaralan para sa nalalapit na laban.</p>\r\n<p>Samantala, ang buong suporta ng punongguro na si G. Joseph T. Santos, mga guro, mga kapuwa mag-aaral at mga magulang ang nagbibigay-lakas para sa mga kalahok na gawin ang lahat ng kanilang makakaya at maipakita ang husay at galing ng isang mag-aaral na tatak Jesus Dela Peñan.</p>', '2', '6', '2018-09-15'),
(10, 2018, 'October 08, 2018', 'ribbon_cutting.jpg', 'Inagurasyon ng JDPNHS, pinangunahan ni Mayor Marcelino R. Teodoro', 'Ni Maru U. Panganiban', '<p>Isang makasaysayang “ribbon cutting” ang ginanap noong ika-22 ng Setyembre kasabay ng paggunita para sa ikaapat na taon ng Mataas na Paaralang Pambansa ng Jesus Dela Peña. Ito ay dinaluhan ng mga opisyal ng lungsod ng Marikina sa pangunguna ng butihing Mayor Marcy at ng punong barangay na si Kapitan Ariel Lazaro kasama ang dating ama ng barangay na ngayon ay konsehal, Kon. Manny Sarmiento, mga Sangguniang Kabataan, GPTA, mga mag-aaral at guro, ang masigasig na tagapamanihala ng mga paaralan sa lungsod ng Marikina na si Bb. Sheryl Gayola at ang ama ng eLearning sa Marikina at ngayon ay nagsisilbing OIC ng paaralan na si G. Joseph T. Santos.</p>\r\n<p>Samantala, pagkatapos ng inagurasyon ay ang panunumpa ng mga GPTA para sa kanilang panunungkulan para sa taong 2018-2019. Ito ay sa pamumuno ng nahalal na bagong pangulo ng GPTA na si G. Nathaniel Alvarez.</p>\r\n<p>Pagkatapos ng programa, inisa-isa ni Mayor Marcy ang ilan sa mga plano niya na ibibigay-tulong sa paaralan. Ilan na ritoang pagbibigay ng 16 Smart TV na ilalagak sa lahat ng silid-aralan, ang pagtatanim ng mga fire tree, at ang bagong sound system. Ilan lamang ito sa napakaraming biyaya na natanggap ng paaralan mula sa pinakamamahal na ama ng lungsod ng Marikina.</p>', '1', '1', '2018-10-08'),
(11, 2018, 'October 31, 2018', 'Sineliksik.jpg', 'JDPNHS, champion in SINELIKSIK division festival of talents', 'By Cristina S. Barde', '<p>Jesus Dela Peña National High School emerged as champion in Sineliksik (Media Arts/Film Making) Division Festival of Talents held at Concepcion Elementary School on October 10, 2018.</p>\r\n<p>Enrico Diaz III of 12 Oracle, Robin Arthur Ledesma and Glen Dancel of 11 Lynx comprise the team that represented JDPNHS under the mentorship of Mr. Ejay Cena, Art Club Coordinator. With the theme, “Be an Inspiration,” JDPNHS landed on first place, followed by Sta. Elena High School and Marikina Science High School, second and third place respectively. </p>\r\n<p>“It doesn’t matter if we win or lose, all that matters is we enjoyed the ride. It’s already a blessing for us to be able to compete and represent the school,” the boys stated happily.</p>', '1', '1', '2018-10-31'),
(12, 2017, 'September 13, 2017', 'chua.jpg', '6<sup>th</sup> division technolympics', 'By Admin', '<p><b>JEREMIAH G. CHUA</b> a grade 12-JAVA of Jesus Dela Peña National High School won 3<sup>rd</sup> Place in Technical Drafting using AutoCad during the 6<sup>th</sup> Division Technolympics 2017 held at Jesus Dela Peña National High School last September 4, 2017.</p>', '1', '2', '2017-09-13'),
(13, 2017, 'September 13, 2017', 'diaz.jpg', '6<sup>th</sup> division technolympics', 'By Admin', '<p><b>ENRICO ARTHUR S. DIAZ III</b> a grade 11-Intel of Jesus Dela Peña National High School won 2<sup>nd</sup> Place in Computer Systems Servicing during the 6<sup>th</sup> Division Technolympics 2017 held at Jesus Dela Peña National High School last September 4, 2017.</p>', '1', '1', '2017-09-13'),
(14, 2017, 'September 13, 2017', 'juliane.jpg', '6<sup>th</sup> division technolympics', 'By Admin', '<p><b>JULIANE FRANCES M. CARLOS</b> a grade 10-Patience of Marikina Science High School won 2<sup>nd</sup> Place in Technical Drafting using AutoCad during the 6<sup>th</sup> Division Technolympics 2017 held at Jesus Dela Peña National High School last September 4, 2017.</p>', '3', '5', '2017-09-13'),
(15, 2018, 'March 20, 2018', 'aducal-1.jpg', 'On-the-spot poster making contest cum slogan writing contest', 'By Admin', '<p><b>Robert Ariel Aducal</b> a grade 11 student of Jesus Dela Peña National High School won 1<sup>st</sup> place in the On-the-Spot Poster Making Contest Cum Slogan Writing Contest spearheaded by the Daughters of Mary Immaculate International - Our Lady of the Abandoned Circle last March 16, 2018 held at OLA Multi-purpose hall.</p>', '1', '2', '2018-03-20'),
(16, 2018, 'November 05, 2018', 'earthquake-drill.jpg', 'JDPNHS, nagsagawa ng earth quake drill', 'By Admin', '<p>Muling nagsagawa ang paaralan ng \"Earth Quake Drill\" sa pangunguna ng NDRRMC koordineytor, G. Derik Dacut. Ang gawaing ito ng paaralan ay para sa paghahanda ng mga mag-aaral at mga empleyado sa mga hindi inaasahang mga kalamidad at mga insidenteng nagaganap ngayon sa iba\'t ibang panig ng bansa.</p>\r\n<p>Dito, paulit-ulit na pinatitimo sa mga mag-aaral ang ugaling \"duck-cover-hold\" at ang kalmado at mabilis na paglisan sa mga lugar kung saan sila naroroon.</p>', '1', '4', '2018-11-05'),
(17, 2018, 'November 12, 2018', 'technolympic-2018.jpg', '7<sup>th</sup> division technolympics', 'By Admin', '<p><b>ENRICO ARTHUR S. DIAZ III</b> a grade 12 student of Jesus Dela Peña National High School won 1<sup>st</sup> Place in Computer Systems Servicing during the 7<sup>th</sup> Division Technolympics held at Fortune High School last November 9, 2018.</p>', '1', '3', '2018-11-12'),
(18, 2018, 'November 21, 2018', 'Ashley.jpg', 'Lions club peace poster making contest', 'By Admin', '<p><b>Ashley Alvaran</b> a grade 7 student of Jesus Dela Peña National High School won 1<sup>st</sup> Place in Poster Making Contest last October 25, 2018 held at Marikina Valley.<p>', '1', '1', '2018-11-21'),
(19, 2018, 'November 30, 2018', 'regional-technolympics-2018.jpg', '2018 EPP-TLE-TVL regional technolympics', 'By Admin', '<p><b>ENRICO ARTHUR S. DIAZ III</b> a First Runner-up in 2018 EPP-TLE-TVL Regional Technolympics, Computer Systems Servicing (CSS) Category held at Esteban Abada Elementary School, Quezon City last November 28, 2018.</p>', '1', '1', '2018-11-30'),
(20, 2019, 'November 22, 2019', 'ppc-19-20.jpg', '#TATAKJDPNHS', 'By Admin', '<p>Lions Club Peace Poster Making Contest 2019 Winners</p>\r\n<p>\r\n<div>1<sup>st</sup> Place - Jinny Babes C. Faderogao</div>\r\n<div>2<sup>nd</sup> Place - Roseve Joy C. Legaspi</div>\r\n<div>3<sup>rd</sup> Place - Hanna Kim M. Alcaide</div>\r\n</p>', '1', '2', '2019-11-22'),
(21, 2019, 'January 22, 2019', 'news-13.jpg', 'JDPNHS, itatampok sa channel 13', 'Ni Maru U. Panganiban', '<p>Mapapanood sa darating na Pebrero 10, ganap na ika-5 ng hapon hanggang 6 ng gabi sa channel 13 (IBC 13) ang isang segment tungkol sa edukador na may pamagat na “School of the Future”. Tampok rito ang ating programang eLearning at mga piling mag-aaral mula sa baitang 10. Matutunghayan dito ang idealistiko patungong realistikong pagtingin sa edukasyon ng ating bansa para sa ika-21 na siglo sa pamamagitan ng makabagong pamamaraan ng pagtuturo at pagkatuto gamit ang teknolohiya.</p> \r\n<p>Tatalakayin din sa nasabing programa ang mga isyu at hamon para sa mga edukador ng ating bansa. Kinapanayam dito ang ilang mga opisyal mula sa DepEd Marikina kabilang ang punongguro ng atingpaaralan, G. Joseph T. Santos.</p>\r\n<p>Sama-sama nating abangan at panoorin ang kauna-unahang segment na pantelebisyon na tampok ang ating pinagmamalaking programang eLearning ng Mataas na Paaralang Pambansa ng Jesus Dela Peña.</p>', '2', '5', '2019-01-22'),
(22, 2019, 'February 01, 2019', 'mbiml.jpg', 'Munting basura ibulsa muna', 'Ni Maru U. Panganiban', '<p>Inilunsad ng pamahalaang lungsod ng Marikina ang kampanyang “munting basura, ibulsa muna” sa pangunguna ng mahal na Mayor Marcelino R. Teodoro kasama ang ilang mga opisyal ng lungsod at Kagawaran ng Edukasyon mula sa dibisyon ng Marikina sa pangunguna ng tagapamanihala ng mga paaralan na si Dr. Joel T. Torrecampo.&nbsp;&nbsp;Layunin ng kampanyang ito na manumbalik sa isip, sa kilos, at sa gawa ang pag-uugali ng mga Marikenyo sa pagiging disiplinado pagdating sa sarili sa pamamagitan ng pagtatapon ng munting basura sa tamang lugar.</p> \r\n<p>Sinimulan ang programa sa pambungad na pananalita na pinangunahan ng punongguro ng paaralan na si G. Joseph T. Santos. Pinatimo ng punongguro sa mga mag-aaral na ang mga taga Jesus Dela Pena ay taga-Marikina at may mabuting ugali.</p>\r\n<p>Samantala, nagbigay naman ng kaniyang inspirasyunal na mensahe tungkol sa kampanya ang gurong si Bb. Jane Ethel S. David. Binigyang pansin ni Bb. David ang mga mahahalagang pag-uugali kaakibat ng pagsunod sa kampayang munting basura, ibulsa muna.</p>\r\n<p>Sa pagdating ng mahal na Mayor Marcy ay nagkaroon ng presentasyon na nagpatingkad sa programa ang awit at sayaw na binuo ng mga mag-aaral mula sa Marikia Science High School.&nbsp;&nbsp;Sabay-sabay na sinayaw ng mga nagsidalo sa programa ang “Munting Basura, Ibulsa Muna Dance”.</p>\r\n<p>Sa pagtatapos ng programa ay sabay-sabay na binuksan at kinain ang biskwit at sabay-sabay ring ibinulsa ang munting basura na naging pokus ng kampanya.</p>\r\n<p>Pinasigla rin ng programa ang ilan sa mga laro na inihanda ni Mayor at ito ay sa pamamagitan ng mga tanong na may kaugnay sa programa.&nbsp;&nbsp;Ang bawat mag-aaral na nakasagot ay nakatanggap ng 500 piso bilang pabuya.&nbsp;&nbsp;Sa huli, pumili ng anim na mag-aaral na silang nagpakitang-gilas sa pagsayaw at pareparehong nakatanggap ng 500 piso at ang isa ay nakatanggap naman ng 1,000 piso.</p>\r\n<p>Maaalala na ang lungsod na Marikina ay ginawaran bilang “City in the Pink of Health” dahil sa kaayusan at kalinisan mula sa sarili hanggang sa kapaligiran.&nbsp;&nbsp;Kaya naman, ang ugaling ito ay muling sinimulan at binuhay sa pamamagitan ng aktibo, makasaysayan at kapupulutan ng aral hindi lamang sa paaralan kundi hanggang sa kani-kanilang mga tahanan dahil ang disiplina ay nagsisimula sa pagtatapon ng tama, munti man ang basura.</p>', '2', '3', '2019-02-01'),
(23, 2019, 'February 04, 2019', 'anti-bullying.jpg', 'Republic act 10627, Otherwise known as the anti-bullying law act of 2013', 'By Leslie Michelle M. Salceda', '<p>Bullying involves three personalities: “The Bully”, “The Person Being Bullied”, and “The Audience”.This is one of the highlights of the campaign about “Anti-Bullying Law (Act of 2013) (Republic Act 10627)” held at Jesus Dela Peña National High School’s eLearning Resource Center conducted by the Zonta Club of Marikina City as part of the programs of the JDPNHS Prefect of Discipline last February 1, 2019.</p> \r\n<p>The objectives of this campaign is to educate and raise students’ awareness about the Anti-Bullying Act, where video clips about different bullying scenarios were presented, and types of bullying and the things that the students need to do and remember were discussed.</p>\r\n<p>From the discussion, students were very much enlightened about the types of bullying which includes: physical bullying, verbal bullying, gender-based bullying, emotional bullying, social bullying, and cyber bullying - any type of these must be reported to any person in authority and must be given an immediate action.</p>\r\n<p>Moreover, students were also informed that anyone who is reported as the bully may be given suitable sanctions based on investigations. The sanctions could be a written reprimand, suspension(s), community service, or an expulsion depending on the level of bullying being done to the victim.</p>\r\n<p>On the other hand, the campaign became more informative and interactive with the questions being raised by the students as well as the teachers. All the questions were answered and explained well.</p>\r\n<p>The students were also very much gratified about the Anti-Bullying Act campaign, because, aside from the information being nourished to them, snacks and drinks were also given.</p>', '1', '1', '2019-02-04'),
(24, 2019, 'September 18, 2019', 'tagisan-ng-talino-2019.jpg', 'JDPNHS, kampeyon sa 2019 pansangay na tagisan ng taleno', 'Ni Maru U. Panganiban', '<p>Nasungkit ng apat na mag-aaral ang unang puwesto para sa taunang Pansangay na Tagisan ng Talento na nilahukan ng 16 na paaraalan sa Sangay ng Marikina. Pumangalawang puwesto ritoang Marikina Science High School at pangatlong puwesto naman ang Fortune High School.</p>\r\n<p>Ang mga mag-aaral na sina Keisha Gail Francisco (G7), Clarisse Guillermo (G8), Shereign Silaba (G9), at Seth Nicole Torres (G10) ay kinatawan ng Dibisyon ng Marikina bilang isang pangkat para sa Rehiyonal na Tagisan ng Talento sa darating na Nobyembre 2019 sa Lungsod ng Maynila.</p>', '3', '7', '2019-09-18'),
(25, 2019, 'September 26, 2019', 'scie-tech-fair-2019.jpg', 'JDPNHS student soars high at the division science and technology fair 2019', 'By John Paul A. Morpe', '<p>Mark Christian Reyes, a Grade 9 student won Fourth Place in the Science Quiz Bee during the Division Science and Technology Fair last September 25, 2019 held at Parang Elementary School, trained by Ms. Mary Grace J. Masongsong with the support of the Science Department Coordinator Ms. Salvacion Adona.</p>\r\n<p>“I have trust to Christian. He is very alert and willing to listen. He never complained about the bunch of reviewers I asked him to read. His eagerness to learn and win really paid off,” his coach, Ms. Masongsong affirmed.</p>\r\n<p>Aside from Christian, the three students, Enrico Buenaventura (G7), Annalise Dela Cruz (G8), and Lance Faith Cepe (G10) also represented the school and joined the said competition. The four delegates of JDPNHS exhibited efforts in scientific skills to bring pride to school.</p>\r\n<p>Reyes’ journey is not yet done. He will represent the Division of Marikina in the upcoming Regional Science and Technology Fair (RSTF) 2019.</p>', '1', '13', '2019-09-26'),
(26, 2019, 'September 27, 2019', 'division-meet.jpg', 'JDPNHS sinungkit and district meet', 'Ni Renzo V. Tante', '<p>Umupo sa trono patungong Pansangay na Palaro ang Jesus Dela Peña National High School matapos manalo kontra Barangka National High School noong ika-13 ng Setyembre 2019.</p>\r\n<p>Sumabak sa matinding labanan ang bata ng Jesus Dela Peña nang talunin ang dalawang paaralan mula Unang Distrito patungo sa Pansangay na lebel.</p>\r\n<p>Haharap ang JDPNHS Mens Volleyball team sa matinding pagsasanay sa loob ng isang linggo bago sila lumaban sa darating na Oktubre. Inaasahan ng ating koponan ang mga malalakas na kalaban mula sa MARIPRISAA at mga pampublikong paaralan sa lungsod ng Marikina. Mas lalo pa nilang pinagtitibay ang kanilang relasyon at pagkakaibigan para sa isang kaabang-abang na laban.</p>', '1', '3', '2019-09-27'),
(27, 2019, 'October 01, 2019', 'dspc-2019.jpg', 'JDPNHS journalists bagged 10 gold medals from the 21<sup>st</sup> DSPC', 'By Rune Arys A. Lapid', '<p>JDPHNS English and Filipino Journalists bagged 10 gold medals from the 21<sup>st</sup> Division Schools Press Conference and Contests held at Concepcion Elementary School on September 13, 2019 .</p>\r\n<p>The 10 winners from Jesus Dela Peña National High School are moving on to represent Marikina Division in the Regional Schools Press Conference (RSPC) on October 8, 9 and 10 at Aurora Quezon Elementary School, Malate, Manila.</p>\r\n<p>The 5 winners from English Category are ranked from 4<sup>th</sup> to 7<sup>th</sup> place respectively: Loraine Grace Bautista (Photo Journalism), Christian D. Palanas (Feature Writing), Keisha Gail Francisco (Copy Reading and Headlining), Jomari Merida (Editorial Cartooning), and Sophia Hernandez (Photo Journalism). As for the remaining five, they landed 2<sup>nd</sup>, 3<sup>rd</sup>, 6<sup>th</sup>, and 10<sup>th</sup> place in the Filipino Category respectively: Renzo Valencia Tante (Pagsulat ng Balitang Isports), Juliah Trixie B. Sancho (Pagsulat ng Balita), Paula Marantal (Pagwawasto at Pag-uulo), Christian Fabian (Pagkakartung Editoryal), and Whengcel Lunag (Pagsulat ng Kolum).</p>', '2', '5', '2019-10-01'),
(28, 2020, 'February 11, 2020', 'Ugaling-Matapat.jpg', '“Jesus Dela Peñan, may ugaling matapat”', 'Ni Julliah Trixie Sancho', '<p>Ang pagiging matapat ay isa sa magandang ugali na marapat taglayin ng isang tao. Sabi nga, “Ang pagsasama ng matapat ay pagsasama ng maluwat”, mula ritoý nakabubuo tayo ng isang mabuting ugnayan sa kapuwa at kumunidad na tiyak na mayroon ang mga mamamayan ng lungsod ng Marikina.</p>\r\n<p>Ang Lungsod ng Marikina, sa pangunguna ni Mayor Marcelino R. Teodoro ay naglalayong mapanatili ang pagkakaroon ng mabuting ugali ng mga Marikeño mula sa kampanyang #DisiplinaMuna.</p>\r\n<p>Isa sa mga paaralan na maipagmamalaki ng Lungsod ng Marikina ay ang Jesus Dela Peña National High School na kinilala sa pagkakaroon ng mga mag-aaral na may mabuting ugali. At isa na rito ay ang pagpapamalas ng katapatan.</p>\r\n<p>Hindi lamang basta binabanggit ng mga mag-aaral ang katagang, “Ako ay Jesus Dela Peñan, Ako ay Matapat” sa tuwing babati bagkus ay pinapangatawanan din nila ito.</p>\r\n<p>Isa sa mga programang ng paaralan mula sa Project Smile ay ang #JDPUgalingMatapat. Tampok dito ang programang \"Lost and Found\" na sa tuwing may gamit na nawawala o kaya naman ay nakikita, agad itong dinadala sa Guidance Office at agarang binibigyan ng aksyon upang maipabatid sa lahat ang bagay na natagpuan gamit ang Facebook Group ng paaralan.</p> \r\n<p>Ilan sa mga bagay na madalas na naiuulat at nakikita ay ang cellphone (tulad ng Adroid Phone at Iphone), pera (mula P20.00 hanggang P1,000.00) at pitaka. Ang mga naiulat na nawawala ay pawang mga nadadampot sa mga palikuran at kantina ng paaralan.</p>\r\n<p>Ayon kay kay Bb. Flerida Venzon, gurong-tagapatnubay, “lubhang napakaganda ng salitang katapatan, mula rito ay nakalalaya tayo sa anumang bagay na bumabagabag sa atin at isang karangalan na makahubog ng mga mag-aaral na may mabuting ugali. Kaya’t ang mga guro at ang mga tagapamahala ng ating paaralan ay labis na natutuwa sa katapatang mayroon ang mga mag-aaral at humihiling na sanaý maipagpatuloy ang kaugaliang ito sa loob man o labas ng paaralan.”</p>\r\n<p>Samakatuwid, nagpapatunay lamang ito na ang mga programa ng pamahalaang lungsod ng Marikina ay isinasabuhay at patuloy na pinaiiral dahil ang bawat Jesus Dela Peñan ay taga Marikina at may mabuting ugali.</p>', '3', '5', '2020-02-11'),
(29, 2020, 'May 28, 2020', 'Keona.jpg', 'Learn anytime, anywhrere', 'By Keona Ruth DG. Romero', '<p>The term “eLearning” was first introduced in 1999, but more accurate words were used; for instance, “online learning” and “virtual learning”. Though the term had just been introduced in the 20<sup>th</sup> century, it is said that the essence and principles of eLearning has dated back to the 19<sup>th</sup> century, meaning early forms of eLearning has been used then. eLearning without the use of the internet was conducted through sending mail and tutors, until the early 2000s. But now, eLearning is a program where (typically) students learn through electronic media, such as phones, tablets, laptops, computers, etc. Students use a platform, usually Google Classrooms or a platform developed by the school. With the use of their email or username and password (provided by the school), students can access their account to see announcements, activities/projects, assessments and can also contact their teacher with the messaging feature.</p>\r\n<p>With the hard work of the advocates of eLearning: Dr. Elizabeth E. Quesada and Mr. Joseph T. Santos, members of the Technical Working Group and the selected Faculty Members, eLearning in the City of Marikina was implemented in 2013. The following year, Jesus Dela Peña National High School was established as the Center for eLearning. For 7 years, JDPNHS has been promoting the use of eLearning, making their students disciplined when it comes to time management and independent learning. Even when absent on face-to-face classes, students may access the things they have missed. They can also see their future topics, meaning they can study in advance, making their time at home even more productive.</p>\r\n<p>The eLearning Program really helped me figure out my schedule at home. The program helped me manage my time well. It also helped me do at home the things that I couldn’t in school. I get to finish activities that would take a while to finish. I have access to materials that would be hard to get when in school, and I can take my time in finishing projects.</p>\r\n<p>Due to COVID-19, we are to stay quarantined at home, and limit our time outside to avoid being infected by the said virus, making eLearning or “online learning” a big help for teachers and students. As an eLearner for 2 years now, I got used to the program, so having online classes isn’t that big of a change for me and my fellow Jesus Dela Peñans.</p>', '2', '11', '2020-05-28'),
(30, 2020, 'June 12, 2020', 'loraine-grace-c-bautista.jpg', 'Marikina City’s eLearning program: Education through the looking screen', 'By Joseph T. Santos', '<p>The pandemic that inflicted the world makes us distanced one another physically, and the field of education is no exception to it. With this situation it doesn’t mean that we should also distance ourselves from the access of quality education when there is an obvious alternative for this massive change, Online Learning.</p>\r\n<p>Since the crisis got all of us caged in our homes, our new reality is now uncertain. This is a big challenge that our modern teachers and 21<sup>st</sup> century learners have to face; thus, we should use all the means that we have with the on-going battle against the pandemic. The technology advancement provides us faster way of getting information, everything is just one click away. Online Learning is the best aid for the students who are stuck in their homes. With the help of the instructors in organizing and creating learning materials designed for producing globally competent students, this is made possible.</p>\r\n<p>Learning and Instructional Materials are created for the students’ easy access. They could concentrate and study more in the comfort of their homes while focusing on the essential information within their grasp. This would be a huge advantage to both the instructor and the learner, mastering what the digital age offers in terms of education. This would also enhance their capacity in utilizing the modern technology for academic purposes.</p> \r\n<p>One of the advantages of Online Learning is flexibility, since the rules would not be strict especially on the schedule. Students will be less stressed and pressured compared to a face to face encounter. Students will have their own timetable and could work on their projects and online activities freely anytime of the day.</p> \r\n<p>Online Learning would reduce costs to the students, since all they need is an instructor as well as a fast internet service provider. Submitted output doesn’t need to be printed out, it would be sent online through the Learning Management System’s Platform. For the teachers on the other hand, they can easily prepare and upload learning materials, ready for use, by the learners. Students in classroom don’t usually get full attention from teachers but with the help of Online Learning, this wouldn’t be an issue, because teachers could focus equally more to their learners in terms of providing modules and activities, video conference, communicating through chat room or via email, and other ways of providing information.</p> \r\n<p>Since 2013, Online Learning was already used in this City as an alternative delivery mode of learning and it was made possible through its Division eLearning Program implemented by the DepEd Schools Division Office and the City Government at Jesus Dela Peña National High School the Center for eLearning, the only eLearning public school in the Philippines. In this present pandemic, the Schools Division Office decided to expand the program to all the secondary schools in the city.</p>\r\n<p>With the digital age upon us, we must use its advantages and what it could provide to our society. Let us bridge the gap between our learners and teachers for quality education that every student deserves.</p>\r\n<p>Be an eGuro (eTeacher,) be an eStudyante (eLearner), in the new normal.</p>', '1', '8', '2020-06-12'),
(31, 2020, 'June 25, 2020', 'christian-rivera-eduarte.jpg', 'Education is not all about the learning of facts, but the training of the mind to think', 'By Christian R. Eduarte', '<p>We all know that education is genuinely important to us all. As what people always say, Education is the key to success. But did you know that education is not all about the facts that we learn but also to help our mind to think in different situations and aspect of life? The school we are going to choose is one of the factors as to how we can train our minds to think and educate ourselves.</p>\r\n<p>I started my Junior High at Tañong High School. It is a great school. The teachers are good at teaching and handling students. It’s just hard for me to adjust myself from an elementary to student to a Junior High Student, but I had a great experience. I transferred to <b>Jesus Dela Peña National High School Center for eLearning</b> when I was in my 8<sup>th</sup> Grade because it was closer to my home. At first, I was very confused about how the \"online learning\" works, but that\'s not a problem because we, new students, had a session. It was explained to us how to use the eLearning platform.</p>\r\n<p>When I got familiar with the flow of the school program, I was so amazed because I couldn’t believe that there’s a new way of how the students can learn with ease. I only go to school 2-3 days a week to have face-to-face classes and by the day I have an online class, the eGuros will post tasks and assessments in the platform and I’ll have to work on it and submit it before the given deadline.It’s awesome because I have more time for my hobbies and improve my skills. I also have more time with my family. I especially liked it because even though we are on vacation, I can learn and submit my works online. My modules and other school related things are just one tap away on my phone. It is so easy that everything I do is accessible anytime and anywhere I go as long as I have internet connection.I also feel like I am more advanced than the other students when it comes to learning. I use my gadgets more than paper. I accomplish my tasks completely paperless.</p>\r\n<p>There was a time that I was a little worried. I thought that we might be late with our lessons compared to other schools because I only go to school 2-3 times a week.But when I asked my friends from other schools about their current lessons, I was shocked because our lessons are ahead of them even though they go to class 5 times a week. Add to this, as an eLearning student, I have a chance to explore more about the topic given by my eGuro. Therefore, eLearning is much more advanced than the old system of learning and the students also learn how to self-study efficiently thus they become independent learners.</p>\r\n<p>The school is also the best choice because of its specialization. They teach students about Illustrations and Computer System Servicing and it is the most needed knowledge for me and all other students because our generation is all about technologies. I chose Computer System Servicing when I was on Grade 9 and the lessons are familiar to me.</p> <p>Whenever there’s a practical test, I always get 100 at it. All the knowledge that I’ve learned, I continue to improve it. By 10<sup>th</sup> Grade, I knew how to reformat computers and laptops, and how to fix computers problems and issues. I was so obsessed about learning new things that I’ve even learned how to open someone’s computer or laptop even though I don’t know the password of it. (not really a nice practice though ?) The best thing that I did was repair my broken phone screen on my own because of what I’ve learned from my school.</>\r\n<p>I was a consistent Honor Student in Jesus Dela Peña National High School from Grade 8 to Grade 10 and was always involved at school and district activities and contests. For me, eLearning should be implemented in other places and should continue even after the pandemic ends.</p>', '2', '25', '2020-06-25');
