(32, 2021, 'May 19, 2021', 'HighestBadgeEarners-01.jpg', '220 eLearners awarded digital badges and certificates for the second quarter', 'By Menere R. Nasiad', '<p>e-Learning Program Manager <b>Mr. Joseph T. Santos</b> awards digital badges and \r\ncertificates of recognition to the 220 high school e-learners for the second quarter. The \r\nawardees have consistently been using the portal for their asynchronous lessons. \r\nLikewise, these awardees received the highest mean scores in their written assessments.</p>\r\n<p>The digital badge is given to the e-learners who have earned the highest, if not \r\nperfect, scores among the more than 1,500 e-learners enrolled in Marikina public schools \r\nregardless of the number of assessments across disciplines. The assessments were \r\nmeticulously crafted and uploaded by their respective teachers.</p>\r\n<p>Five digital badge awards shall be given to the e-learners of Jesus Dela Peña \r\nNational High School: Grade 7 e-learner <b>Kyle Ethan V. Regalado</b> (Assertive) who earned \r\n39 badges, Grade 8 e-learners <b>Edrian G. Magcawas</b> (Delightful) and <b>Kevin P. Cayetano</b>\r\n(Artful), who earned 16 badges respectively, Grade 9 e-learner <b>John Michael N. Moralde</b> \r\n(Benevolentness) who earned 45 badges, and Grade 10 e-learner <b>Chester Fritz Mendoza</b>\r\n(Affable) who earned 32 badges.</p>\r\n<p>The Frequent eLearning Platform Users award is given to the deserving e-learners who \r\nhave fulfilled or completed all the requirements, such as doing certain activities and \r\ngaining high scores in all the assessments made by their e-teachers. For this quarter, the \r\nJesus Dela Peña National High School, which is under the leadership of <b>Mr. Antonio G. \r\nAndres</b>, earned the greatest number of points based on the usage statistics.</p>\r\n<h2>List of Awardees</h2>\r\n<div style=\"margin-bottom:5px;\">GRADE 7</div>\r\n<b>Adaptive:</b>\r\n<ul style=\"font-style:italic;\">\r\n<li>Alexander Dwight D. Callo</