>\r\n<li>Kim Carl G. Aristorenas</li>\r\n<li>Miguel Angelo L. Viñas</li>\r\n</ul>\r\n<b>Amiable:</b>\r\n<ul style=\"font-style:italic;\">\r\n<li>Jan Althesza Gutierrez</li>\r\n<li>John Rhene Ramos</li>\r\n<li>Krizzy M. Sabariza</li>\r\n<li>Liana Dane M. Razon</li>\r\n<li>Princess Bless Cabacang</li>\r\n<li>Ryan D.R. Aguilar</li>\r\n<li>Xyle Xan A. Mula</li>\r\n</ul>\r\n<p>Certificates of appreciation are accorded to Kalumpang National High School, \r\nMarikina Heights High School, Marikina High School, Parang High School, and Sto. Niño \r\nNational High School for continuously empowering the e-learners to maximize the use \r\nof the e-learning platform.</p>\r\n<p>The digital badge and certificate of recognition are some of the implemented plans \r\nof the e-Learning Program. Recognizing the e-learners for their massive use of the \r\ne-Learning platform this school year is one way to motivate them to be more participative \r\nand engaged in online distance learning. Likewise, the SDO-Marikina tries its best to \r\nmake the learners feel that they are not alone in their quest for knowledge despite the \r\nchallenges brought about by the pandemic.</p>\r\n<p>The Technical Working Group commits to its mission and vision of responding to\r\nthe needs of the e-learners by providing them access to the learning resources and \r\ndeveloping rewarding activities that create a sense of pride in their achievements and \r\nencourage each other that learning is indeed a lifelong journey.</p>', '9', '48', '2021-05-19'),
(33, 2021, 'June 17, 2021', 'HighestBadgeEarners.jpg', 'JDPNHS gets the highest badge earners for the third quarter', 'By Menere R. Nasiad', '<p>Eight high school students from Jesus dela Pe?a National High School got the highest \r\nassessment scores reflected on the eLearning platform for the third quarter. The highest \r\nbadge earners are the following: <b>Grade 7</b> e-learners Kyle Ethan Regalado (Assertive) and \r\nEhrika Mae Maylon (Appreciative), who earned 35 badges; <b>grade 8</b> e-learners Jade \r\nLawrence Sarapi (Cheerful), and Ivan Patrinilio Valencia (Delightful), who earned 21 badges;\r\n<b>grade 9</b> e-learners Alessanda Fernandez Sampoleo (Awesomeness), Rich Romero Mataga \r\n(Benevolentness) and John Michael Moralde (Benevolentness), who earned 50 badges; and \r\n<b>grade 10</b> e-learner Chester Fritz Mendoza (Affable), who earned 33 badges. Recognition is \r\nalso given to the e-teachers for actively using the eLearning platform. JPNHS uploaded 139 \r\nassessments across subjects for the third quarter.</p>\r\n<p>Regalado, Moralde and Mendoza, who were recognized in the second quarter, \r\nmaintained their high performance in the assessment. Digital certificates of recognition will \r\nbe sent through email at the end of the school year.</p>\r\n<p>To qualify in the Highest Badge Earner category, all the e-teachers are encouraged to \r\nprepare and upload at least 3 assessments per quarter to their e-learners. The e-learners are \r\nexpected to complete and score the highest in all the assessments using the eLearning \r\nplatform.</p>', '7', '48', '2021-06-17'),
(34, 2021, 'October 25, 2021', 'kyle_ethan_regalado.jpg', 'My experiences as a new eLearner', 'By Kyle Ethan V. Regalado', '<p>The eLearning Platform is the new learning environment in the new normal, which uses information and online communication technology as a platform for teaching and learning activities. Since this pandemic started, the traditional face-to-face learning method that provides live interaction between teachers and students has been suspended to ensure the health and safety of everyone. Although face-to-face classes were temporarily ceased; the Division of Marikina has the E-learning platform to ensure that learning will continue amidst the crisis. With the eLearning method, teachers and students are equipped with online classroom tools that enabled them to prepare, review and teach lessons on one platform, conduct recitations and quizzes, and communicate thru instant messaging.</p>\r\n<p>For me as a 7<sup>th</sup> grade eLearner, I found it a little bit frightening at first because as they say, trying new things is scary in the beginning. The larger the change, the harder is the learning process. To overcome my fear, I just looked on the brighter side and trusted what the new learning process will benefit me during the course. I know that I will be able to easily adapt to the changes if I will be equipped with the right attitude and complete set of tools.</p>\r\n<p>When I started using the eLearning platform, I was exposed to numerous struggles and problems. There were times that internet connection was not reliable due to technical issues, unable to fully concentrate because of the noise and different distractions at home such as social media, television and family which pull my attention away from the task that I am engaged to. Most of the time, bulk of activities is assigned to us which add up to the everyday struggle. Thankfully, there is this E-learning portal where I search all the activities, assessments, lessons, and announcements which help and empower me to acquire all the necessary, useful, and relevant information that I need.</p>\r\n<p>The eLearning platform had been very effective and efficient for our asynchronous lessons. It serves as a one stop shop which offers all the necessary and important data which indeed helped the students to save time and effort especially on visiting several and separate sites. By consistently utilizing the portal, I was able to know every aspect and usage of it, making it very handy and convenient to use. I can say that the platform lessens the burden every student has on his everyday learning process.</p>\r\n<p>My parents played a very big part in eLearning journey.  They helped and guided me by discussing the online course work daily. They taught me about the management of time for each activity, setting up the right mindset and correct approach towards every task. They constantly motivated and taught me how to focus and keep my composure despite the high volume of activities and assessments.</p>\r\n<p>In summary, my learning experiences with the eLearning platform is fun and interesting. Add to this, being one of the awardees of the digital badges back in Grade 7 encouraged me to study and work harder.</p>', '8', '50', '2021-10-25'),
(35, 2021, 'December 01, 2021', 'info-tech.jpg', 'JDPNHS student ranks third in the PLDT Infoteach-HomeFibr Broadband Quiz', 'By Menere R. Nasiad', '<p>Perseverance and hard work are what it takes to overcome challenges and achieve success. This quality must have stood out in grade 12 student Jobelle Maria M. Enverga of the Jesus Dela Peña National High School as she bagged second runner-up in the PLDT HomeFibr Broadband Quiz, which is participated in by top graduates of PLDT’s flagship education advocacy program Infoteach Outreach Webinar Series.</p>\r\n<p>According to Enverga, all the participating schools were given 10 modules to review, and worksheets to be completed within the deadline.  To qualify for the  \r\n final round, contestants must obtain the highest score in the worksheets.</p>\r\n<p>\"<i>Kailangan talaga ng perseverance upang, a-absorb mo talaga ang bawat napag-aralan mo sa modules.  Buti na lang at nandyan si ma\'am Imelda Zapanta na laging nagri-remind sa akin kung ano ang mga dapat gawin,</i>\" Enverga, who got the highest scores and represented the Marikina Division, said.  Likewise, Enverga mentioned that the InfoTech Webinar Series ran for 10 consecutive Fridays, including lectures, studying the modules, and completing all the worksheets.</p>\r\n<p>According to Ms. Zapata, training of teachers in the Marikina Division was facilitated by Education Program Supervisor Mr. Galcoso C. Alburo, and Information Technology Officer I Mr. Ryan Lee Regencia fir five days.  The training ensures that teachers can train participating students prior to the culminating event of the Infoteach Outreach Program.</p>\r\n<p>The final round in the PLDT HomeFibr Broadband Quiz was held last November 13. \r\n Jobelle Maria Enverga from Jesus Dela Peña National High School in Marikina City, Ma. Eugenie Yvette Gata from Casiguran National High School in Aurora, and Key Calpito from Cabarroguis National School of Arts and Trades in Quirino province took a 45-item test; each question should be answered within 15 seconds in the grand finals.</p>\r\n<p>Third place winner Enverga won fifteen thousand (P15,000) pesos, a laptop and a bronze medal.  Her school received a laptop and a plaque of appreciation.  The Schools Division Office of Marikina also received a plaque of appreciation.  The PLDT HomeFibr Braodband Quiz is the yearly culmination of the Infoteach Outreach Program, PLDTs flagship project for its education pillar.</p>', '11', '220', '2021-12-01'),
(36, 2022, 'November 28, 2022', '100-elem-student.jpg', '100 elementary pupils in Marikina City attend the DICT’s pilot implementation of Project CLICK', 'By Menere R. Nasiad<br>\r\nLayout by Mark Joseph B. Marantal', '<p>A total of 100 pupils aged 13 years old and below from five public elementary schools were chosen as participants in the pilot implementation of courses for literacy on internet and computer knowledge (Project Click) organized by the Department of Information and Communications Technology in collaboration with the Marikina City government. The said activity was held on November 28-29, 2022 at the Marikina Hotel and Convention Center.</p>\r\n<p>First District Marikina Representative Hon. Marjorie Ann Teodoro took the initiative to include Marikina among the list of recipients of DICT’s technology-related projects. All the participants were given free training to develop in them literacy on the use of the internet, and free 100 tablets to use in their schools. The congresswoman expressed optimism that the DICT can still dole out free tablets to all the learners in the 34 public schools in Marikina.</p>\r\n<p>The donated 100 tablets of the DICT is pursuant to DC No. 003, s 2012. The acquired device will benefit the teachers, students, as well as employees.</p>\r\n<div class=\"row\">\r\n<div class=\"col\">\r\n<img src=\"https://elearningmarikina.ph/images/news/cong-maan.jpg\" width=\"100%\">\r\n<p style=\"font-size:12px;\"><i>Congresswoman Marjorie Ann Teodoro thanked DICT for sponsoring the event as well as providing 100 tablets to the 100 participants.</i></p>\r\n</div>\r\n<div class=\"col\">\r\n<img src=\"https://elearningmarikina.ph/images/news/sds-sheryll.jpg\" width=\"100%\">\r\n<p style=\"font-size:12px;\"><i>SDS Sheryll T. Gayola says digital literacy is one of the priorities in the six-year strategic planning of SDO-Mar.</i></p>\r\n</div>\r\n</div>\r\n<p>SDO-Marikina has pledged its support by encouraging all public schools to promote digital literacy. Schools Division Superintendent Sheryll Gayola expressed her gratitude to the DICT and the local government unit for the effective implementation of Project CLICK with emphasis on cyber hygiene and cybersafe learning.</p>\r\n<p>ICT Literacy and Competency Development Bureau Director IV Maria Teresa Garcia said that Project CLICK was conceived with the students and teachers in mind. They are committed to serving the schools, especially those in geographically remote areas, by equipping them sufficient resources and series of trainings related to computer knowledge. By 2030, the bureau hopes to attain literacy on basic safety skills and cyber security in the country.</p>\r\n<div class=\"row\">\r\n<div class=\"col\">\r\n<img src=\"https://elearningmarikina.ph/images/news/elem-students.jpg\" width=\"100%\">\r\n<p style=\"font-size:12px;\"><i>Elementary pupils are excited to receive their free tablets and prepare themselves for a hands-on activity.</i></p>\r\n</div>', '6', '71', '2022-11-29');
