(14, '20', '2563', 'MATH-0715EMERALD', '2022-09-09', '08:37:15', 'mam tanong ako', '1'),
(16, '21', '1369', 'TECH-DRAFT-101359CREDIBLE', '2022-09-09', '08:52:39', 'The structure is maintained in place by a solid and well-designed foundation. A good foundation also serves other purposes besides only keeping a structure above ground. If the foundation is improperly constructed, the structure could eventually encounter severe structural issues.', ''),
(17, '21', '1362', 'TECH-DRAFT-101359CREDIBLE', '2022-09-09', '08:54:49', 'It affects its strength and building design for foundations are considered as a support for a certain structure. Having a good and suitable foundation may be an advantage to keep a building stable and strong enough to hold for a great amount of time. ', ''),
(18, '21', '1340', 'TECH-DRAFT-101359CREDIBLE', '2022-09-09', '08:56:07', 'Having a good and suitable foundation will help the building process faster and the structure itself to be much safer. Not only it will be safer, The foundation will hold for a long amount of time.', ''),
(19, '22', '2392', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '08:57:46', 'so that the structure would be able to stand or be perfectly still with the right corners and measurements ', ''),
(20, '22', '2354', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:01:44', 'To make sure that the building or house you are going to build is strong, this is what supports the pillar and leveling, this is also what the architects will look at for the building to be built.', ''),
(21, '21', '1363', 'TECH-DRAFT-101359CREDIBLE', '2022-09-09', '09:02:42', 'Having good and suitable foundation affects the building and its design by having a strong foundation, keeping the building standing or safe from any catastrophe also a suitable foundation should fit a proper foundation, the structure might experience problems in its foundation if not constructed properly. The structure should not only be good and suitable building by itself, the person or people living inside must feel secured and comfortable.', ''),
(22, '22', '2361', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:06:57', 'It will help you avoid problems and save lots of time later on and is also the strongest way to practically form structures.', ''),
(23, '22', '2360', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:11:46', 'to have a perfect layout and build the establishment strongly ', ''),
(24, '21', '1339', 'TECH-DRAFT-101359CREDIBLE', '2022-09-09', '09:15:13', 'Having a good and suitable foundation is affecting the design of the building and strength. The durability of a certain structure like a building will depend on how the reinforcement has been done. A properly built foundation will help to support and maintained its place, not just that, having a good foundation will help the structure of the building to hold and maintained in different disaster.', ''),
(26, '22', '2358', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:18:49', 'as critical as it is to get the dimensions right and the corners square.', ''),
(27, '22', '2358', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:18:50', 'as critical as it is to get the dimensions right and the corners square.', ''),
(28, '22', '2358', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:18:50', 'as critical as it is to get the dimensions right and the corners square.', ''),
(29, '22', '2358', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:18:50', 'as critical as it is to get the dimensions right and the corners square.', ''),
(30, '22', '2357', 'TECH-DRAFT-101359COACHABLE', '2022-09-09', '09:22:03', 'Having corners and squaring is important before construction because it supports the parts of the house and makes it strong.', ''),
(31, '', '1365', '', '2022-09-09', '09:28:00', '<p>Its design maybe a little rough,if it is not measured, adjusted, and built properly its foundation may not be strong, and because of that the people inside of it will perish.</p>', '18'),
(32, '21', '1365', 'TECH-DRAFT-101359CREDIBLE', '2022-09-09', '09:32:39', 'If it is not measured, adjusted and built properly, its foundation may not be strong enough to hold its building house etc... ', ''),
(33, '21', '1374', 'TECH-DRAFT-101359CREDIBLE', '2022-09-09', '13:17:10', 'a house / building may experience serious structural problems in the future if the foundation is not good and suitable ', ''),
(34, '', '1711', '', '2022-09-09', '01:42:33', '<p>Hershey N. Viernes</p>\r\n<p>The quality of the soil on your site plays a key role in your construction projects. As a result, you need to identify the characteristics of the soil&nbsp;<strong>to determine its ability to support your structure</strong></p>', ''),
(35, '', '1713', '', '2022-09-09', '02:08:09', '<p><em><strong>Testing your soil is important because it is where you will determine whether it can or cannot support your structure.</strong></em></p>', ''),
(36, '', '1707', '', '2022-09-09', '02:25:51', '<p>So it will be more easy to know what type of foundation they will use.&nbsp;</p>', ''),
(37, '17', '1684', 'TECH-DRAFT-101359COMPREHENDIBLE', '2022-09-09', '14:28:38', 'so that the foundation of the house will be strong and it will not be damaged immediately because if it is not looked after the foundation may be damaged which will cause a big problem', ''),
(38, '', '1678', '', '2022-09-09', '02:38:10', '<p>This is importatnt because knowing the soil quality will aware you to what materials should be used.</p>', ''),
(39, '', '2396', '', '2022-09-09', '02:57:59', '<p>As the foundation is the substructure of the building, it is necessary to lay out the dimension of each corner. The dimension must be measured to avoid further concerns during the construction.</p>', ''),
(40, '', '1682', '', '2022-09-09', '02:59:14', '<p>Because the soil where the structure will be built should be strong so that the building will not collapse.</p>', ''),
(41, '', '2374', '', '2022-09-09', '03:49:21', '<p>to get the dimensions right and foundation at the level.&nbsp;</p>', ''),
