th:173px\">\r\n			<p style=\"text-align:center\">&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:434px\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">Having a romantic relationship</span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; width:180px\">\r\n			<p style=\"text-align:center\">&nbsp;</p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; width:171px\">\r\n			<p style=\"text-align:center\">&nbsp;</p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; width:173px\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><strong><span style=\"background-color:white\"><span style=\"font-family:&quot;MS Gothic&quot;\"><span style=\"color:#202124\">?</span></span></span></strong></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\"><strong>Guide Questions:</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1. What were your top 3 values? <strong><u>My top 3 values are living according to my religious beliefs, getting along with my family, and being in good physical condition.</u></strong> Why? <strong><u>Living in accordance with my religious beliefs&nbsp;comes first on my list because&nbsp;I&#39;ll be hesitant to go against God&#39;s will. Second is getting along with my family because they are vital to me and will always be there for me, no matter what. Lastly is being in&nbsp;good physical condition. Because maintaining good health is important, as the saying goes, &ldquo;health is wealth&rdquo;. If we are not healthy,&nbsp;our money cannot buy health. We only live once.</u></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2. What did you discover about yourself? <strong><u>I discovered a lot of things about myself. I was able to assess the important things in my life. I also discovered that there are lots of factors to consider and it seems that all these factors were pretty hard to rank.</u></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3. What did you enjoy most in the activity? <strong><u>I enjoyed knowing the values that I should prioritize in my life. I also enjoyed doing this checklist because&nbsp;this helped me recognize the various values that I needed to consider. </u></strong></span></span></p>\r\n', NULL, '2022-08-30', NULL, '', '08', 30, 2022),
