(18, '1724', 'MAP-08961STACT2', NULL, '<p><a href=\"https://scontent.fmnl25-2.fna.fbcdn.net/v/t1.15752-9/297765469_1172807103579400_3674998261859004234_n.png?_nc_cat=102&amp;ccb=1-7&amp;_nc_sid=ae9488&amp;_nc_eui2=AeEIn_yFbjgSi9FabYQAvn6kBMnJPdzhbNoEyck93OFs2qfiqMu6qlJ7opgGOfnqO5P_XjTTgsUt2JgPupp3LxVa&amp;_nc_ohc=ZDw4T2dx_-UAX-rrU0F&amp;tn=3OBiikA_nzbWkLGb&amp;_nc_ht=scontent.fmnl25-2.fna&amp;oh=03_AVKK5CLaECQv5FVC0biUAKhiHJQkN0cnueEIgl4QQSP6RA&amp;oe=633297DC\" target=\"_top\"><img alt=\"\" src=\"https://scontent.fmnl25-2.fna.fbcdn.net/v/t1.15752-9/297765469_1172807103579400_3674998261859004234_n.png?_nc_cat=102&amp;ccb=1-7&amp;_nc_sid=ae9488&amp;_nc_eui2=AeEIn_yFbjgSi9FabYQAvn6kBMnJPdzhbNoEyck93OFs2qfiqMu6qlJ7opgGOfnqO5P_XjTTgsUt2JgPupp3LxVa&amp;_nc_ohc=ZDw4T2dx_-UAX-rrU0F&amp;tn=3OBiikA_nzbWkLGb&amp;_nc_ht=scontent.fmnl25-2.fna&amp;oh=03_AVKK5CLaECQv5FVC0biUAKhiHJQkN0cnueEIgl4QQSP6RA&amp;oe=633297DC\" style=\"height:686px; width:641px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:1px\"><span style=\"font-size:12.5pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\"><u>Guide Questions: </u></span></span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:12.5pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">What were your top 3 values? Why? </span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:30px\"><span style=\"font-size:12.5pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\"><u>Getting along with my family, Having time alone myself and Having freedom to express myself. These 3 were my top 3 because relation with my family builds up a bond between me and them, having time alone to myself is the time where I can think of anything I want to think about, and the only one who can hear my thoughts is me, and having freedom to express myself because having freedom means there&rsquo;s no one to stop me on doing what I want or love, I can be whoever I want to be, without anyone saying otherwise. These top 3 of mine will help strengthen my emotional and mental health. </u></span></span></span></p>\r\n\r\n<ol start=\"2\">\r\n	<li><span style=\"font-size:12.5pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">What did you discover about yourself? </span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:30px\"><span style=\"font-size:12.5pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\"><u>I discovered that I tend to have a healthy way of living in life, and these actions that are important to me will help me live a life I want to live. </u></span></span></span></p>\r\n\r\n<ol start=\"3\">\r\n	<li><span style=\"font-size:12.5pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">What did you enjoy most in the activity? </span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:30px\"><span style=\"font-size:12.5pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\"><u>The parts where I checked the options that will make me happy if it really did happened to me, just by imaging it happening to me gives me that sensational enjoyment.</u></span></span></span></p>\r\n', NULL, '2022-08-30', NULL, '', '08', 30, 2022),
